t.put( 'geekitem_dialog_editcollection.tpl', ' <div ng-if="editctrl.showvars.initialized || editctrl.errorinfo.error"> <form name="collectioneditorform" 		ng-submit="editctrl.save()" 		novalidate 		class=\'modal-form\'>  	<div animate-switch-container ng-switch="editctrl.showvars.recordScreen"> 		<div class=\'switch-slide switch-secondary\' ng-switch-when="versions"> 			<div class=\'modal-header modal-header-table\'> 				<div class=\'modal-header-table-left\'> 					<button class=\'visible-xs-inline btn btn-indigo\' ng-click="editctrl.setRecordScreen(\'main\')" type=\'button\'> 						<span class=\'glyphicon glyphicon-chevron-left\'></span> 					</button> 				</div>  				<div class=\'modal-header-table-center\'> 					<h4 class=\'modal-title\'>Versions</h4> 				</div>  				<div class=\'modal-header-table-right\'> 					<button class=\'hidden-xs close\' type=\'button\' ng-click="editctrl.setRecordScreen(\'main\')"> 						<span>×</span> 					</button> 				</div> 			</div>  			<div class="modal-body"> 				<div class=\'list-selector\'> 					<ul class=\'form-group list-selector-items list-selector-items-condensed\'> 						<li class=\'media\' ng-click="editctrl.updateVersion( version ); editctrl.setRecordScreen( \'main\' )" ng-repeat="version in editctrl.editdata.versions.items"> 							<div class=\'media-left summary-item-thumbnail summary-item-thumbnail-micro\'> 								<img class=\'media-object\' ng-src=\'{{version.images.micro}}\' 									  ng-if=\'version.images.micro\'> 								<div class="media-object summary-item-thumbnail-placeholder" ng-if=\'!version.images.micro\'>   									<i class="fi-photo"></i>   								</div> 							</div> 							<div class=\'media-body\'> 								<name-with-year name="version.name" year="version.yearpublished"></name-with-year> 							</div> 						</li> 					</ul> 				</div> 				<div uib-pagination 					template-url="geekitem_pagination.tpl" 					total-items="editctrl.editdata.versions.config.numitems" 					ng-model="editctrl.showvars.versionPage" 					ng-change="editctrl.getVersions()" 					items-per-page="editctrl.showvars.versionShowcount" 					max-size="3" 					boundary-links="true"> 				</div> 			</div> 			<div class=\'modal-footer hidden-xs\'> 				<button class=\'btn btn-lg btn-subtle\' type=\'button\' ng-click="editctrl.setRecordScreen(\'main\')"> 					Cancel 				</button> 			</div> 		</div> 		<div class=\'switch-slide switch-primary\' ng-switch-default> 	<div class=\'modal-header modal-header-table\'> 		<div class=\'modal-header-table-left\'> 			<button class=\'visible-xs-inline btn btn-indigo\' ng-click="$dismiss()" type=\'button\'> 				<span>Cancel</span> 			</button> 		</div>  		<div class=\'modal-header-table-center\'> 			<h4 class=\'modal-title\'> 				<span> 					<span ng-show="editctrl.showvars.loading">Loading...</span> 					<span ng-show="!editctrl.showvars.loading"> 						<span ng-if="editctrl.editdata.item.collid">Edit</span> 						<span ng-if="!editctrl.editdata.item.collid">Add To</span> 					</span> 				</span> 			</h4> 		</div>  		<div class=\'modal-header-table-right\'> 			<button class=\'hidden-xs close\' type=\'button\' ng-click="$dismiss()"> 				<span>×</span> 			</button>  			<button class=\'visible-xs-inline btn btn-primary\'  ng-disabled="editctrl.saving" type=\'submit\'> 				<span>Save</span> 			</button> 		</div> 	</div>  	<div class=\'modal-body container-fluid collection-edit\' ng-if="editctrl.errorinfo.error"> 		<div class="alert alert-danger"> 			{{editctrl.errorinfo.error}} 		</div> 		<div> 			<button type=\'button\' 					  class=\'btn btn-link btn-sm\' 					  ng-click="$dismiss( \'skipConfirm\' )">Cancel 			</button> 		</div> 	</div>  	<div class=\'modal-body container-fluid collection-edit\' ng-if="!editctrl.errorinfo.error"> 		<div class=\'pull-right\' uib-dropdown ng-if="editctrl.editdata.item.collid"> 			<button type=\'button\' uib-tooltip=\'More options\' tooltip-popup-delay=\'500\' tooltip-append-to-body=\'true\' tooltip-placement=\'left\' class=\'btn btn-empty text-muted\' uib-dropdown-toggle> 				<span class=\'glyphicon glyphicon-option-vertical\'><span class="sr-only">More options</span></span> 			</button> 			<ul uib-dropdown-menu class=\'dropdown-menu-right dropdown-menu-lg\'> 				<li><button type=\'button\' class=\'btn btn-empty\' 						  ng-click="editctrl.deleteItem(editctrl.editdata.item)"> 					Delete from Collection 				</button></li> 			</ul> 		</div> 		<div class="dropdown-container collection-edit-header"> 			<div class="media-left collection-edit-header-image hidden-xs" 				  ng-if="editctrl.editdata.item.images||editctrl.editdata.config.images"> 				<img data-no-retina=\'true\' 					  class=\'media-object\' 					  ng-src="{{ editctrl.editdata.item.images.thumb || editctrl.editdata.config.images.thumb }}"> 			</div> 			<div class="media-body dropdown-container collection-edit-header-body"> 				<h3 class="media-heading"> 					<collection-item-name item="editctrl.editdata.item"></collection-item-name> 				</h3>  				<h4 class="media-heading-sub" 					 ng-if="editctrl.editdata.item.version && !editctrl.showvars.selectingVersion"> 					<name-with-year name="editctrl.editdata.item.version.versionname" year="editctrl.editdata.item.version.yearpublished"></name-with-year> 					<span class=\'btn-spacer\'></span> 					<button type="button" class="btn btn-xs btn-subtle btn-no-text" 							  ng-click="editctrl.setRecordScreen( \'versions\' )"> 						<i class=\'fi-pencil\'></i> 					</button> 					<button type="button" class="btn btn-xs btn-subtle btn-no-text" 							  ng-click="editctrl.removeVersion()"> 						<i class=\'fi-x\'></i> 					</button> 				</h4>  				<div class="collection-edit-header-action"> 					<button class=\'btn btn-sm btn-link\' type="button" 							  ng-show="!editctrl.editdata.item.version" 							  ng-click="editctrl.setRecordScreen( \'versions\' )">Set version/edition 					</button> 				</div>  				<div class=\'form-group-condensed collection-edit-version\' ng-if="editctrl.showvars.selectingVersion"> 					<ui-select ng-model="editctrl.editdata.item.versionid" 								  theme="bootstrap" 								  emit-on-close="versionSelectorClosed" 								  activate-ui-select-on-create="true" 								  on-select="editctrl.updateVersion( $item ); editctrl.showvars.selectingVersion=false;"> 						<ui-select-match placeholder="Select Version...">{{$select.selected.name}}</ui-select-match> 						<ui-select-choices 							position="down" 							repeat="version.objectid as version in editctrl.editdata.config.versions|filter:$select.search"> 							{{version.name}} 						</ui-select-choices> 					</ui-select> 				</div>  				<div class="collection-edit-header-action"> 					<button class=\'btn btn-sm btn-link\' type="button" 							  ng-show="!editctrl.alwaysShowStars() && !editctrl.showStars" 							  ng-click="editctrl.showStars = true">Set a separate rating for this copy 					</button> 				</div>  				<div ng-show="editctrl.alwaysShowStars() || editctrl.showStars" class="rating-stars-container"> 					<span class=\'rating-stars rating-stars-responsive\'> 						<span uib-rating ng-model="editctrl.editdata.item.rating" 										max="10" 										state-on="\'fi-star is-active\'" 										state-off="\'fi-star\'" 										titles="editctrl.ratingDescriptions" > 						</span> 					</span> 					<label class="fwn"> 					<span class="sr-only">Rating</span> 					<input type=\'text\' class="form-control input-sm rating-stars-textbox has-rating-border-{{overstar || editctrl.editdata.item.rating | ratingColor}}" 							 ng-model="editctrl.editdata.item.rating" 							 ng-show="editctrl.editdata.item.rating || overstar != null" 							 value="{{ overstar || editctrl.editdata.item.rating | userRatingNumber }}"> 					</label>  					<button type="button" 							  class="btn btn-link btn-sm rating-stars-clear" 							  ng-if="editctrl.editdata.item.rating" 							  ng-click="editctrl.showStars = false; editctrl.showvars.manualrating = false; editctrl.editdata.item.rating=null"; overstar=null>Clear 					</button> 				</div> 				<star-guidelines overstar="overstar || editctrl.editdata.item.rating | userRatingNumber"></star-guidelines> 			</div> 		</div>  		<fieldset name=\'collection-status\'> 			<div class=\'row\'> 				<div class=\'col-sm-9\'> 					<div class=\'form-group collection-edit-status\'> 						<label>Status</label> 						<collection-status-selector item="editctrl.editdata.item" config="editctrl.editdata.config"></collection-status-selector> 					</div> 				</div> 			</div> 		</fieldset>  		<fieldset name="collection-wishlist" 					 ng-if="editctrl.editdata.item.status.wishlist || editctrl.editdata.item.textfield.wishlistcomment.value">  			<div class=\'form-group\'> 				<label for="wishlistcomment">Wishlist Comment</label> 				<textarea id="wishlistcomment" 						 msd-elastic 						 class=\'form-control\' 						 style=\'height: 50px\' 						 ng-model="editctrl.editdata.item.textfield.wishlistcomment.value"> 				</textarea> 			</div> 		</fieldset>  		<fieldset name="collection-trade" 					 ng-if="editctrl.editdata.item.status.fortrade || editctrl.editdata.item.textfield.conditiontext.value"> 			<div class=\'form-group\'> 				<label for="conditiontext">Trade Condition</label> 				<textarea 					msd-elastic 					id="conditiontext" 					class=\'form-control\' 					style=\'height: 50px\' 					ng-model="editctrl.editdata.item.textfield.conditiontext.value"> 				</textarea> 			</div> 		</fieldset>  		<fieldset name="collection-comment"> 			<div class=\'form-group\'> 				<label for="comment">Comment <span class=\'text-muted\'>(Public)</span></label> 				<textarea 					id="comment" 					class="form-control" 					style=\'height: 100px\' 					msd-elastic 					ng-model="editctrl.editdata.item.textfield.comment.value"> 				</textarea> 			</div> 		</fieldset>  		<a class="toggler-caret" ng-href="" ng-click="editctrl.showvars.showAdvanced = !editctrl.showvars.showAdvanced" 			ng-class="{ \'is-active\': editctrl.showvars.showAdvanced }"> 			<span class="glyphicon glyphicon-menu-right"></span> 			<strong>Advanced</strong> (private info, parts exchange) 		</a>  		<div class=\'collection-advanced toggler-caret-target\' uib-collapse="!editctrl.showvars.showAdvanced"> 			<fieldset class=\'panel\' name="collection-private"> 				<div class=\'panel-header panel-header-sm\'> 					<div class=\'panel-title\'> 						Private Info 					</div> 				</div> 				<div class=\'form-private form-horizontal panel-body\'> 					<div class=\'form-group\'> 						<label for="pp_currency" class="col-sm-3 control-label"> 							Price Paid 						</label>  						<div class=\'col-sm-5\'> 							<div class="input-group"> 								<div class="input-group-btn" uib-dropdown> 									<button id="pp_currency" 											  type="button" 											  class="btn btn-default" 											  uib-dropdown-toggle 											  aria-haspopup="true" 											  aria-expanded="false"> 										{{editctrl.editdata.config.currencies | fieldFromArrayById : \'value\' : editctrl.editdata.item.pp_currency : \'name\' : \'Other\'}} 										<span class="caret"></span> 									</button> 									<ul uib-dropdown-menu> 										<li ng-repeat="currency in editctrl.editdata.config.currencies"> 											<a ng-href="" ng-click="editctrl.editdata.item.pp_currency=currency.value"> 												{{currency.name}} 											</a> 										</li> 									</ul> 								</div> 								<input id="pricepaid" 										 type="number" 										 ng-model="editctrl.editdata.item.pricepaid" 										 class="form-control"/> 							</div> 						</div> 					</div>  					<div class=\'form-group\'> 						<label for="cv_currency" class="col-sm-3 control-label"> 							Current Price 						</label>  						<div class=\'col-sm-5\'> 							<div class="input-group"> 								<div class="input-group-btn" uib-dropdown> 									<button type="button" class="btn btn-default dropdown-toggle" 											  uib-dropdown-toggle 											  aria-haspopup="true" aria-expanded="false"> 										{{editctrl.editdata.config.currencies | fieldFromArrayById : \'value\' : editctrl.editdata.item.cv_currency : \'name\' : \'Other\'}} 										<span class="caret"></span> 									</button> 									<ul uib-dropdown-menu> 										<li ng-repeat="currency in editctrl.editdata.config.currencies"> 											<a ng-href="" ng-click="editctrl.editdata.item.cv_currency=currency.value"> 												{{currency.name}} 											</a> 										</li> 									</ul> 								</div> 								<input id="currvalue" type="number" ng-model="editctrl.editdata.item.currvalue" 										 class="form-control"/> 							</div> 						</div> 					</div>  					<div class=\'form-group\'> 						<label for="quantity" class="col-sm-3 control-label"> 							Quantity 						</label>  						<div class=\'col-sm-3\'> 							<input id="quantity" type=\'number\' ng-model="editctrl.editdata.item.quantity" class="form-control"/> 						</div> 					</div>  					<div class=\'form-group\'> 						<label for="acquisitiondate" class="col-sm-3 control-label"> 							Acquisition Date 						</label>  						<div class=\'col-sm-6\'> 							<div class=\'input-group\'> 								<input id="acquisitiondate" 										 type="text" 										 class="form-control" 										 datepicker-options="{showWeeks: false}" 										 uib-datepicker-popup="yyyy-MM-dd" 										 ng-model="editctrl.editdata.item.acquisitiondateobj" 										 is-open="editctrl.acquisition_date_opened" 										 show-button-bar="false" /> 							<span class="input-group-btn"> 								<button type="button" class="btn btn-default" 										  ng-click="editctrl.openDatePicker($event,\'acquisition_date_opened\')"> 									<i class="glyphicon glyphicon-calendar"></i> 								</button> 							</span> 							</div> 						</div> 					</div>  					<div class=\'form-group\'> 						<label for="acquiredfrom" class="col-sm-3 control-label"> 							Acquired From 						</label>  						<div class=\'col-sm-9\'> 							<input id="acquiredfrom" 									 type="text" 									 class="form-control" 									 ng-model="editctrl.editdata.item.acquiredfrom"/> 						</div> 					</div>  					<div class=\'form-group\'> 						<label for="invdate" class="col-sm-3 control-label"> 							Inventory Date 						</label>  						<div class=\'col-sm-6\'> 							<div class=\'input-group\'> 								<input id="invdate" 										 type="text" 										 class="form-control" 										 datepicker-options="{showWeeks: false}" 										 uib-datepicker-popup="yyyy-MM-dd" 										 ng-model="editctrl.editdata.item.invdateobj" 										 is-open="editctrl.inv_date_opened" 										 show-button-bar="false" /> 							<span class="input-group-btn"> 								<button type="button" class="btn btn-default" 										  ng-click="editctrl.openDatePicker($event,\'inv_date_opened\')"> 									<i class="glyphicon glyphicon-calendar"></i> 								</button> 							</span> 							</div> 						</div> 					</div>  					<div class=\'form-group\'> 						<label for="invlocation" class="col-sm-3 control-label"> 							Inventory Location 						</label>  						<div class=\'col-sm-9\'> 							<input id="invlocation" 									 type="text" 									 class="form-control" 									 ng-model="editctrl.editdata.item.invlocation"/> 						</div> 					</div>  					<div class=\'form-group\'> 						<label for="invlocation" class="col-sm-3 control-label"> 							Private Comment 						</label>  						<div class=\'col-sm-9\'> 							<textarea 								msd-elastic 								id="privatecomment" 								class=\'form-control\' 								style=\'height: 100px\' 								ng-model="editctrl.editdata.item.privatecomment"> 							</textarea> 						</div> 					</div> 				</div> 			</fieldset> 			<fieldset class=\'panel\' name="collection-parts"> 				<div class=\'panel-header panel-header-sm\'> 					<div class=\'panel-title\'> 						Parts Exchange 					</div> 				</div> 				<div class=\'panel-body form-horizontal\'> 					<div class=\'form-group\'> 						<label class=\'col-sm-3 control-label\' for="wantpartslist">Want Parts</label> 						<div class=\'col-sm-9\'> 							<textarea 								msd-elastic 								id="wantpartslist" 								class=\'form-control\' 								style=\'height: 100px\' 								ng-model="editctrl.editdata.item.textfield.wantpartslist.value"> 							</textarea> 						</div> 					</div> 					<div class=\'form-group\'> 						<label class=\'col-sm-3 control-label\' for="haspartslist">Has Parts</label> 						<div class=\'col-sm-9\'> 							<textarea 								msd-elastic 								style=\'height: 100px\' 								id="haspartslist" 								class=\'form-control\' 								ng-model="editctrl.editdata.item.textfield.haspartslist.value"> 							</textarea> 						</div> 					</div> 				</div> 			</fieldset>  			<a class="toggler-caret" ng-href="" ng-click="editctrl.showvars.showCustom = !editctrl.showvars.showCustom" 				ng-class="{ \'is-active\': editctrl.showvars.showCustom }"> 				<span class="glyphicon glyphicon-menu-right"></span> 				<strong>Customize Game Info</strong> (title, image) 			</a>  			<div class=\'collection-custom toggler-caret-target\' uib-collapse="!editctrl.showvars.showCustom"> 				<fieldset class=\'panel\' name="custom-version"> 					<div class=\'form-horizontal container-fluid panel-body\'> 						<div class=\'form-group\'> 							<label for="pp_currency" class="col-sm-3 control-label"> 								Custom Title 							</label> 							<div class=\'col-sm-9\'> 								<input ng-model="editctrl.editdata.item.textfield.customname.value" class=\'form-control\' type=\'text\' placeholder="{{editctrl.editdata.config.objectname}} Nickname"> 								<div class=\'help-block\'> 									Give your game a nickname to make it easier for you to identify when browsing games and your collections. 								</div> 							</div> 						</div>  						<div class=\'form-group\'> 							<label for="customimage" class="col-sm-3 control-label"> 								Custom Image Id 							</label>  							<div class=\'col-sm-9\'> 								<div class="input-group"> 									<input type="text" id="customimage" class=\'form-control\' ng-model="editctrl.editdata.item.imageid"> 									<span class="input-group-btn"> 										<button type="button" class="btn btn-default" 												  ng-click="editctrl.selectImage( editctrl.editdata.item.objecttype, editctrl.editdata.item.objectid )"> 											<i class="glyphicon glyphicon-camera"></i> 										</button> 									</span> 								</div> 								<div class=\'help-block\'> 									Replace the game box image shown for this game within your collection. 								</div> 							</div> 						</div> 						<div class=\'form-group\'> 							<label for="publisherid" class="col-sm-3 control-label"> 								Publisher Id 							</label>  							<div class=\'col-sm-9\'> 								<input type="text" id="publisherid" class=\'form-control\' ng-model="editctrl.editdata.item.publisherid"> 							</div> 						</div> 						<div class=\'form-group\'> 							<label for="languageid" class="col-sm-3 control-label"> 								Language 							</label>  							<div class=\'col-sm-9\'> 								<select class="form-control" 										  ng-model="editctrl.editdata.item.languageid" 										  ng-options="lang.languageid as lang.name for lang in editctrl.editdata.config.languages"> 									<option value=""></option> 								</select> 							</div> 						</div> 						<div class=\'form-group\'> 							<label for="year" class="col-sm-3 control-label"> 								Year 							</label>  							<div class=\'col-sm-9\'> 								<input type="number" id="year" class=\'form-control\' ng-model="editctrl.editdata.item.year"> 							</div> 						</div> 						<div class=\'form-group\'> 							<label for="other" class="col-sm-3 control-label"> 								Other 							</label>  							<div class=\'col-sm-9\'> 								<input type="text" id="other" class=\'form-control\' ng-model="editctrl.editdata.item.other"> 							</div> 						</div> 						<div class=\'form-group\'> 							<label for="barcode" class="col-sm-3 control-label"> 								Barcode 							</label>  							<div class=\'col-sm-9\'> 								<input type="text" id="barcode" class=\'form-control\' ng-model="editctrl.editdata.item.barcode"> 							</div> 						</div> 					</div> 				</fieldset> 			</div> 		</div> 	</div>  	<div class=\'modal-footer hidden-xs\' ng-if="!editctrl.errorinfo.error"> 		<button ng-disabled="editctrl.saving" class=\'btn btn-primary\' type=\'submit\'> 			Save 			<span ng-show=\'editctrl.saving\' class=\'glyphicon glyphicon-refresh is-refreshing\'></span> 		</button> 		<button type=\'button\' 				  class=\'btn btn-default\' 				  ng-click=\'$dismiss()\'>Cancel 		</button> 	</div> 	</div> 	</div> </form> </div>  ' );
t.put( 'geekitem_dialog_deletecollectionitem.tpl', ' 	<div class=\'modal-header\'> 		<button class=\'close\' type=\'button\' ng-click="cancel()"> 			<span>×</span> 		</button> 		<h4 class=\'modal-title\'>Delete My Game?</h4> 	</div> 	<div class=\'modal-body container-fluid\'>  		<div class="media"> 			<div class="media-left"> 				<a href="#"> 					<img class="media-object" ng-src="{{item.images.thumb}}" ng-if="item.images.thumb"> 				</a> 			</div> 			<div class="media-body"> 				<h4 class=\'media-heading\' ng-if="item.linkedname"> 					{{item.linkedname}} ({{item.name}}) 				</h4>  				<p> 					This will also delete your rating, comments, and collection information 					associated with this item. 				</p> 			</div> 		</div> 	</div> 	<div class=\'modal-footer\'> 		<button class=\'btn btn-default\' ng-click="cancel()">Cancel</button> 		<button class=\'btn btn-danger\' ng-click="ok()">Yes, Delete</button> 	</div>  ' );
t.put( 'geekitem_dialog_ratingsgraph.tpl', '<div class=\'modal-header\'> 	<button class=\'close\' type=\'button\' ng-click="$close()"> 		<span>×</span> 	</button> 	<h4 class=\'modal-title\' ng-if="loading">Loading</h4> 	<h4 class=\'modal-title\' ng-if="!loading">Ratings Breakdown</h4> </div>  	<div class=\'modal-body container-fluid\'> 		<div class="col-xs-12"> 			<ratings-stats-graph objecttype="{{graphitem.objecttype}}" objectid="{{graphitem.objectid}}" width="800" height="500" type="ColumnChart"></ratings-stats-graph> 		</div> 	</div>  <div class=\'modal-footer\'> 	<button class=\'btn btn-default\' ng-click="$close()">Close</button> </div>' );
t.put( 'geekitem_mini_toolbar_collection.tpl', ' 	<span> 		<span ng-if="colltoolbarctrl.collection.loadingItems || colltoolbarctrl.collection.loadingConfig"> 			<button disabled class="btn btn-xs">Loading</button> 		</span> 		<span ng-if="!colltoolbarctrl.collection.loadingItems && !colltoolbarctrl.collection.loadingConfig"> 			<span ng-if="colltoolbarctrl.collection.items.length"> 				<a class="btn btn-xs btn-subtle" 					ng-href="{{colltoolbarctrl.collection.config.href}}/mygames/collection"> 					<i class="fi-check"></i>  					<span ng-if=\'!colltoolbarctrl.collection.statuses.length\'>In Collection</span> 				<collection-button-status-list  					ng-if=\'colltoolbarctrl.collection.statuses.length\'  					statuses=\'colltoolbarctrl.collection.statuses\'  					allstatuses=\'colltoolbarctrl.collection.config.allstatuses\'  				   limit=\'1\'></collection-button-status-list> 				</a> 			</span> 		<span ng-if="!colltoolbarctrl.collection.items.length"> 			<button add-to-collection-button 					  login-required 					  additem="{ \'objecttype\': colltoolbarctrl.item.objecttype, 					             \'objectid\': colltoolbarctrl.item.objectid, 					             \'versionid\': colltoolbarctrl.item.versionid, 					             \'status\': \'own\' }" 					  class="btn btn-xs btn-subtle"> 				<i class="fi-list-thumbnails"></i> 				<span aria-hidden="true">Add To</span> 				<span class="sr-only">Add game to your collection</span> 			</button> 		</span> 	</span>  ' );
t.put( 'geekitem_mini_toolbar_collection_versions.tpl', ' <span> 	<span ng-if="colltoolbarctrl.collection.loadingItems || colltoolbarctrl.collection.loadingConfig"> 		<button disabled class="btn btn-xs">Loading</button> 	</span> 	<span ng-if="!colltoolbarctrl.collection.loadingItems && !colltoolbarctrl.collection.loadingConfig"> 		<span ng-if="colltoolbarctrl.hasVersion()"> 			<a class="btn btn-xs btn-subtle" 				ui-sref="geekitem.mygames.collection"> 				<i class="fi-check"></i> 				<span ng-if=\'!colltoolbarctrl.collection.versionstatuses[colltoolbarctrl.item.versionid].length\'> 					In Collection 				</span>  				<collection-button-status-list 					ng-if=\'colltoolbarctrl.collection.versionstatuses[colltoolbarctrl.item.versionid].length\' 					statuses=\'colltoolbarctrl.collection.versionstatuses[colltoolbarctrl.item.versionid]\' 					allstatuses=\'colltoolbarctrl.collection.config.allstatuses\' 					limit=\'1\'> 				</collection-button-status-list> 			</a> 		</span> 		<span ng-if="!colltoolbarctrl.hasVersion()"> 			<button add-to-collection-button 				  login-required 				  additem="{ \'objecttype\': colltoolbarctrl.item.objecttype, 				             \'objectid\': colltoolbarctrl.item.objectid, 				             \'versionid\':colltoolbarctrl.item.versionid, 				             \'status\': \'own\' }" 				  class="btn btn-xs btn-subtle"> 			<i class="fi-list-thumbnails"></i> 			Add To 		</button> 	</span> </span>  ' );
t.put( 'geekitem_toolbar_collection.tpl', ' 	<span> 		<!-- Placeholder button while loading  --> 		<span no-animate ng-show="colltoolbarctrl.loading"> 			<button class="btn btn-sm btn-primary" disabled> 				<i class="fi-list-thumbnails"></i> 				Loading 			</button> 		</span>  		<span no-animate ng-switch="colltoolbarctrl.collection.ratingitem.collid || \'_undefined_\'" 				ng-show="!colltoolbarctrl.loading"> 			<span no-animate ng-switch-when="_undefined_"> 				<span ng-include="\'geekitem_toolbar_collection_empty.tpl\'"></span> 			</span> 			<span no-animate ng-switch-default> 				<span ng-include="\'geekitem_toolbar_collection_not_empty.tpl\'"></span> 			</span> 		</span> 	</span>  ' );
t.put( 'geekitem_collection_button_statuses.html', ' <span><span 		ng-repeat="status in allstatuses | orderBy: \'priority\'| propertyIn :\'key\':statuses|limitTo:limit"><span ng-show="wrap && statuses.length > 0">(</span>{{status.name}}</span><span   ng-show="statuses.length > limit">&hellip;</span><span ng-show="wrap && statuses.length > 0">)</span></span>  ' );
t.put( 'geekitem_collection_rating.tpl', ' <div class=\'game-rating-container\'>     <div ng-class="::{\'is-rated\':   collratingctrl.collection.ratingitem.rating, 			  		  \'is-unrated\': !collratingctrl.collection.ratingitem.rating }"          class="rating-stars-container">          <div class="rating-stars-title">             My rating             <span ng-show="collratingctrl.collection.ratingitem.rating"> 				&middot; 				<button class="btn btn-xs btn-empty"                         ng-click="collratingctrl.editItem( { collid: collratingctrl.collection.ratingitem.collid } )"> 					Edit 				</button> 			</span>         </div>          <span class=\'rating-stars rating-stars-sm\'> 			<span uib-rating ng-model="collratingctrl.collection.ratingitem.rating"                         readonly="collratingctrl.loading"                         ng-click="collratingctrl.editItemRating()"                         login-required                         max="10"                         state-on="\'fi-star is-active\'"                         state-off="\'fi-star\'"                         titles="collratingctrl.ratingDescriptions" > 			</span> 		</span>          <span class="rating-stars-secondary"> 			<span ng-show="overstar > 0 || collratingctrl.collection.ratingitem.rating > 0 "> 				{{ overstar || collratingctrl.collection.ratingitem.rating }} 				&nbsp; 			</span> 		</span>         <star-guidelines overstar="overstar || collratingctrl.collection.item.rating"></star-guidelines>     </div>      ' );
t.put( 'geekitem_collection_rating_mobile.tpl', ' 	<button type=\'button\' class=\'btn btn-default\' 			  login-required 			  ng-click="collratingctrl.editItemRating()"> 		<span ng-if="!collratingctrl.collection.ratingitem.rating"><i 				class=\'toolbar-action-icon fi-star\'></i>Rate Game</span> 		<span ng-if="collratingctrl.collection.ratingitem.rating"> 			<div class="toolbar-action-icon bottom"> 				<span class=\'rating-angular has-rating-{{collratingctrl.collection.ratingitem.rating|ratingColor}}\'> 					{{collratingctrl.collection.ratingitem.rating|userRatingNumber}} 				</span> 			</div> 			Rated 		</span> 	</button>  ' );
t.put( 'geekitem_collection_privatedata.tpl', ' 	<div ng-show=\'hasPrivateData()\' class=\'summary-collection-group\'> 		<div class=\'summary-collection-group-header\'> 			<i class=\'fi-lock\'></i> Private Info 		</div> 		<div class=\'summary-collection-group-body\'> 			<ul class=\'outline outline-col-xs-block outline-condensed\'> 				<li class=\'outline-item fs-xs\' ng-repeat="data in private_data" ng-if="data.value"> 					<div class=\'outline-item-title\'> 						{{data.title}} 					</div> 					<div class="outline-item-description"> 						<span ng-if="!data.trusted"> 							{{data.value}} 						</span> 						<span ng-if="data.trusted"> 							<span ng-bind-html="data.value|to_trusted"></span> 						</span> 					</div> 				</li> 			</ul> 		</div> 	</div>  ' );
t.put( 'geekitem_toolbar_collection_empty.tpl', ' 	<span uib-dropdown dropdown-append-to-body> 		<button class="btn btn-sm btn-primary toolbar-action-full" 				  no-animate 				  login-required 				  ng-click="colltoolbarctrl.editItem( { collid: 0, 				                                          objecttype: colltoolbarctrl.item.objecttype, 				                                          objectid: colltoolbarctrl.item.objectid } )" 				  ng-disabled="colltoolbarctrl.loading"> 			<i class="fi-list-thumbnails"></i> 			Add To 			<span class=\'hidden-xs\'>Collection</span> 			<span class=\'visible-xs-inline\'>&hellip;</span> 		</button> 	</span>  ' );
