t.put( 'geekitem_toolbar_small.tpl', ' 	<div class=\'toolbar-actions-mobile toolbar-actions-mobile-lg\'>  		<div class="toolbar-action" hide-ad-block="blockbuyacopy"> 			<a ng-if="!geekitemctrl.geekitem.data.item.versioninfo.premiumpreorder || !geekitemctrl.geekitem.data.item.versioninfo.orderurl" 				ui-sref="geekitem.overview({\'#\':\'buyacopy\'})" 			   ng-click="geekitemctrl.logEvent( \'GeekItem\', \'buyacopy\' ); 							 headerctrl.scrollToBuy();" 			   class="buy-btn btn btn-sm"> 				<i class="fi-shopping-cart"></i> 				<span ng-if="geekitemctrl.geekitem.buyButtonType !== \'preorder\'">Buy</span><span ng-if="geekitemctrl.geekitem.buyButtonType === \'preorder\'">Preorder</span> 			</a> 			<a ng-if="geekitemctrl.geekitem.data.item.versioninfo.premiumpreorder && geekitemctrl.geekitem.data.item.versioninfo.orderurl" 				ng-href="{{geekitemctrl.geekitem.data.item.versioninfo.orderurl}}" 				ng-click="geekitemctrl.logEvent( \'GeekItem\', \'backproject\' )" 				class="crowdfunding-btn btn btn-sm"> 				{{geekitemctrl.preorderAction}} Project <i class="fa-sm fas fa-external-link" style="margin-left: 2px"></i> 			</a> 		</div>  		<span class=\'toolbar-action\'> 			<collection-toolbar 				item="{objecttype: geekitemctrl.geekitemParams.objecttype, objectid: geekitemctrl.geekitemParams.objectid}"> 			</collection-toolbar> 		</span>  		<span class=\'toolbar-action\'> 			<subscription 				btn-style=\'white\' 				item="{objecttype: geekitemctrl.geekitemParams.objecttype, objectid: geekitemctrl.geekitemParams.objectid}"> 			</subscription> 		</span> 	</div>  	<div class=\'toolbar-actions-mobile toolbar-actions-mobile-sm\'> 		<span class=\'toolbar-action\'> 			<collection-rating item="{objecttype: geekitemctrl.geekitemParams.objecttype, 											  objectid: geekitemctrl.geekitemParams.objectid}" 								 layout="mobile"></collection-rating> 		</span>  		<span class="toolbar-action"> 			<geekitem-record-play></geekitem-record-play> 		</span>  		<span class=\'toolbar-action\'> 			<geekitem-fans></geekitem-fans> 		</span> 	</div>  	<div class=\'toolbar-actions-mobile toolbar-actions-mobile-plays text-center\' ng-if=\'headerctrl.playCountStats.count\'> 		<button class=\'btn btn-sm btn-empty text-semibold\' ui-sref="geekitem.mygames.plays"> 			<ng-pluralize count="headerctrl.playCountStats.count" 							  when="{\'1\': \'1 Play Logged\', 							  \'other\': \'{} Plays Logged\'}"> 			</ng-pluralize> 		</button> 	</div>  ' );
t.put( 'geekitem_toolbar_generic_large.tpl', ' 	<div class=\'toolbar-actions\'> 		<div class=\'toolbar-action\'> 			<geekitem-fans></geekitem-fans> 		</div>  		<div class=\'toolbar-action\'> 			<subscription 					  item="::{objecttype: geekitemctrl.geekitemParams.objecttype, objectid: geekitemctrl.geekitemParams.objectid}" 					  btn-size=\'sm\' 					  btn-style=\'subtle\'></subscription> 		</div> 	</div> ' );
