t.put( 'geekitem_toolbar_actions_fan.tpl', ' 	<span class=\'btn-group\' 	      uib-tooltip="{{::$fanctrl.fanobj.numfans|number}} Fans" 	      tooltip-append-to-body=true 	      tooltip-trigger="mouseenter">  			<button class=\'btn btn-sm btn-subtle btn-no-text game-action-fan\' 			        ng-mouseover="fanmouseover=true" 			        ng-mouseleave="fanmouseover=false" 			        login-required 			        aria-label="{{(fanobj.fanid && \'remove fan\') || \'become a fan\'}}" 			        ng-disabled="$fanctrl.loading" 			        ng-click=\'$fanctrl.toggleFan()\'> 				<i class=\'fi-heart toolbar-action-icon\' ng-class="{\'is-active\':$fanctrl.fanobj.fanid}"></i> 				<span ng-if="$fanctrl.buttontype != \'generic\' && !$fanctrl.fanobj.fanid" class=\'visible-xs\'>+ Fan</span> 				<span ng-if="$fanctrl.buttontype != \'generic\' && !$fanctrl.loading && $fanctrl.fanobj.fanid" class="visible-xs-inline-block">&nbsp;</span> 			</button>  			<a class=\'btn btn-sm btn-subtle btn-count game-action-play-count\' 			   ng-class="{\'hidden-xs\': $fanctrl.buttontype != \'generic\'}" 			   ng-if="::$fanctrl.fanobj.numfans" 			   href="/fans/{{$fanctrl.params.objecttype}}/{{$fanctrl.params.objectid}}"> 				{{::$fanctrl.fanobj.numfans|humanize}} 			</a> 	</span> ' );
t.put( 'geekitem_toolbar_actions_recordplay.tpl', ' 	<span class=\'btn-group\'> 		<button class=\'btn btn-sm btn-subtle game-action-play\' 		        play-recorder-button 		        login-required 		        item="$recordplayctrl.params"> 			<i class=\'fi-clipboard-pencil toolbar-action-icon visible-xs\'></i> 			Log Play 		</button> 		<a ng-if=\'headerctrl.playCountStats.count\' 		   class=\'btn btn-sm btn-subtle btn-count game-action-play-count hidden-xs\' 		   ui-sref="geekitem.mygames.plays"> 			{{headerctrl.playCountStats.count}} 		</a> 	</span> ' );
t.put( 'geekitem_dialog_addnote.tpl', ' 	<div class=\'modal-header\'> 		<button class=\'close\' ng-click="$close();" type=\'button\'> 			<span>×</span> 		</button> 		<h4 class=\'modal-title\'>Add Note</h4> 	</div>  	<div class=\'modal-body container-fluid\'> 		<label for="note">Note</label> 		<textarea autofocus class="form-control" name="note" id="note" cols="30" rows="10" ng-model="newnote.adminnote"></textarea> 	</div> 	<div class=\'modal-footer\'> 		<button class=\'btn btn-lg btn-primary\' type=\'button\' ng-click="save()">Save</button> 		<button class=\'btn btn-link btn-sm\' ng-click="cancel()">Cancel</button> 	</div>  ' );
t.put( 'geekitem_dialog_addtag.tpl', ' 	<div class=\'modal-header modal-header-table\'> 		<div class=\'modal-header-table-left\'> 			<button class=\'visible-xs-inline btn btn-indigo\' ng-click="tagmodalctrl.cancel()" type=\'button\'> 				<span>Cancel</span> 			</button> 		</div> 		<div class=\'modal-header-table-center\'> 			<h4 class=\'modal-title\'>Add Tags</h4> 		</div> 		<div class=\'modal-header-table-right\'> 			<button class=\'close hidden-xs\' ng-click="$close();" type=\'button\'> 				<span>×</span> 			</button> 			<button class=\'visible-xs-inline btn btn-primary\'  ng-click="tagmodalctrl.save()" type=\'button\'> 				<span>Save</span> 			</button> 		</div> 	</div>  	<div class=\'modal-body container-fluid\'> 		<div class="row"> 			<label for="tags">Tags (separated by spaces)</label> 			<input type="text" id="tags" class="form-control" ng-model="tagmodalctrl.tagdata.newtags"> 		</div> 		<div class="row"> 			<h4>Suggested Tags</h4> 			<ul class="tags-inline"> 				<li class="tags-inline-tag" ng-repeat="tag in tagmodalctrl.suggestedtags"> 					<a ng-href="" ng-click="tagmodalctrl.tagdata.newtags = tagmodalctrl.tagdata.newtags + tag.rawtag + \' \'">{{tag.rawtag}}</a> 				</li> 			</ul> 		</div> 	</div>  	<div class=\'modal-footer hidden-xs\'> 		<button class=\'btn btn-lg btn-primary\' type=\'button\' ng-click="tagmodalctrl.save()">Save</button> 		<button class=\'btn btn-link btn-sm\' ng-click="tagmodalctrl.cancel()">Cancel</button> 	</div>  ' );
t.put( 'geekitem_dialog_confirm.tpl', ' 	<div class=\'modal-header\'> 		<button class=\'close\' type=\'button\' ng-click="$dismiss()"> 			<span>×</span> 		</button> 		<h4 class=\'modal-title\'>Are You Sure?</h4> 	</div> 		<div class=\'modal-body container-fluid\'> 			Are you sure you want to delete this? 		</div> 	<div class=\'modal-footer\'> 		<button class=\'btn btn-default\' ng-click="$dismiss()">Cancel</button> 		<button class=\'btn btn-danger\' ng-click="$close()">Yes, Delete</button> 	</div> ' );
t.put( 'geekitem_dialog_editgeekitemsettings.tpl', ' 	<div class=\'modal-header\'> 		<button class=\'close\' type=\'button\' ng-click="$dismiss()"> 			<span>×</span> 		</button> 		<h4 class=\'modal-title\'>Settings</h4> 	</div> 	<div class=\'modal-body container-fluid\'> 		<div class="checkbox checkbox-lg checkbox-flex"> 			<div class=\'checkbox-flex-input\'> 				<input 					bs-switch 					switch-size="small" 					switch-change="editsettingsctrl.save()" 					ng-model="editsettingsctrl.settings.absolutedates" 					type="checkbox"> 			</div> 			<div class=\'checkbox-flex-label\'> 				<label for=\'settingsAbsolutedates\'> 					Use absolute dates instead of relative 					<p class=\'help-block\'> 						\'2016-04-01\' instead of \'2 days ago\'. 					</p> 				</label> 			</div> 		</div> 		<div class="checkbox checkbox-lg checkbox-flex"> 			<div class=\'checkbox-flex-input\'> 				<input 					 id="settingsFluidLayout" 				    bs-switch 					 switch-size="small" 					 switch-change="editsettingsctrl.save()" 				    ng-model="editsettingsctrl.settings.fluidlayout" 				    type="checkbox"> 			</div> 			<div class=\'checkbox-flex-label\'> 				<label for=\'settingsFluidLayout\'> 					Extend page across entire screen 					<p class=\'help-block\'> 						Allow content extend beyond 1400px. 					</p> 				</label> 			</div> 		</div>  		<div class="checkbox checkbox-lg checkbox-flex"> 			<div class=\'checkbox-flex-input\'> 				<input 					 id="settingsFullDescriptions" 					 bs-switch 					 switch-size="small" 					 switch-change="editsettingsctrl.save()" 					 ng-model="editsettingsctrl.settings.fulldescriptions" 					 type="checkbox"> 			</div> 			<div class=\'checkbox-flex-label\'> 				<label for=\'settingsFullDescriptions\'> 					Don\'t truncate long descriptions 					<p class=\'help-block\'> 						Show entire description instead of using \'+More\' links to expand. 					</p> 				</label> 			</div> 		</div>  		<div class="checkbox checkbox-lg checkbox-flex"> 			<div class=\'checkbox-flex-input\'> 				<input 					 id="settingsNoHot" 					 bs-switch 					 switch-size="small" 					 switch-change="editsettingsctrl.save()" 					 ng-model="editsettingsctrl.settings.overview_nohot" 					 type="checkbox"> 			</div> 			<div class=\'checkbox-flex-label\'> 				<label for=\'settingsNoHot\'> 					Hide \'Hot\' items on overview tab 					<p class=\'help-block\'> 						Only show recent items on each overview section. 					</p> 				</label> 			</div> 		</div> 		<div class="checkbox checkbox-lg checkbox-flex"> 			<div class=\'checkbox-flex-input\'> 				<select id=\'settingsRecentItems\' 						  name=\'recentitems_showcount\' 						  class=\'form-control\' 						  ng-model="editsettingsctrl.settings.recentitems_showcount" 						  ng-change="editsettingsctrl.save()" 						  convert-to-number> 					<option value="5">Default (5)</option> 					<option value="10">10</option> 					<option value="15">15</option> 					<option value="20">20</option> 					<option value="25">25</option> 				</select> 			</div> 			<div class=\'checkbox-flex-label\'> 				<label for=\'settingsRecentItems\'> 					Number of recent forum threads on overview tab 				</label> 			</div> 		</div>  		 				 	</div> 	<div class=\'modal-footer\'> 		<button class=\'btn btn-primary\' ng-click="editsettingsctrl.close()"> 			Done 		</button> 	</div>  ' );
t.put( 'geekitem_dialog_imageselector.tpl', ' 	<div class=\'modal-header\'> 		<button class=\'close\' ng-click="cancel()" type=\'button\'> 			<span>×</span> 		</button> 		<h4 class=\'modal-title\'>{{options.title}}</h4> 	</div>  	<div class=\'modal-body container-fluid\'> 		<div class="panel"> 			<div class=\'panel-header panel-header-lg\'> 				<div ng-if="!selected">No Image Selected</div> 				<div ng-if="selected"> 					<div class="caption center-block"> 						Selected Image 					</div> 					<div class="thumbnail"> 						<img ng-src="{{selected.imageurl}}"> 					</div> 				</div>  				<div class=\'panel-header-actions\'> 					<span uib-dropdown> 						<a ng-href="#" class="btn btn-sm btn-subtle" uib-dropdown-toggle> 							{{labels.gallery||\'Gallery\'}} <span class=\'caret\'></span> 						</a> 						<ul uib-dropdown-menu> 							<li ng-repeat="gallery in data.config.galleries"> 								<a ng-href="" 									ng-click="setParam( \'gallery\', gallery.type ); labels.gallery = gallery.name;">{{gallery.name}}</a> 							</li> 						</ul> 					</span>  					<span uib-dropdown> 						<a ng-href="#" class="btn btn-sm btn-subtle" uib-dropdown-toggle> 							{{labels.sort||\'Sort\'}} <span class=\'caret\'></span> 						</a> 						<ul uib-dropdown-menu> 							<li ng-repeat="sort in data.config.sorttypes"> 								<a ng-href="" 									ng-click="setParam( \'sort\', sort.type ); labels.sort = sort.name;">{{sort.name}}</a> 							</li> 						</ul> 					</span> 				</div> 			</div>  			<div class="panel-body"> 				<div class=\'summary summary-media row\'> 					<div class="summary-item-media col-xs-6 col-sm-4 col-md-3" 						  ng-repeat="image in data.images"> 						<button type=\'button\' class=\'btn btn-empty btn-block\' ng-click="selectImage( image )"> 							<img class="img img-responsive center-block" 								  ng-src="{{image.imageurl}}"> 						</button> 					</div> 				</div> 			</div>  			<div uib-pagination 				template-url="geekitem_pagination.tpl" 				total-items="data.config.numitems" 				ng-model="params.pageid" 				ng-change="pageChanged()" 				items-per-page="params.showcount" 				boundary-links="true" 				max-size="5"> 			</div> 		</div> 	</div> 	<div class=\'modal-footer\'> 		<button class=\'btn btn-lg btn-primary\' type=\'button\' ng-click="save()">Select</button> 		<button class=\'btn btn-link btn-sm\' ng-click="cancel()">Cancel</button> 	</div>  ' );
t.put( 'geekitem_dialog_linktwitter.tpl', ' 	<div class=\'modal-header\'> 		<button class=\'close\' ng-click="$close();" type=\'button\'> 			<span>×</span> 		</button> 		<h4 class=\'modal-title\'>Share Preview</h4> 	</div> 	<div class=\'modal-body container-fluid\'> 		Click <b><a target=\'_blank\' ng-href=\'{{url}}\'>here</a></b> to link to your Twitter account and post your tweet. 	</div> 	<div class=\'modal-footer\'> 		<button class=\'btn btn-primary\' type=\'button\' ng-click="$dismiss();">Cancel</button> 	</div> ' );
t.put( 'geekitem_dialog_linkimage.tpl', ' 	<div class=\'modal-header\'> 		<button class=\'close\' ng-click="$close();" type=\'button\'> 			<span>×</span> 		</button> 		<h4 class=\'modal-title\'>Link Image to Version</h4> 	</div> 	<div class=\'modal-body container-fluid\'> 		<div class="panel"> 			<div class=\'panel-header panel-header-lg\'> 				<h3 class=\'panel-title\'> 					<h3>Destination: {{dst_item.name}}</h3> 				</h3> 				<div ng-if="!selected">No Image Selected</div> 				<div ng-if="selected"> 					<div class="caption center-block"> 						Selected Image 					</div> 					<div class="thumbnail"> 						<img ng-src="{{selected.imageurl}}"> 					</div> 				</div>  				<div class=\'panel-header-actions\'> 					<span uib-dropdown> 						<a ng-href="#" class="btn btn-sm btn-subtle" uib-dropdown-toggle> 							{{labels.gallery||\'Gallery\'}} <span class=\'caret\'></span> 						</a> 						<ul uib-dropdown-menu> 							<li ng-repeat="gallery in data.config.galleries"> 								<a ng-href="" 									ng-click="setParam( \'gallery\', gallery.type ); labels.gallery = gallery.name;">{{gallery.name}}</a> 							</li> 						</ul> 					</span>  					<span uib-dropdown> 						<a ng-href="#" class="btn btn-sm btn-subtle" uib-dropdown-toggle> 							{{labels.sort||\'Sort\'}} <span class=\'caret\'></span> 						</a> 						<ul uib-dropdown-menu> 							<li ng-repeat="sort in data.config.sorttypes"> 								<a ng-href="" 									ng-click="setParam( \'sort\', sort.type ); labels.sort = sort.name;">{{sort.name}}</a> 							</li> 						</ul> 					</span> 				</div> 			</div>  			<div class="panel-body"> 				<div class=\'summary summary-media row\'> 					<div class="summary-item-media col-xs-6 col-sm-4 col-md-3" 						  ng-repeat="image in data.images"> 						<button type=\'button\' class=\'btn btn-empty btn-block\' ng-click="selectImage( image )"> 							<img class="img img-responsive center-block" 								  ng-src="{{image.imageurl}}"> 						</button> 					</div> 				</div> 			</div>  			<div uib-pagination 				template-url="geekitem_pagination.tpl" 				total-items="data.config.numitems" 				ng-model="params.pageid" 				ng-change="pageChanged()" 				items-per-page="params.showcount" 				boundary-links="true" 				max-size="5"> 			</div> 		</div> 	</div> 	<div class=\'modal-footer\'> 		<button class=\'btn btn-lg btn-primary\' type=\'button\' ng-click="save()">Save</button> 		<button class=\'btn btn-link btn-sm\' ng-click="$close()">Cancel</button> 	</div>  ' );
t.put( 'geekitem_dialog_uploadimage.tpl', '     <style>         .grid-wrapper {             margin: 5px 12px;             padding: 5px;         }          .grid-header > div {             display: flex;             justify-content: center;             align-items: center;             font-weight: bold;         }          .grid-filerow {             display: grid;             grid-template-columns: 1fr 1fr 60px .5fr;             grid-gap: 5px;         }          .grid-filerow-alt {             display: grid;             grid-template-columns: repeat(3, 1fr);             grid-gap: 5px;             border-bottom: 1px solid #0a3149;         }     </style>      <div class=\'modal-header\'>         <button class=\'close\' type=\'button\' ng-click="cancel()">             <span>×</span>         </button>         <h4 class=\'modal-title\'>Upload Image</h4>     </div>  <div class=\'modal-body container-fluid\'>     <div class="row">         <div class="col-xs-12">             <input type="file" nv-file-select="" uploader="uploader" multiple/>         </div>     </div>      <div class="row">         <div class="grid-wrapper grid-filerow grid-header" style="background: #95C5EB;">             <div>Name</div>             <div>Progress</div>             <div>Status</div>             <div>Actions</div>         </div>         <div ng-repeat="fileitem in uploader.queue">             <div class="grid-wrapper grid-filerow">                 <div>                     <div ng-if="fileitem.sizechecked">                         <small ng-if="fileitem.large">Image too large.</small>                         <small ng-if="fileitem.small">Image too small.</small>                         <small ng-if="!fileitem.small && !fileitem.large">                             {{ fileitem.file.name }} {{ fileitem.file.size/1024/1024|number:2 }} MB                             <span class="text-success" ng-if="fileitem.imageid"> 										Upload Complete. [<a target=\'_blank\'                                                              ng-href="/image/{{fileitem.imageid}}">View</a>] 									</span>                         </small>                     </div>                     <div ng-if="!fileitem.sizechecked">                         <small>Checking Size...</small>                     </div>                     <div class="text-danger strong">{{fileitem.errors.size}}</div>                 </div>                 <div class="progress" style="margin-bottom: 0;">                     <div class="progress-bar"                          role="progressbar"                          ng-style="{ \'width\': fileitem.progress + \'%\' }"></div>                 </div>                 <div style="text-align: center">                     <span ng-show="fileitem.isSuccess"><i class="glyphicon glyphicon-ok"></i></span>                     <span ng-show="fileitem.isCancel"><i class="glyphicon glyphicon-ban-circle"></i></span>                     <span ng-show="fileitem.isError"><i class="glyphicon glyphicon-remove"></i></span>                 </div>                 <div>                     <button type="button"                             class="btn btn-warning btn-xs"                             ng-click="fileitem.cancel()"                             ng-disabled="!fileitem.isUploading">                         <span class="glyphicon glyphicon-ban-circle"></span> Cancel                     </button>                     <button type="button"                             class="btn btn-danger btn-xs"                             ng-click="fileitem.remove()">                         <span class="glyphicon glyphicon-trash"></span> Remove                     </button>                 </div>             </div>             <div class="grid-wrapper grid-filerow-alt">                 <div>                     <input type="text"                            placeholder="Caption (req.)"                            autocomplete="off"                            class="form-control has-error"                            ng-class="{\'has-error\':fileitem.errors.caption}"                            ng-model="fileitem.caption"                            id="caption"/>                      <div class="text-danger strong">{{fileitem.errors.caption}}</div>                 </div>                 <div>                     <input type="text"                            placeholder="Mod Note"                            autocomplete="off"                            class="form-control"                            ng-model="fileitem.adminnote"                            id="adminnote"/>                 </div>                 <div>                     <select class="form-control"                             placeholder="Select Gallery (req.)"                             ng-class="{\'has-error\':fileitem.errors.caption}"                             ng-model="fileitem.gallery">                         <option value="" disabled selected>Select Gallery</option>                         <option ng-repeat="g in geekimageSettings.galleries" value="{{g.name}}">                             {{g.prettyname}}                         </option>                     </select>                      <div class="text-danger strong">{{fileitem.errors.gallery}}</div>                 </div>             </div>              <div class="text-danger" ng-if="fileitem.error">                 <strong>Error: {{ fileitem.error }}</strong>             </div>         </div>     </div>      <div class="row">         <div class="col-xs-12">             <div>                 Upload Progress:                 <div class="progress" style="">                     <div class="progress-bar" role="progressbar" ng-style="{ \'width\': uploader.progress + \'%\' }"></div>                 </div>             </div>             <button type="button" class="btn btn-success btn-sm" ng-click="uploadAll( uploader )"                     ng-disabled="!uploader.getNotUploadedItems().length">                 <span class="glyphicon glyphicon-upload"></span> Upload all             </button>             <button type="button" class="btn btn-warning btn-sm" ng-click="uploader.cancelAll()"                     ng-disabled="!uploader.isUploading">                 <span class="glyphicon glyphicon-ban-circle"></span> Cancel all             </button>             <button type="button" class="btn btn-danger btn-sm" ng-click="uploader.clearQueue()"                     ng-disabled="!uploader.queue.length">                 <span class="glyphicon glyphicon-trash"></span> Remove all             </button>         </div>     </div>      <div class="row">         <div class="col-xs-12">             <license-selector license="license"></license-selector>         </div>     </div>      <div class="row">         <div class="col-xs-12">                          <div class=\'wiki\'><p><a class=\'anchor-target\' name="Image_Guidelines"></a>				<a class="anchor-target" id="toc0"></a>  				<div>  					<h3>Image Guidelines</h3></div></p>  <p>You may only upload pictures that you have taken yourself or for which you have obtained explicit permission to upload from the rights holder.  <strong>Include a notice that permission was received and from whom in the caption</strong> when uploading images that are not your own.  Further, uploading an image with a visible watermark, company logo, url, hashtag, or any other branding not original to the image is prohibited.  Please obtain a version without such elements if you wish to upload that image.  Failure to adhere to these rules may be grounds for suspension of uploading rights or suspension of your account, depending on the severity of the offense.</p>  <p>Before uploading an image, consider whether it is likely to be approved. Make sure that the image is properly cropped and rotated, and that the quality is at least comparable to other images in the database. Submitting multiple similar images at once may result in all images being rejected; instead try choosing the best image or images from a set to upload. Please do NOT submit individual images for each component (character, mini, card, tile, etc.)  This is especially true for collectible minis games and <a class="" href="/wiki/page/CCG#">CCG</a>s.</p>  <p>Images may be rejected for any of the following reasons:</p>  <ul>     <li> Too similar: Image is too similar to other images uploaded by the same user or to an existing image and is not of significantly better quality.</li>     <li> Duplicate image: Image is already in the database.</li>     <li> Rule Scans: Please don\'t upload scans/copy photography of the rules pages.</li>     <li> Offensive: Image contains inappropriate material.</li>     <li> Corrupt: Image does not display properly.</li>     <li> Too small: Image resolution is too low. (Images should be at least 320x200, if not a company logo)</li>     <li> Too large: Scans and copy-photography images of flat materials, such as counter sheets and cards, may have a maximum resolution of 200ppi, or a maximum size of 1900 pixels on the long side, whichever is less.</li>     <li> Blurry: Image is not well focused.</li>     <li> Under/Overexposed: Image is too dark or bright.</li>     <li> Bad glare: Image has too much glare, or is obscured by a reflection from the flash.</li>     <li> Badly cropped: Image has too much white space. </li>     <li> Badly rotated: Image is sideways or upside-down.</li>     <li> No caption: Image does not have a caption (includes fillers such as &quot;Image1&quot;, &quot;Image2&quot;, etc.)</li>     <li> Wrong item: Image is submitted for the wrong item.</li>     <li> Advertising: No advertisements or promotional banners for new releases. To advertise, contact adrates@boardgamegeek.com</li> </ul>  <p>Please upload images in JPG format and only click the submit/upload button one time.</p>  <p>If your image is declined, seek out the reason and correct the problem. Do not try to upload again in the hopes it will get through geekmod</p>  <p>Every user has a personal gallery.  Please do not link images from a personal gallery to a database entry.</p>  </div></div></div>                      </div>     </div> </div>      <div class=\'modal-footer\'>         <button class=\'btn btn-link\' ng-click="cancel()">Cancel</button>     </div>  ' );
t.put( 'geekitem_dialog_recordplay.tpl', ' 		<input type="hidden" 				 class="form-control" 				 uib-datepicker-popup="yyyy-MM-dd" 				 datepicker-options="{maxDate: maxDate, showWeeks: false}" 				 ng-model="play.date" 				 show-button-bar="false" 				 ng-required="true" 				 is-open="dateopened" 				 close-text="Close"/> 		<div class="animate-switch-container" ng-switch="viewVars.recordScreen"> 			<div scroll-top-on-enter class="switch-slide switch-secondary" ng-switch-when="players"> 				<div class=\'modal-header modal-header-table\'> 					<div class=\'modal-header-table-left\'> 						<button class=\'visible-xs-inline btn btn-indigo\' ng-click="setRecordScreen(\'main\')" type=\'button\'> 							<span class=\'glyphicon glyphicon-chevron-left\'></span> 						</button> 					</div>  					<div class=\'modal-header-table-center\'> 						<h4 class=\'modal-title\'>Players</h4> 					</div>  					<div class=\'modal-header-table-right\'> 						<button class=\'hidden-xs close\' type=\'button\' ng-click="setRecordScreen(\'main\')"> 							<span>×</span> 						</button> 						<button class=\'visible-xs-inline btn btn-primary\' type=\'button\' ng-click="setRecordScreen(\'main\')" ng-show=\'play.players.length > 0\'> 							Apply 						</button> 					</div> 				</div>  				<div class="modal-body"> 					<form> 						<div class=\'list-selector-multi-search\'> 							<span ng-repeat="user in play.players"> 								<button type=\'button\' class=\'list-selector-multi-search-selected btn btn-sm btn-subtle\' ng-click=\'togglePlayer(user)\'> 									<span ng-if="!user.userid">&ldquo;{{user.name}}&rdquo;</span> 									<span ng-if="user.userid"> 										{{user.username}} 										<span class=\'text-normal\'>{{user.name}}</span> 									</span> 									<i class=\'btn-x fi-x\'></i> 								</button> 							</span> 							<div class="form-group form-group-search"> 								<input class="form-control" 										 placeholder="Search or add player name" 										 focus-on="AddPlayerFocus" 										 type="text" 										 autocorrect="off" 								       ng-model="play.userfilter" 										 autofocus> 								<button class="search" type="submit"> 									<i class="fi-magnifying-glass"></i> 								</button> 								<button class="search-clear" type="reset" ng-show="play.userfilter" ng-click="play.userfilter = \'\'"> 									<i class="fi-x"></i> 									<span class="sr-only">Clear Search</span> 								</button> 							</div> 						</div> 					</form> 					<div class=\'list-selector\'> 						<ul class=\'form-group list-selector-items\'> 							<li ng-repeat="user in userSearchResults" ng-click="togglePlayer(user)" ng-class="{active: user.selected}"> 								<img class="avatar avatar-sm" 									  ng-src="//cf.geekdo-static.com/avatars/{{user.avatarfile}}" 									  alt="{{user.username}} Avatar" 									  ng-if="user.avatar && user.avatarfile"> 								<span ng-if="!user.avatar || !user.avatarfile" class="avatar avatar-sm avatar-default"> 									<i class="fi-torso"></i> 								</span> 								<span ng-if="!user.userid">&ldquo;{{user.name}}&rdquo; (non-user player)</span> 								<span ng-if="user.userid"> 									{{user.username}} 									<span class=\'list-selector-items-meta\'>{{user.name}}</span> 								</span> 							</li> 						</ul> 					</div> 					<button ng-show=\'play.players.length > 0\' class=\'btn btn-sm btn-link\' type=\'button\' ng-click="setRecordScreen(\'players-gameplay\')"> 						Add player details (scores, teams, etc.) 					</button> 				</div> 				<div class=\'modal-footer hidden-xs\'> 					<span ng-show=\'play.players.length > 0\'> 						<button class=\'hidden-xs btn btn-lg btn-primary\' ng-click="setRecordScreen(\'main\')"> 							Apply 						</button> 					</span> 					<span ng-show=\'play.players.length == 0\'> 						<button class=\'btn btn-lg btn-subtle\' type=\'button\' ng-click="setRecordScreen(\'main\')"> 							Cancel 						</button> 					</span> 				</div> 			</div> 			<div scroll-top-on-enter class="switch-slide switch-secondary" ng-switch-when="players-gameplay"> 				<div class=\'modal-header modal-header-table\'> 					<div class=\'modal-header-table-left\'> 						<button class=\'visible-xs-inline btn btn-indigo\' ng-click="setRecordScreen(\'players\')" type=\'button\'> 							<span class=\'glyphicon glyphicon-chevron-left\'></span> 						</button> 					</div>  					<div class=\'modal-header-table-center\'> 						<h4 class=\'modal-title\'>Details</h4> 					</div>  					<div class=\'modal-header-table-right\'> 						<button class=\'hidden-xs close\' type=\'button\' ng-click="setRecordScreen(\'main\')"> 							<span>×</span> 						</button> 						<button class=\'visible-xs-inline btn btn-primary\' type=\'button\' ng-click="setRecordScreen(\'main\')" ng-show=\'play.players.length > 0\'> 							Apply 						</button> 					</div> 				</div>  				<div class=\'modal-body\'> 					<div ng-class="{\'record-play-multiple-plays\':play.quantity>=2}"> 						<h4 class=\'list-selector-title\'>Optional Player Details</h4> 						<ul class="record-play-players"> 							<li class="record-play-player" ng-repeat="player in play.players"> 								<button class=\'close\' ng-click="togglePlayer(player)"> 									<i class="fi-x"></i> 								</button> 								<div class="record-play-player-avatar"> 									<img ng-if="player.avatar && player.avatarfile" ng-src="//cf.geekdo-static.com/avatars/{{player.avatarfile}}" class="avatar avatar-sm"> 									<div ng-if="!player.avatar || !player.avatarfile" class="avatar avatar-sm avatar-default"> 										<i class="fi-torso"></i> 									</div> 								</div> 								<div class="record-play-player-fields"> 									<div class="record-play-player-name form-group form-group-condensed"> 										<strong ng-show="player.username">{{player.username}}&nbsp;</strong> {{player.name}} 										<span ng-show="player.userid==playstats.userid"> (me)</span> 									</div>  									<div class=\'row\'> 										<div class=\'col-xs-6\'> 											<div class="form-group form-group-condensed single-play-only"> 												<input ng-model="player.color" type="text" placeholder="Team/Color" class="form-control"> 											</div> 											<div class="form-group form-group-condensed single-play-only"> 												<input ng-model="player.position" type="text" placeholder="Starting Position" class="form-control"> 											</div> 										</div> 										<div class=\'col-xs-6\'> 											<div class="form-group form-group-condensed single-play-only"> 												<input ng-model="player.score" type="text" placeholder="Score" class="form-control"> 											</div> 											<div class="form-group form-group-condensed"> 												<input ng-model="player.rating" type="text" placeholder="Play Rating" class="form-control"> 											</div> 										</div> 									</div> 									<div class="checkbox single-play-only"> 										<label> 											<input ng-model="player.win" type="checkbox"> 											Won? 										</label> 										<label> 											<input ng-model="player.new" type="checkbox"> 											First time playing? 										</label> 									</div> 								</div> 							</li> 						</ul>  						<div class=\'checkbox checkbox-border\'> 							<label> 								<input ng-model="play.nowinstats" type=\'checkbox\'> Don\'t count win stats 								<p class="help-block"> 									Save play details but don\'t use when analyzing plays. 								</p> 							</label> 						</div> 					</div> 					<button class=\'btn btn-link btn-sm\' ng-click="setRecordScreen(\'players\')">Back to player selection</button> 				</div> 				<div class=\'modal-footer\'> 					<button class=\'btn btn-lg btn-primary\' type=\'button\' ng-click="setRecordScreen(\'main\')">Apply</button> 				</div> 			</div> 			<div scroll-top-on-enter class="switch-slide switch-secondary" ng-switch-when="location"> 				<div class=\'modal-header modal-header-table\'> 					<div class=\'modal-header-table-left\'> 						<button class=\'visible-xs-inline btn btn-indigo\' ng-click="setRecordScreen(\'main\')" type=\'button\'> 							<span class=\'glyphicon glyphicon-chevron-left\'></span> 						</button> 					</div>  					<div class=\'modal-header-table-center\'> 						<h4 class=\'modal-title\'>Location</h4> 					</div>  					<div class=\'modal-header-table-right\'> 						<button class=\'hidden-xs close\' type=\'button\' ng-click="cancel()"> 							<span>×</span> 						</button> 					</div> 				</div> 				<div class="modal-body"> 					<form> 						<div class="form-group form-group-search"> 							<input ng-model="play.locationfilter" 									 class="form-control" 									 placeholder="Search or add new location" 									 type="text" 									 autofocus> 							<button class="search" type="submit"> 								<i class="fi-magnifying-glass"></i> 							</button> 							<button class="search-clear" type="reset" ng-show="play.locationfilter" ng-click="play.locationfilter = \'\'"> 								<i class="fi-x"></i> 								<span class="sr-only">Clear Search</span> 							</button> 						</div> 					</form> 					<div class=\'list-selector\'> 						<ul class=\'form-group list-selector-items\'> 							<li ng-repeat="location in locations | filter: play.locationfilter" 								 ng-click="setLocation(location.location)" 								 ng-class="{\'active\': play.location == location.location}"> 								<span ng-show="location.new">Use location: "</span>{{location.location}}<span ng-show="location.new">"</span> 							</li> 						</ul>  						<div ng-if=\'!locations\'> 							<h4 class=\'list-selector-title\'>Suggested Locations</h4> 							<ul class=\'form-group list-selector-items\'> 								<li ng-click="setLocation(\'Home\')">Home</li> 								<li ng-click="setLocation(\'Office\')">Office</li> 								<li ng-click="setLocation(\'Library\')">Library</li> 							</ul> 						</div> 					</div> 				</div> 				<div class=\'modal-footer\'> 					<button class=\'btn btn-lg btn-subtle\' type=\'button\' ng-click="setRecordScreen(\'main\')">Cancel</button> 				</div> 			</div>  			<div remember-parent-scroll="log-play-primary" class="switch-slide switch-primary" ng-switch-default> 				<div class=\'modal-header modal-header-table\'> 					<div class=\'modal-header-table-left\'> 						<button class=\'visible-xs-inline btn btn-indigo\' ng-click="cancel()" type=\'button\'> 							<span>Cancel</span> 						</button> 					</div>  					<div class=\'modal-header-table-center\'> 						<h4 class=\'modal-title\'>Log Play</h4> 					</div>  					<div class=\'modal-header-table-right\'> 						<button class=\'hidden-xs close\' type=\'button\' ng-click="cancel()"> 							<span>×</span> 						</button> 						<button ng-disabled=\'saving\' class=\'visible-xs-inline btn btn-primary\' type=\'button\' ng-click="save()"> 							Save 						</button> 					</div> 				</div>  				<div class=\'modal-body\'> 					<div class=\'modal-body-intro\' ng-if=\'playstats.count == 0\'> 						Join in on <strong>pure geeky statistical fun</strong> by keeping track of the games you play (by date and number of times played). 						<a target="_blank" href="/wiki/page/plays">Learn more why and how others log plays</a>. 					</div> 					<div ng-show="lastPlay && lastPlay.location || lastPlay.players.length > 0" class="modal-body-banner"> 						<h4 class=\'modal-body-banner-title\'>Copy from Previous Play?</h4> 						<div class=\'modal-body-banner-description\'> 							<em> 								{{lastPlay.date| date:\'MMM d, yyyy\'}} 								<span ng-if="lastPlay.location"> 									@ {{lastPlay.location}} 								</span> 								<span ng-if="lastPlay.players.length > 0"> 									with <player-list players="lastPlay.players"></player-list> 								</span> 							</em> 						</div> 						<div class=\'modal-body-banner-cta\'> 							<button ng-click="loadFromLastPlay()" type=\'button\' class=\'btn btn-primary btn-sm\'> 								Yes, copy date 								<span ng-if="lastPlay.players.length && lastPlay.location">, location, and players</span> 								<span ng-if="!lastPlay.players.length || !lastPlay.location"> and 									<span ng-if="lastPlay.players.length">players</span> 									<span ng-if="lastPlay.location">location</span> 								</span> 							</button> 						</div> 					</div> 					<div class=\'record-play-basic\'> 						<div class="form-group"> 							<label>When did you play?</label> 							<div class="row"> 								<div class=\'col-sm-8\'> 									<div class="input-group"> 										<button type=\'button\' class=\'form-control btn btn-default btn-calendar\' ng-click="toggleDate($event)"> 											<span ng-if="play.date"> 												{{play.date|date:\'EEE - MMM d, yyyy\'}} 											</span> 											<span ng-if="!play.date" class=\'text-muted\'>Select date</span> 										</button> 										<span class="input-group-btn"> 											<button class="btn btn-default" ng-click="addDaysToDate( -1)"><span class=\'glyphicon glyphicon-chevron-left\'></span></button> 										</span> 										<span class="input-group-btn"> 											<button class="btn btn-default" ng-disabled="play.date.valueOf() >= today.valueOf()" ng-click="addDaysToDate( 1)"><span class=\'glyphicon glyphicon-chevron-right\'></span></button> 										</span> 									</div> 								</div> 							</div> 							<p class=\'help-block\'> 								<span class="help-block-suggestion" ng-show="play.date.valueOf() != today.valueOf()"> 									Today: 									<button type=\'button\' 										class=\'btn btn-xs btn-link\' 										ng-click="updateDate(today)"> 										{{today|date:\'EEE - MMM d\'}} 									</button> 								</span> 								<span class="help-block-suggestion" ng-hide="!lastPlay || lastPlay.date.valueOf() == today.valueOf() || lastPlay.date.valueOf() == play.date.valueOf()"> 									Prev play: 									<button type=\'button\' 										class=\'btn btn-xs btn-link\' 										ng-click="updateDate(lastPlay.date)"> 										{{lastPlay.date|date:\'EEE - MMM d\'}} 									</button> 								</span> 							</p> 						</div>  						<div class="form-group"> 							<label>Qty (how many times did you play?)</label>  							<div class="row"> 								<div class=\'col-sm-4\'> 									<div class="input-group"> 										<input type="text" class="form-control" ng-model="play.quantity"> 										<span class="input-group-btn"> 											<button class="btn btn-default" ng-click="play.quantity = increment(play.quantity, -1);"><span class=\'glyphicon glyphicon-minus\'></span></button> 										</span> 										<span class="input-group-btn"> 											<button class="btn btn-default" ng-click="play.quantity = increment(play.quantity,  1);"><span class=\'glyphicon glyphicon-plus\'></span></button> 										</span> 									</div> 								</div> 							</div> 						</div>  						<div class="form-group"> 							<div class="checkbox record-play-twitter"> 								<label> 									<input type="checkbox" ng-model="play.twitter"> 									<i class="fi-social-twitter c-brand-twitter"></i> Post on Twitter 								</label> 								<div no-animate ng-show="play.twitter !== viewVars.user.tweetplays" class="checkbox checkbox-child"> 									<label> 										<input type="checkbox" ng-model="play.savetwitterpref" checked=\'checked\'> 										Keep <span no-animate ng-show="! play.twitter">un</span>checked for future plays 									</label> 								</div> 							</div> 						</div>  						<a class="toggler-caret" ng-click="viewVars.showAdvanced = !viewVars.showAdvanced" ng-class="{ \'is-active\': viewVars.showAdvanced }"> 							<span class="glyphicon glyphicon-menu-right"></span> 							<strong>Game details</strong> (players, time, etc.) 						</a> 					</div>  					<div class="record-play-advanced" uib-collapse="!viewVars.showAdvanced"> 						<fieldset name=\'record-play-details\'> 							<div class="form-group"> 								<label> 									Where did you play? 									<button ng-click="play.location = \'\'" 											  type="button" 											  ng-if="play.location" 											  class="btn btn-empty btn-xs">Clear</button> 								</label> 								<button type=\'button\' 										  class=\'btn btn-block btn-default btn-chevron-right\' 										  ng-click="setRecordScreen(\'location\')"> 									<span ng-show="play.location">{{play.location}}</span> 									<span class=\'text-muted\' ng-hide="play.location">Add or select location &hellip;</span> 								</button> 							</div>  							<div class="form-group"> 								<label> 									How long did you play? 									<button ng-click="play.minutes = null; play.hours = null;" 											  type="button" 											  ng-if="play.minutes || play.hours" 											  class="btn btn-empty btn-xs">Clear</button> 								</label>  								<div class="btn-group btn-group-block clearfix form-group-condensed" role="group"> 									<button ng-repeat="interval in intervals" 											  ng-click="setTime(interval.minutes);" 											  type ="button" 											  class = "btn btn-default" 											  ng-class="{\'active\':play.minutes==interval.minutes && !viewVars.showOtherTime, 															 \'hidden-xs\':interval.minutes > 90}">{{interval.label}}</button>  									<button ng-click="viewVars.showOtherTime = true; play.minutes = null; play.hours = null" 											  ng-class="{\'active\': viewVars.showOtherTime}" 											  type="button" 											  class="btn btn-default">Other</button> 								</div>   								<div ng-show="viewVars.showOtherTime" class="row"> 									<div class=\'col-xs-6 col-sm-3\'> 										<ui-select 											ng-model="play.hours" 											tagging 											theme="bootstrap"> 											<ui-select-match placeholder="Hours">{{play.hours}} h</ui-select-match> 											<ui-select-choices repeat="hours as hours in hourOptions" 												refresh="refreshHours($select.search, $select)" 												position="down" 												refresh-delay="10" 												> 												<div>{{hours}} h</div> 											</ui-select-choices> 										</ui-select> 									</div> 									<div class=\'col-xs-6 col-sm-3\'> 										<ui-select 											ng-model="play.minutes" 											tagging 											theme="bootstrap"> 											<ui-select-match placeholder="Minutes">{{play.minutes}} m</ui-select-match> 											<ui-select-choices repeat="minutes as minutes in minuteOptions" 												refresh="refreshMinutes($select.search, $select)" 												position="down" 												refresh-delay="10" 												> 												<div>{{minutes}} m</div> 											</ui-select-choices> 										</ui-select> 									</div> 								</div> 							</div>  							<div class="checkbox record-play-incomplete"> 								<label> 									<input ng-model="play.incomplete" type="checkbox"> 									Game incomplete? 								</label> 							</div>  							<div class="form-group"> 								<label>Comments</label> 								<textarea ng-model="play.comments" class="form-control" rows="5"></textarea> 							</div> 						</fieldset> 						<div class="form-group"> 							<label> 								Who played? 							</label> 							<button type=\'button\' class=\'btn btn-block btn-default btn-chevron-right\' ng-click="setRecordScreen(\'players\')"> 								<span class=\'text-muted\' ng-if="!play.players.length">Add or select players &hellip;</span> 								<player-list players="play.players"></player-list> 							</button> 						</div>   					</div> 				</div> 				<div class=\'modal-footer\'> 					<button ng-disabled=\'saving\' class=\'btn btn-lg btn-primary\' type=\'button\' ng-click="save()"> 						Save 						<span ng-show=\'saving\' class=\'glyphicon glyphicon-refresh is-refreshing\'></span> 					</button> 					<button class=\'btn btn-link btn-sm\' ng-click="cancel()">Cancel</button> 				</div> 			</div> 		</div>  ' );
