t.put( 'geekitem_tabs_with_dropdown.tpl', ' 	<nav ng-controller="GeekDropdownCtrl as dropdownctrl" id=\'primary_tabs\' class="game-nav-tabs"> 		<ul class="nav nav-tabs" role="tablist"> 			<li 				 ng-class="{\'active\':tab.active && !tab.mobileTitle, 								 \'hidden-xs\': !tab.mobile, 								 \'visible-xs-inline-block\':tab.mobileTitle, 								 \'nav-tabs-title\' : tab.mobileTitle}" 				 ng-repeat="tab in ::tabs|filter:{type:\'tab\'}">  				<a ui-sref="{{::tab.route}}({{tab.params}})" role="tab"> 					{{::tab.heading}} 				</a> 			</li>  			<li uib-dropdown 				dropdown-append-to-body 				on-toggle="dropdownctrl.onToggle(open)" 				ng-class="{\'active\': menuActive}"> 				<button uib-dropdown-toggle 					aria-haspopup="true" 					aria-expanded="false"> 					More <span class="caret"></span> 				</button> 				<div class=\'nav-tabs-more-dropdown dropdown-menu-right\' uib-dropdown-menu> 					<a id="dropdowntarget" tabindex="-1"></a> 					<div class=\'row\'> 						<div class=\'col-xs-6 col-sm-12 col-md-12 col-lg-6\'> 							<h3>More of this game</h3> 							<ul> 								<li class=\'visible-xs\' 									 ng-class="{\'active\':tab.active}" 									 ng-repeat="tab in tabs|filter:{type:\'tab\'}|filter:{mobile:false}"> 									 <a ui-sref="{{::tab.route}}({{tab.params}})" role="tab"> 										 {{::tab.heading}} 									 </a> 								 </li>  								<li ng-repeat="tab in tabs|filter:{type:\'menu\', menuType:\'game\'}" 									 ng-class="{\'active\':tab.active}">  									<a ui-sref="{{::tab.route}}({{tab.params}})" role="tab"> 										{{::tab.heading}} 									</a> 								</li> 							</ul> 						</div> 						<div class=\'col-xs-6 col-sm-12 col-md-12 col-lg-6\'> 							<h3>News &amp; Links</h3> 							<ul> 								<li ng-repeat="tab in tabs|filter:{type:\'menu\', menuType:\'learn\'}" 									 ng-class="{\'active\':tab.active}">  									<a ui-sref="{{::tab.route}}({{tab.params}})" role="tab"> 										{{::tab.heading}} 									</a> 								</li> 							</ul> 						</div> 					</div> 					<a ng-focus="dropdownctrl.onToggle(true)" tabindex="0"></a> 				</div> 			</li> 		</ul> 	</nav>  ' );
