t.put( 'geekitem_tab_edit.tpl', ' 	<div class=\'global-body-content-primary\'> 		<div class="panel" show-access="itemmgr"> 			<div class="panel-header panel-header-lg"> 				<h3 class=\'panel-title\'> 					Admin Edit 				</h3> 			</div> 			<div class="panel-body"> 				<div class="panel"> 					<div class="panel-body"> 						<span 							show-access="itemmgr" 							access-objecttype="{{geekitemeditctrl.geekitemParams.objecttype}}" 							access-objectid="{{geekitemeditctrl.geekitemParams.objectid}}" 							>  							<button 								type="button" class="btn btn-default btn-sm" 								ng-click="geekitemeditctrl.invalidateCache()"> 								Invalidate Cache 							</button> 							<a ng-href="/items/adminlist/{{geekitemeditctrl.geekitem.data.item.subtype}}/{{geekitemeditctrl.geekitem.data.item.itemstate}}?objectid={{geekitemeditctrl.geekitemParams.objectid}}" class="btn btn-sm btn-default">Admin Queue View</a> 						</span> 						<span 							show-access="{{geekitemeditctrl.geekitemParams.objecttype == \'weblink\' ? \'itemmgr\' : \'itemdel\'}}" 							access-objecttype="{{geekitemeditctrl.geekitemParams.objecttype}}" 							access-objectid="{{geekitemeditctrl.geekitemParams.objectid}}" 							> 							<a ng-href="/geekitem.php?action=notifyusers&objecttype={{geekitemeditctrl.geekitemParams.objecttype}}&objectid={{geekitemeditctrl.geekitemParams.objectid}}" class="btn btn-sm btn-default">Notify Users</a> 							<a ng-href="/geekitem.php?action=selectmerge&objecttype={{geekitemeditctrl.geekitemParams.objecttype}}&objectid={{geekitemeditctrl.geekitemParams.objectid}}" class="btn btn-sm btn-warning">Merge Item</a> 							<a 									  ng-if="geekitemeditctrl.geekitem.data.item.subtype == \'boardgame\' 									      || geekitemeditctrl.geekitem.data.item.subtype == \'boardgameexpansion\' 											|| geekitemeditctrl.geekitem.data.item.subtype == \'boardgamecompilation\'" 									  ng-href="/geekitem.php?action=converttoaccessory&objecttype={{geekitemeditctrl.geekitemParams.objecttype}}&objectid={{geekitemeditctrl.geekitemParams.objectid}}" class="btn btn-sm btn-warning">Convert to Accessory</a> 							<a ng-href="/geekitem.php?action=checkdelete&objecttype={{geekitemeditctrl.geekitemParams.objecttype}}&objectid={{geekitemeditctrl.geekitemParams.objectid}}" class="btn btn-sm btn-danger">Delete Item</a> 						</span> 					</div> 				</div>  				<admin-notes-module ng-if="geekitemctrl.showadminnotes"></admin-notes-module>  				<div class="panel"> 					<div class="panel-header panel-header-sm"> 						<h3 class=\'panel-title\'> 							Names 						</h3> 					</div> 					<div class="panel-body"> 						<table class="table table-bordered table-condensed table-hover"> 							<tr> 								<th style="width:80%">Name</th> 								<th style="width:10%">SortIndex</th> 								<th style="width:10%">Edit</th> 							</tr> 							<tr ng-repeat="name in geekitemeditctrl.geekitem.data.item.allnames"> 								<td> 									<span ng-if="name.primaryname == 1"><i class="fi-check"></i></span> 									<span editable-text="name.name" e-name="name" e-form="rowform" e-style="width:400px;" 											e-required>{{name.name}}</span> 								</td> 								<td> 									<span editable-text="name.sortindex" e-name="sortindex" e-form="rowform" e-required>{{name.sortindex}}</span> 								</td>  								<td style="white-space: nowrap"> 									<form editable-form name="rowform" ng-show="rowform.$visible" class="form-buttons form-inline" 											onaftersave="geekitemeditctrl.saveName(name)" shown="geekitemeditctrl.inserted_name == name"> 										<button type="submit" 												  uib-tooltip="Save" 												  ng-disabled="rowform.$waiting" 												  class="btn btn-xs btn-success"> 											<i class="fi-check"></i> 										</button> 										<button type="button" 												  uib-tooltip="Cancel" 												  ng-disabled="rowform.$waiting" 												  ng-click="rowform.$cancel()" 												  class="btn btn-xs btn-default"> 											<i class="fi-x"></i> 										</button> 									</form> 									<div class="buttons" ng-show="!rowform.$visible"> 										<button class="btn btn-xs btn-success" 												  uib-tooltip="Edit" 												  ng-disabled="updating" 												  ng-click="rowform.$show()"> 											<i class="fi-pencil"></i></button>  										<button class="btn btn-xs btn-warning" 												  uib-tooltip="Make Primary Name" 												  ng-disabled="updating" 												  ng-hide="name.primaryname == 1" 												  ng-click="geekitemeditctrl.setPrimaryName( name, this )"> 											<i class="fi-arrow-up"></i></button>  										<button class="btn btn-xs btn-danger" 												  uib-tooltip="Remove Name" 												  ng-disabled="updating" 												  ng-hide="name.primaryname == 1" 												  ng-click="geekitemeditctrl.removeName( name, this )"> 											<i class="fi-minus"></i></button> 									</div> 								</td> 							</tr> 						</table> 						<button class="btn btn-default" ng-click="geekitemeditctrl.addName()">Add Name</button> 					</div> 				</div>  				<div class="panel"> 					<div class="panel-header panel-header-sm"> 						<h3 class=\'panel-title\'> 							Fields 						</h3> 					</div> 					<div class="panel-body"> 						<table class="table table-bordered table-condensed table-hover"> 							<tr> 								<th style="width:30%"><strong>Field</strong></th> 								<th style="width:70%"><strong>Value</strong></th> 							</tr>  							<tr show-access="{{data.adminaccess}}" ng-repeat="data in geekitemeditctrl.geekitem.data.item.itemdata|filter:{datatype:\'geekitem_fielddata\'}|filter:{fieldname:\'!name\'}"> 								<td> 									{{data.title}} 								</td> 								<td> 									<edit-item-select 										ng-if="data.edit.edittype === \'select\'" 										edit-model="geekitemeditctrl.geekitem.data.item[data.fieldname]" 										onaftersave="geekitemeditctrl.saveField(fieldname, value)" 										fielddata="data"></edit-item-select> 									<a href="#" 										ng-if="!data.edit.edittype" 										editable-text="geekitemeditctrl.geekitem.data.item[data.fieldname]" 										e-maxlength="{{data.maxlength||300}}" 										e-size="{{data.maxlength||0}}" 										onaftersave="geekitemeditctrl.saveField(data.fieldname, $data)"> 										{{geekitemeditctrl.geekitem.data.item[data.fieldname] || \'N/A\'}} 									</a> 								</td> 							</tr> 						</table> 					</div> 				</div>  				<div class="panel"> 					<div class="panel-header panel-header-sm"> 						<h3 class=\'panel-title\'> 							Linked Items 						</h3> 					</div> 					<div class="panel-body"> 						<table class="table table-bordered table-condensed"> 							<tr> 								<th style="width:30%"><strong>Field</strong></th> 								<th style="width:70%"><strong>Links</strong></th> 							</tr>  							<tr ng-repeat="linkdata in geekitemeditctrl.geekitem.data.item.itemdata|filter:{datatype:\'geekitem_linkdata\'}"> 								<td> 									{{linkdata.title}} 									<button class="pull-right btn btn-xs btn-info" 											  uib-tooltip="Add {{linkdata.title}}" 											  ng-hide="linkdata.uneditable" 											  ng-click="addlink = !addlink"> 										<i class="fi-plus"></i> 									</button>  									<button class="btn btn-xs btn-info pull-right" 											  ng-if="linkdata.showall_ctrl" 											  ng-hide="linkdata.uneditable" 											  ng-click="geekitemeditctrl.showAllItems( linkdata )" 											  style="margin-right:5px;"> 										Show All 									</button> 								</td> 								<td> 									<div class="row" ng-repeat="row in linkdata.items|partition:2"> 										<div class="col-md-6" ng-repeat="item in row"> 											<button class="btn btn-xs btn-info" 													  style="margin:3px;" 													  ng-click="geekitemeditctrl.linkItem( item, linkdata );"> 												{{item.name}} 											</button> 										</div> 									</div>  									<table class="table table-hover table-condensed" style="margin: 0;"> 										<tr ng-repeat="link in geekitemeditctrl.geekitem.data.item.links[linkdata.keyname]"> 											<td style="border: none;" width="80%" class=\'td-condensed\'> 												<span ng-if="link.primarylink == 1"><i class="fi-check"></i></span> 												<a ng-href="{{link.href}}">{{link.name}}</a> 												<span class="label label-danger" ng-if="link.itemstate == \'pending\'">Pending</span> 												<span class="label label-warning" ng-if="link.itemstate == \'revise\'">Revise</span> 											</td> 											<td style="border: none;" width="20%" align="right" class=\'td-condensed\'> 												<button class="btn btn-xs btn-warning" 														  uib-tooltip="Toggle Primary Link" 														  ng-hide="linkdata.uneditable" 														  ng-click="geekitemeditctrl.setPrimaryLink(link, !link.primarylink, this)" 														  ng-disabled="updating"> 													<span ng-show="!link.primarylink"><i class="fi-arrow-up"></i></span> 													<span ng-show="link.primarylink"><i class="fi-arrow-down"></i></span> 												</button>  												<button class="btn btn-xs btn-danger" 														  uib-tooltip="Remove Link" 														  ng-hide="linkdata.uneditable" 														  ng-click="geekitemeditctrl.removeLink(link, this)" 														  ng-disabled="updating"> 													<i class="fi-minus"></i> 												</button> 											</td> 										</tr> 									</table>  									<div class="admintools" ng-show="addlink"> 										<input select-on-show 												 ng-show="addlink" 												 type="text" 												 ng-model="selecteditem" 												 placeholder="{{linkdata.title}} lookup" 												 uib-typeahead="item as (item.name + \' (\' + item.objectid + \')\') for item in geekitemeditctrl.searchItems( $viewValue, linkdata.lookup_subtype, linkdata.other_objecttype )" 												 typeahead-on-select="geekitemeditctrl.linkItem( $item, linkdata )" 												 typeahead-min-length="2" 												 typeahead-wait-ms="150" 												 class="form-control"> 										<i class="fi-refresh is-refreshing" ng-show="geekitemeditctrl.viewVars.searchLoading"></i> 									</div> 								</td> 							</tr> 						</table> 					</div> 				</div>  				<div class="panel"> 					<div class="panel-header panel-header-sm"> 						<h3 class=\'panel-title\'> 							Other 						</h3> 					</div> 					<div class="panel-body"> 						<table class="table table-bordered table-condensed"> 							<tr> 								<th style="width:30%"><strong>Type</strong></th> 								<th style="width:70%"><strong>Value</strong></th> 							</tr>  							<tr> 								<td> 									Subtype 								</td> 								<td> 									<table class="table table-hover table-condensed" style="margin: 0;"> 										<tr ng-repeat="subtype in geekitemeditctrl.geekitem.data.item.subtypes"> 											<td style="border: none;" width="80%"> 												{{subtype}} 											</td> 											<td style="border: none;" width="20%" align="right"> 												<div 													show-access="itemdel" 													access-objecttype="{{geekitemeditctrl.geekitemParams.objecttype}}" 													access-objectid="{{geekitemeditctrl.geekitemParams.objectid}}" 													> 													<a class="btn btn-xs btn-danger" 														ng-href="/geekitem.php?action=removesubtype&objecttype={{geekitemeditctrl.geekitemParams.objecttype}}&objectid={{geekitemeditctrl.geekitemParams.objectid}}&removesubtype={{subtype}}" 														uib-tooltip="Remove Subtype" 														ng-hide="geekitemeditctrl.subtypeUnremovable(subtype)" 														ng-disabled="updating"> 														<i class="fi-minus"></i> 													</a> 													<button class="btn btn-xs btn-warning" 															  uib-tooltip="You cannot remove the last subtype or any subtype derived from an existing linkage" 															  ng-show="geekitemeditctrl.subtypeUnremovable(subtype)" 															  > 														<i class="fi-minus"></i> 													</button> 												</div> 											</td> 										</tr> 									</table> 								</td> 							</tr> 						</table> 					</div> 				</div>  				<div class="panel" show-access="seedebug"> 					<div class="panel-header panel-header-sm"> 						<h3 class=\'panel-title\'> 							<a class="toggler-caret" ng-click="showRawLinks = !showRawLinks" ng-class="{ \'is-active\': showRawLinks }"> 								<span class="glyphicon glyphicon-menu-right"></span> 								Debug Links 							</a> 						</h3> 					</div> 					<div class="panel-body" ng-if="showRawLinks"> 						<table class="table table-bordered table-condensed"> 							<tr> 								<th><strong>Other object</strong></th> 								<th><strong>Linktype</strong></th> 								<th><strong>Self Prefix</strong></th> 								<th><strong>Tstamp</strong></th> 								<th><strong>linkid</strong></th> 								<th><strong>primary</strong></th> 								<th><strong>Action</strong></th> 							</tr> 							<tbody ng-repeat="links in geekitemeditctrl.geekitem.data.item.links"> 								<tr ng-repeat="link in links"> 									<td> 										<div>{{link.objecttype}}:{{link.objectid}}</div> 										<a ng-href="{{link.href}}">{{link.name}}</a> 									</td> 									<td> 										{{link.linktype}} 									</td> 									<td> 										{{link.direction}} 									</td> 									<td> 										{{link.gltstamp}} 									</td> 									<td> 										{{link.linkid}} 									</td> 									<td> 										<span ng-if="link.primarylink == 1"><i class="fi-check"></i></span> 									</td> 									<td> 										<button class="btn btn-xs btn-danger" 												  uib-tooltip="Remove Link" 												  ng-click="geekitemeditctrl.removeLink(link, this)" 												  ng-disabled="updating"> 											<i class="fi-minus"></i> 										</button> 									</td> 								</tr> 							</tbody> 						</table> 					</div> 				</div> 			</div> 		</div> 	</div>  ' );
