t.put( 'geekitem_tab_stats.tpl', ' <div class=\'global-body-content-primary\'> 	<div class=\'panel\'> 		<div class=\'panel-header panel-header-lg\'> 			<h3 class=\'panel-title\'> 				Stats 			</h3> 		</div> 		<div class=\'panel-body\'> 			<div class="row game-stats"> 				<div class=\'col-sm-6 col-sm-push-6\'> 					<div class=\'panel\'> 						<div class=\'panel-header panel-header-sm\'> 							<h3 class=\'panel-title\'> 								Ratings Breakdown 							</h3> 						</div> 						<div class=\'stats-graph\'> 							<ratings-stats-graph objecttype="{{geekitemctrl.geekitemParams.objecttype}}" 														objectid="{{geekitemctrl.geekitemParams.objectid}}" 														width="350" 														height="250" 														type="BarChart"> 							</ratings-stats-graph> 						</div> 					</div> 				</div> 				<div class="col-sm-3 col-sm-pull-6"> 					<div class=\'panel panel-condensed\'> 						<div class=\'panel-header panel-header-sm\'> 							<h3 class=\'panel-title\'> 								Game Stats 							</h3> 						</div> 						<div class=\'panel-body\'> 							<ul class=\'outline fs-responsive-sm outline-border-col-xs\'> 								<li class=\'outline-item\'> 									<div class=\'outline-item-title\'> 										Avg. Rating 									</div> 									<div class=\'outline-item-description\'> 										<a ui-sref="geekitem.ratings({comment:1})"> 											{{geekitemctrl.geekitem.data.item.stats.average|number:3}} 										</a> 									</div> 								</li> 								<li class=\'outline-item\'> 									<div class=\'outline-item-title\'> 										No. of Ratings 									</div> 									<div class=\'outline-item-description\'> 										<a ui-sref="geekitem.ratings({rated:1})">{{geekitemctrl.geekitem.data.item.stats.usersrated|number}}</a> 									</div> 								</li> 								<li class=\'outline-item\'> 									<div class=\'outline-item-title\'> 										Std. Deviation 									</div> 									<div class=\'outline-item-description\'> 										{{geekitemctrl.geekitem.data.item.stats.stddev|number:2}} 									</div> 								</li> 								<li class=\'outline-item\'> 									<div class=\'outline-item-title\'> 										Weight 									</div> 									<div class=\'outline-item-description\'> 										<a show-weight-graph ng-if="::geekitemctrl.geekitem.data.item.stats.avgweight > 0"> 											<span class="c-is-positive">{{::geekitemctrl.geekitem.data.item.stats.avgweight|number:2}}</span> / 5 										</a> 										<span ng-if="::geekitemctrl.geekitem.data.item.stats.avgweight <= 0"> 											N/A 										</span> 									</div> 								</li> 								<li class=\'outline-item\'> 									<div class=\'outline-item-title\'> 										Comments 									</div> 									<div class=\'outline-item-description\'> 										<a ui-sref="geekitem.ratings({comment:1})">{{geekitemctrl.geekitem.data.item.stats.numcomments|number}}</a> 									</div> 								</li> 								<li class=\'outline-item\'> 									<div class=\'outline-item-title\'> 										Fans 									</div> 									<div class=\'outline-item-description\'> 										<a href="/fans/{{geekitemctrl.geekitemParams.objecttype}}/{{geekitemctrl.geekitemParams.objectid}}">{{geekitemctrl.geekitem.data.item.stats.numfans|number}}</a> 									</div> 								</li> 								<!-- <li class=\'outline-item\'> 									<div class=\'outline-item-title\'> 										Subscribers 									</div> 									<div class=\'outline-item-description\'> 										{{geekitemctrl.geekitem.data.item.stats.numsubscribers|number}} 									</div> 								</li> --> 								<li class=\'outline-item\'> 									<div class=\'outline-item-title\'> 										Page Views 									</div> 									<div class=\'outline-item-description\'> 										{{geekitemctrl.geekitem.data.item.stats.views|number}} 									</div> 								</li> 							</ul> 						</div> 					</div> 					<div class=\'panel panel-condensed\'> 						<div class=\'panel-header panel-header-sm\'> 							<h3 class=\'panel-title\'> 								Game Ranks 							</h3> 						</div> 						<div class=\'panel-body\'> 							<ul class=\'outline fs-responsive-sm outline-border-col-xs\'> 								<li class=\'outline-item\' ng-if="(rankinfo.rank > 0) || rankinfo.rankobjecttype ===\'subtype\'" 									 ng-repeat="rankinfo in ::geekitemctrl.geekitem.data.item.rankinfo"> 									<div class=\'outline-item-title\'> 										{{::rankinfo.shortprettyname}} 									</div> 									<div class=\'outline-item-description\'> 										<a ng-if="::rankinfo.rank > 0" 											ng-href="{{::rankinfo.subdomain}}/browse/boardgame?sort=rank&rankobjecttype={{::rankinfo.rankobjecttype}}&rankobjectid={{::rankinfo.rankobjectid}}&rank={{::rankinfo.rank}}#{{::rankinfo.rank}}" 											class="rank-value"> 											{{::rankinfo.rank}} 										</a> 										<span ng-if="rankinfo.rank == 0">&dash;&dash;</span> 										<span ng-if="rankinfo.rank > 0" style="margin-left:5px;"> 											<a ui-sref="geekitem.statshistory({\'rankobjectid\':rankinfo.rankobjectid})" uib-tooltip="Historical Rank" ><i class="fas fa-chart-line"></i></a> 											<span class="sr-only text-white">Historical Rank</span> 										</span> 									</div> 								</li> 							</ul> 						</div> 					</div> 				</div> 				<div class="col-sm-3 col-sm-pull-6"> 					<div class=\'panel panel-condensed\'> 						<div class=\'panel-header panel-header-sm\'> 							<h3 class=\'panel-title\'> 								Play Stats 							</h3> 						</div> 						<div class=\'panel-body\'> 							<ul class=\'outline fs-responsive-sm outline-border-col-xs\'> 								<li class=\'outline-item\'> 									<div class=\'outline-item-title\'> 										All Time Plays 									</div> 									<div class=\'outline-item-description\'> 										<a ng-href="/playstats/{{geekitemctrl.geekitemParams.objecttype}}/{{geekitemctrl.geekitemParams.objectid}}">{{geekitemctrl.geekitem.data.item.stats.numplays|number}}</a> 									</div> 								</li> 								<li class=\'outline-item\'> 									<div class=\'outline-item-title\'> 										This Month 									</div> 									<div class=\'outline-item-description\'> 										<a ng-href="/playstats/{{geekitemctrl.geekitemParams.objecttype}}/{{geekitemctrl.geekitemParams.objectid}}/{{geekitemctrl.geekitem.data.item.stats.playmonth}}">{{geekitemctrl.geekitem.data.item.stats.numplays_month|number}}</a> 									</div> 								</li> 							</ul> 						</div> 					</div> 					<div class=\'panel panel-condensed\'> 						<div class=\'panel-header panel-header-sm\'> 							<h3 class=\'panel-title\'> 								Collection Stats 							</h3> 						</div> 						<div class=\'panel-body\'> 							<ul class=\'outline fs-responsive-sm outline-border-col-xs\'> 								<li class=\'outline-item\'> 									<div class=\'outline-item-title\'> 										Own 									</div> 									<div class=\'outline-item-description\'> 										<a ui-sref="geekitem.ratings({status:\'own\'})">{{geekitemctrl.geekitem.data.item.stats.numowned|number}}</a> 									</div> 								</li> 								<li class=\'outline-item\'> 									<div class=\'outline-item-title\'> 										Prev. Owned 									</div> 									<div class=\'outline-item-description\'> 										<a ui-sref="geekitem.ratings({status:\'prevowned\'})">{{geekitemctrl.geekitem.data.item.stats.numprevowned|number}}</a> 									</div> 								</li> 								<li class=\'outline-item\'> 									<div class=\'outline-item-title\'> 										For Trade 									</div> 									<div class=\'outline-item-description\'> 										<a ui-sref="geekitem.trading({status:\'fortrade\'})">{{geekitemctrl.geekitem.data.item.stats.numtrading|number}}</a> 										<a class=\'btn btn-xs outline-item-icon\' tooltip-append-to-body="true" uib-tooltip=\'Find Matches\' href="/trade/custom?action=customsearch&wants[]={{geekitemctrl.geekitemParams.objecttype}}:{{geekitemctrl.geekitemParams.objectid}}&B1=Search"> 											<i class=\'fi-torsos-female-male\'><span class="sr-only text-muted">Find For-Trade Matches</span></i> 										</a> 									</div> 								</li> 								<li class=\'outline-item\'> 									<div class=\'outline-item-title\'> 										Want In Trade 									</div> 									<div class=\'outline-item-description\'> 										<a ui-sref="geekitem.trading({status:\'want\'})">{{geekitemctrl.geekitem.data.item.stats.numwanting|number}}</a> 										<a class=\'btn btn-xs outline-item-icon\' tooltip-append-to-body="true" uib-tooltip=\'Find Matches\' href="/trade/custom?action=customsearch&trades[]={{geekitemctrl.geekitemParams.objecttype}}:{{geekitemctrl.geekitemParams.objectid}}&B1=Search"> 											<i class=\'fi-torsos-female-male\'><span class="sr-only text-muted">Find Want-in-Trade Matches</span></i> 										</a> 									</div> 								</li> 								<li class=\'outline-item\'> 									<div class=\'outline-item-title\'> 										Wishlist 									</div> 									<div class=\'outline-item-description\'> 										<a ui-sref="geekitem.ratings({status:\'wishlist\'})">{{geekitemctrl.geekitem.data.item.stats.numwish|number}}</a> 									</div> 								</li> 							</ul> 						</div> 					</div> 					<div class=\'panel panel-condensed\'> 						<div class=\'panel-header panel-header-sm\'> 							<h3 class=\'panel-title\'> 								Parts Exchange 							</h3> 						</div> 						<div class=\'panel-body\'> 							<ul class=\'outline fs-responsive-sm outline-border-col-xs\'> 								<li class=\'outline-item\'> 									<div class=\'outline-item-title\'> 										Has Parts 									</div> 									<div class=\'outline-item-description\'> 										<a ui-sref="geekitem.trading({status:\'hasparts\'})">{{geekitemctrl.geekitem.data.item.stats.numhasparts|number}}</a> 									</div> 								</li> 								<li class=\'outline-item\'> 									<div class=\'outline-item-title\'> 										Want Parts 									</div> 									<div class=\'outline-item-description\'> 										<a ui-sref="geekitem.trading({status:\'wantparts\'})">{{geekitemctrl.geekitem.data.item.stats.numwantparts|number}}</a> 									</div> 								</li> 							</ul> 						</div> 					</div> 				</div> 			</div> 		</div> 	</div> </div>  ' );
