t.put( 'geekitem_module_adminnotes.tpl', ' 	<div class=\'panel\'> 		<div class=\'panel-header panel-header-sm\'> 			<h3 class=\'panel-title\'> 				<a class="toggler-caret" 					ng-click="adminnotesctrl.$storage.collapseAdminNotes  = !adminnotesctrl.$storage.collapseAdminNotes" 					ng-class="{ \'is-active\': !adminnotesctrl.$storage.collapseAdminNotes }"> 					<span class="glyphicon glyphicon-menu-right"></span> 					Admin Notes ({{adminnotesctrl.notedata.data.notes.length}}) 				</a> 			</h3> 			<div class=\'panel-header-actions\'> 				<button 					add-note 					login-required 					class="btn btn-xs btn-subtle" 					ng-click="addnotectrl.popupAddNote( adminnotesctrl.note_params )"> 					<i class="fi-plus"></i> Add Note 				</button> 			</div> 		</div> 		<div class=\'panel-body\' uib-collapse="adminnotesctrl.$storage.collapseAdminNotes"> 			<div class=\'text-muted\' ng-if="adminnotesctrl.notedata.notes.length == 0"> 				No notes found. 			</div>  			<ul class=\'discussion\'> 				<li class=\'discussion-item\' ng-repeat="note in adminnotesctrl.notedata.data.notes"> 					<div class=\'row\'> 						<div class=\'discussion-item-meta col-sm-3\'> 							<div class=\'media\'> 								<div class=\'media-left\'> 									<avatar-md user="note.from_user"></avatar-md> 								</div> 								<div class=\'media-body\'> 									<a ng-href="/user/{{::note.from_user.username}}" class=\'discussion-item-user\'> 										{{::note.from_user.username}} 									</a> 									<span class=\'discussion-item-timestamp\' title="{{::note.tstamp|geekdatetime:\'calendar\'}}"> 										{{::note.tstamp|geekdatetime}} 									</span> 								</div> 							</div> 						</div> 						<div class=\'discussion-item-body col-sm-9\'> 							<div ng-if="note.to_user" class=\'quoteuser\'>{{::note.to_user.username}}</div> 							<div ng-bind-html="note.note_html"></div>  							<div class="discussion-item-actions" uib-dropdown> 								<button class=\'btn btn-empty\' uib-dropdown-toggle type=\'button\'> 									<span class=\'glyphicon glyphicon-option-vertical\'></span> 								</button>  								<ul uib-dropdown-menu aria-labelledby="simple-dropdown"> 									<li> 										<button type=\'button\' ng-href="" ng-click="adminnotesctrl.deleteNote(note)">Delete</button> 									</li> 									<li> 										<button type=\'button\' add-note 											ng-href="" 											ng-click="addnotectrl.popupAddNote( adminnotesctrl.note_params, note )">Quote and Ask User</button> 									</li> 								</ul> 							</div> 						</div> 					</div> 				</li> <!-- 				<li class=\'discussion-item\'> 					<div class=\'row\'> 						<div class=\'discussion-item-meta col-sm-3\'> 							<div class=\'media\'> 								<div class=\'media-left\'> 									<a href> 										<div class="avatar avatar-md avatar-default"> 											<i class="fi-torso"></i> 										</div> 									</a> 								</div> 								<div class=\'media-body\'> 									<a href class=\'discussion-item-user\'> 										fixie 									</a> 								</div> 							</div> 						</div> 						<div class=\'discussion-item-body col-sm-9\'> 							<div class=\'form-group form-group-condensed\'> 								<textarea name="note" id="note" class=\'form-control\' placeholder="Your admin note" ng-model="newnote.adminnote"></textarea> 							</div> 							<button type=\'submit\' class=\'btn btn-sm btn-primary\'> 								Send Message 							</button> 						</div> 					</div> 				</li> --> 			</ul>  			<div class="panel-cta" ng-if="adminnotesctrl.notedata.data.notes.length > 0"> 				<div uib-pagination 					template-url="geekitem_pagination.tpl" 					total-items="adminnotesctrl.data.config.numitems" 					ng-model="adminnotesctrl.params.pageid" 					ng-change="adminnotesctrl.pageChanged()" 					items-per-page="adminnotesctrl.params.showcount" 					max-size="5" 					boundary-links="true"> 				</div> 			</div> 		</div> 	</div>  ' );
t.put( 'geekitem_module_awards.tpl', ' 	<div class="panel panel-top game-awards panel-condensed" ng-if=\'awardsctrl.honors.length\'> 		<div class=\'panel-header panel-header-sm\'> 			<div class=\'panel-title\'> 				Awards & Honors 			</div> 		</div> 		<div class=\'panel-body\'> 			<div class=\'panel-expandable\' gk-expandable-geekitem="awards" expandable-height="100px"> 				<ul class=\'list-unstyled\'> 					<li ng-repeat="link in ::awardsctrl.honors | orderBy:\'$index\':true"> 						<a ng-href="{{::link.href}}">{{::link.name}}</a> 					</li> 				</ul> 			</div> 		</div> 	</div>  ' );
t.put( 'geekitem_module_blogs.tpl', ' 	<div class=\'panel\' ng-class="{ \'is-loading\': !blogctrl.loaded }"> 		<div class=\'panel-header\' ng-class="{ \'panel-header-lg\': !blogctrl.nopager }"> 			<h3 class=\'panel-title\'> 				{{blogctrl.moduletitle}} 			</h3> 			<div class=\'panel-header-actions hidden-xs\' ng-if="!blogctrl.nopager"> 				<sort-options sort="blogctrl.setParam(\'sort\',sortvalue)" params="blogctrl.params"></sort-options> 			</div> 		</div> 		<div class=\'panel-body\' 			  cg-busy="{ promise:blogctrl.loader, 							 templateUrl:\'geekitem_loadinginline.tpl\', 							 backdrop:false }">  			 <div class=\'panel-body-toolbar\'>  				<div class=\'panel-body-toolbar-actions\'>  					<div uib-pagination  						template-url="geekitem_pagination_mini.tpl"  						total-items="blogctrl.data.config.numitems"  						ng-model="blogctrl.params.pageid"  						ng-change="blogctrl.pageChanged()"  						items-per-page="blogctrl.params.showcount">  					</div>  				</div>  				<span class=\'panel-body-toolbar-count\'>  					<showing-range showcount="blogctrl.params.showcount"  										pageid="blogctrl.params.pageid"  										firstload="blogctrl.firstload"  										numitems="blogctrl.data.config.numitems"></showing-range>  				</span>  			</div> 			<div class=\'text-muted\' ng-if="blogctrl.firstload && !blogctrl.data.posts || blogctrl.data.posts.length == 0"> 				No posts found. 			</div> 			<ul class=\'summary summary-callout summary-callout-lg summary-callout-responsive summary-condensed summary-border\'> 				<li class=\'summary-item\' ng-repeat="post in blogctrl.data.posts"> 					<div class=\'summary-item-callout\'> 						<a ng-href="/blogpost/{{post.postid}}" 							title="{{::post.numpositive}} thumbs & {{::post.numcomments}} comments" 							class="summary-item-counts summary-item-counts-fixed-width"> 							<span class="summary-item-counts-item"> 								<i class=\'fi-like\'></i> 								{{::post.numpositive | humanize}} 							</span> 							<span class="summary-item-counts-item"> 								<span class=\'glyphicon glyphicon-comment\'></span> 								{{::post.numcomments | humanize}} 							</span> 						</a> 					</div>  					<div class=\'summary-item-title\'> 						<a ng-href="/blogpost/{{post.postid}}">{{post.title}}</a> 					</div> 					<div class=\'summary-item-meta\'> 						<span ng-bind-html="post.blogger|to_trusted"></span> 						&middot; 						<a ng-href="/blogpost/{{post.postid}}" 							title="{{post.publishdate | geekdatetime:\'calendar\'}}"> 							{{post.publishdate|geekdatetime}} 						</a> 					</div> 				</li> 			</ul> 			<div class="panel-cta"> 				<div class=\'panel-inline-links\' ng-if="blogctrl.showfooter && blogctrl.geekitem.loaded"> 					<a ui-sref="geekitem.mentions.news"> 						See All ({{blogctrl.geekitem.data.item.relatedcounts.news}}) 					</a> 				</div>  				<div uib-pagination 					ng-if="!blogctrl.nopager && blogctrl.firstload" 					template-url="geekitem_pagination.tpl" 					class="pagination-sm" 					total-items="blogctrl.data.config.numitems" 					ng-model="blogctrl.params.pageid" 					ng-change="blogctrl.pageChanged()" 					items-per-page="blogctrl.params.showcount" 					boundary-links="true" 					max-size="5"> 				</div> 				<div class=\'panel-cta-secondary\'> 					<span class=\'panel-cta-secondary-action\'> 						<showcount-selector 							showcount=\'blogctrl.params.showcount\' 							options=\'blogctrl.showcountOptions\' 							setter=\'blogctrl.setParam\'> 						</showcount-selector> 					</span> 				</div> 			</div> 		</div> 	</div>  ' );
t.put( 'geekitem_module_classifications.tpl', ' <a name=\'classifications\'> <div class=\'panel panel-bottom game-classification\' ng-if="geekitemctrl.geekitem.loaded"> 	<div class="panel-header panel-header-sm panel-header-condensed"> 		<h3 class="panel-title"> 			Classification 			&nbsp; 			<a ng-href="/item/correction/boardgame/{{geekitemctrl.geekitemParams.objectid}}"> 				<i class=\'fi-pencil c-icon\'></i> <span class=\'sr-only\'>Edit</span> 			</a> 		</h3> 	</div>  	<div class=\'panel-body\'> 		<ul class=\'features\'> 			<li class=\'feature\'> 				<div class=\'feature-title\'> 					Type 				</div> 				<div class=\'feature-description\'> 					<span ng-repeat="subdomain in geekitemctrl.geekitem.data.item.links.boardgamesubdomain"> 						<a ng-href="{{subdomain.href}}">{{subdomain.name|stripGames}}</a><span ng-if="!$last">,&nbsp;</span> 					</span> 					<span ng-if="!geekitemctrl.geekitem.data.item.links.boardgamesubdomain.length"> 						Uncategorized 					</span> 					<button type=\'button\' 						class=\'btn btn-xs btn-empty feature-action-icon\' 						uib-tooltip="View poll and results" 						tooltip-popup-delay=\'500\' 						tooltip-append-to-body=\'true\' 						item-poll-button="boardgamesubdomain" poll-view="results"> 						<span class=\'glyphicon glyphicon-stats\'></span> 						<span class="sr-only text-muted">View poll and results</span> 					</button> 				</div> 			</li>  			<li class=\'feature\'> 				<div class=\'feature-title\'> 					Category 				</div> 				<div class=\'feature-description\'> 					<popup-list items="geekitemctrl.geekitem.data.item.links.boardgamecategory" 									numitems="geekitemctrl.geekitem.data.item.linkcounts.boardgamecategory" 									sref="geekitem.credits({\'#\':boardgamecategory})" 									loaded="geekitemctrl.geekitem.loaded" 									action="geekitemctrl.showFullCredits" 									showcount=5> 					</popup-list> 				</div> 			</li> 			<li class=\'feature\'> 				<div class=\'feature-title\'> 					Mechanisms 				</div> 				<div class=\'feature-description\'> 					<popup-list items="::geekitemctrl.geekitem.data.item.links.boardgamemechanic" 									numitems="::geekitemctrl.geekitem.data.item.linkcounts.boardgamemechanic" 									sref="geekitem.credits({\'#\':boardgamemechanic})" 									loaded="geekitemctrl.geekitem.loaded" 									action="::geekitemctrl.showFullCredits" 									showcount=5></popup-list> 				</div> 			</li> 			<li class=\'feature\'> 				<div class=\'feature-title\'> 					Family 				</div> 				<div class=\'feature-description\'> 					<popup-list items="geekitemctrl.geekitem.data.item.links.boardgamefamily" 									numitems="geekitemctrl.geekitem.data.item.linkcounts.boardgamefamily" 									sref="geekitem.credits({\'#\':boardgamefamily})" 									loaded="geekitemctrl.geekitem.loaded" 									action="geekitemctrl.showFullCredits" 									showcount=10> 					</popup-list> 				</div> 			</li> 			<li class=\'feature\' ng-if="geekitemctrl.geekitem.data.item.linkcounts.reimplementation > 0"> 				<div class=\'feature-title\'> 					Reimplemented By 				</div> 				<div class=\'feature-description\'> 					<popup-list items="::geekitemctrl.geekitem.data.item.links.reimplementation" 									numitems="::geekitemctrl.geekitem.data.item.linkcounts.reimplementation" 									sref="geekitem.linkeditems.reimplementation" 									loaded="geekitemctrl.geekitem.loaded" 									action="::geekitemctrl.showFullCredits" 									showcount=4></popup-list>  				</div> 			</li>  			<li class=\'feature\' ng-if="geekitemctrl.geekitem.data.item.linkcounts.reimplements > 0"> 				<div class=\'feature-title\'> 					Reimplements 				</div> 				<div class=\'feature-description\'> 					<popup-list items="::geekitemctrl.geekitem.data.item.links.reimplements" 									numitems="::geekitemctrl.geekitem.data.item.linkcounts.reimplements" 									sref="geekitem.linkeditems.reimplements" 									index="reimplements" 									loaded="geekitemctrl.geekitem.loaded" 									action="::geekitemctrl.showFullCredits" 									showcount=4></popup-list>  				</div> 			</li> 			<li class=\'feature\' ng-if="geekitemctrl.geekitem.data.item.linkcounts.boardgameintegration > 0"> 				<div class=\'feature-title\'> 					Integrates With 				</div> 				<div class=\'feature-description\'> 					<popup-list items="::geekitemctrl.geekitem.data.item.links.boardgameintegration" 									numitems="::geekitemctrl.geekitem.data.item.linkcounts.boardgameintegration" 									sref="geekitem.linkeditems.boardgameintegration" 									loaded="geekitemctrl.geekitem.loaded" 									action="::geekitemctrl.showFullCredits" 									showcount=4></popup-list>  				</div> 			</li>  			<li class=\'feature\' ng-if="geekitemctrl.geekitem.data.item.linkcounts.contains > 0"> 				<div class=\'feature-title\'> 					Contains 				</div> 				<div class=\'feature-description\'> 					<popup-list items="::geekitemctrl.geekitem.data.item.links.contains" 									numitems="::geekitemctrl.geekitem.data.item.linkcounts.contains" 									sref="geekitem.linkeditems.contains" 									loaded="geekitemctrl.geekitem.loaded" 									action="::geekitemctrl.showFullCredits" 									showcount=4></popup-list> 				</div> 			</li>  			<li class=\'feature\' ng-if="geekitemctrl.geekitem.data.item.subtype == \'boardgameexpansion\'"> 				<a name=\'classifications-expansion-for\'></a> 				<div class=\'feature-title\'> 					Expansion For 				</div> 				<div class=\'feature-description\'> 					<div ng-repeat="expands in geekitemctrl.geekitem.data.item.links.expandsboardgame"> 						<a ng-href="{{expands.href}}">{{expands.name}}</a><span ng-if="!$last">, </span> 					</div> 				</div> 			</li> 		</ul> 	</div> </div>  ' );
t.put( 'geekitem_module_collection.tpl', ' 	<div class=\'panel\'> 		<a name="mygames"></a> 		<div class=\'panel-header panel-header-lg\'> 			<h3 class=\'panel-title\'> 				My Collection 			</h3> 			<div class=\'panel-header-actions\'> 				<a class=\'btn btn-sm btn-primary\' ng-href="" add-to-collection-button 				   additem="{ \'objecttype\':collectionctrl.item.objecttype, 				              \'objectid\':collectionctrl.item.objectid, 				              \'versionid\':collectionctrl.item.versionid}"> 					<i class=\'fi-plus\'></i> 					<span class=\'hidden-xs\'> 						<span ng-show=\'collectionctrl.collection.items.length == 0\'> 							Add To 						</span> 						<span ng-show=\'collectionctrl.collection.items.length > 0\'> 							Add Another Copy 						</span> 					</span> 				</a> 			</div> 		</div> 		<div class=\'panel-body\' ng-if=\'collectionctrl.collection.items.length == 0\'> 			<div class=\'text-muted\' ng-hide=\'loading\'> 				{{collectionctrl.geekitem.data.item.name}} is currently not in your collections. 			</div> 		</div> 		<div class=\'panel-body\' ng-if=\'collectionctrl.collection.items.length > 0\'> 			<ul class=\'summary summary-collection summary-border\'> 				<li class=\'summary-item\' ng-repeat="item in collectionctrl.collection.items"> 					<div class=\'media-left summary-item-thumbnail summary-item-thumbnail-micro\' ng-if="::item.images"> 						<a ng-href="{{::item.href}}"> 							<img class=\'media-object\' alt=\'{{::item.objectname}} box cover\' ng-src="{{::item.images.micro}}"> 						</a> 					</div> 					<div class=\'media-body\'> 						<button class=\'pull-right btn btn-subtle btn-xs\' 								  add-to-collection-button 								  login-required 								  additem="{ collid: item.collid }"> 							<i class=\'fi-pencil\'></i> Edit 						</button>  						<div class="pull-left rating-angular rating-lg has-rating-{{::item.rating | ratingColor}}" ng-show="item.rating != \'0.0\'"> 							{{::item.rating}} 						</div>  						<div class=\'summary-item-title\'> 							<collection-item-name item="item"></collection-item-name> 						</div>  						<div class=\'summary-item-description\' ng-if="::item.textfield.comment.rendered"> 							<div class=\'summary-collection-comment\'> 								<span ng-bind-html="::item.textfield.comment.rendered|to_trusted"></span> 							</div> 						</div>  						<div class=\'summary-item-meta\'> 							<name-with-year name="item.version.versionname" year="item.version.yearpublished"></name-with-year> 							<span ng-show="item.version && item.status"> 								&middot; 							</span> 							<span ng-if="item.status"> 								<span ng-repeat-start="status in ::collectionctrl.collection.config.allstatuses|orderBy: \'priority\'" ng-if-start="::item.status[status.key]"> 									{{::status.name}}</span><span ng-if-end class="separator" ng-repeat-end>, 								</span> 								&middot; 							</span>  							<span class=\'text-muted text-normal\' title="{{::item.postdate|geekdatetime:\'calendar\'}}"> 								{{item.postdate|geekdatetime}} 							</span>  							<div class=\'summary-item-meta-secondary\'> 								<span ng-if="::item.lastmodified"> 									<span ng-if="::item.comment_tstamp != \'0000-00-00 00:00:00\' && item.comment_tstamp != item.lastmodified"  title="::item.comment_tstamp|geekdatetime:\'calendar\'"> 										Comment modified:	{{item.comment_tstamp|geekdatetime}} 									</span> 									<span ng-if="::item.rating_tstamp != \'0000-00-00 00:00:00\' && item.rating_tstamp != item.lastmodified" title="::item.rating_tstamp|geekdatetime:\'calendar\'"> 										Rating modified: {{item.rating_tstamp|geekdatetime}} 									</span> 								</span> 							</div> 						</div>  						<div class=\'summary-collection-groups\'> 							<collection-private-data item="item"></collection-private-data> 							<div class=\'summary-collection-group\' ng-if=\'item.textfield.conditiontext.value || item.textfield.wantpartslist.value || item.textfield.haspartslist.value\'> 								<div class=\'summary-collection-group-header\'> 									Trade Information 								</div> 								<div class=\'summary-collection-group-body\'> 									<ul class=\'outline outline-col-xs-block outline-condensed fs-xs\'> 										<li class=\'outline-item\' ng-if="item.textfield.conditiontext.value"> 											<div class=\'outline-item-title\'> 												Condition 											</div> 											<div class="outline-item-description"> 												<span ng-bind-html="item.textfield.conditiontext.rendered|to_trusted"></span> 											</div> 										</li> 										<li class=\'outline-item\' ng-if="item.textfield.wantpartslist.value"> 											<div class=\'outline-item-title\'> 												Wants Parts 											</div> 											<div class="outline-item-description"> 												<span ng-bind-html="item.textfield.wantpartslist.rendered|to_trusted"></span> 											</div> 										</li> 										<li class=\'outline-item\' ng-if="item.textfield.haspartslist.value"> 											<div class=\'outline-item-title\'> 												Has Parts 											</div> 											<div class="outline-item-description"> 												<span ng-bind-html="item.textfield.haspartslist.rendered|to_trusted"></span> 											</div> 										</li> 									</ul> 								</div> 							</div> 							<div class=\'summary-collection-group\' ng-if=\'item.status.wishlist || item.textfield.wishlistcomment.value\'> 								<div class=\'summary-collection-group-header\'> 									Wishlist 								</div> 								<div class=\'summary-collection-group-body\'> 									<ul class=\'outline fs-responsive-xs outline-col-xs-block outline-condensed\'> 										<li class=\'outline-item\' ng-if=\'item.status.wishlist && item.wishlistpriority\'> 											<div class=\'outline-item-title\'> 												Priority 											</div> 											<div class="outline-item-description"> 												{{collectionctrl.collection.config.wishlistoptions | fieldFromArrayById : \'priority\' : item.wishlistpriority : \'name\'}} 											</div> 										</li> 										<li class=\'outline-item\' ng-if=\'item.textfield.wishlistcomment.value\'> 											<div class=\'outline-item-title\'> 												Comment 											</div> 											<div class="outline-item-description"> 												<span ng-bind-html="::item.textfield.wishlistcomment.rendered|to_trusted"></span> 											</div> 										</li> 									</ul> 								</div> 							</div> 						</div> 					</div> 				</li> 			</ul> 		</div> 	</div>  ' );
t.put( 'geekitem_module_credits.tpl', ' <div class=\'credits\'> 	<ul> 		<li ng-if="geekitemctrl.geekitem.data.item.secondarynamescount"> 			<strong>Alternate Names</strong> 			<span ng-repeat="name in geekitemctrl.geekitem.data.item.secondarynames |limitTo:5"> 				<a ui-sref="geekitem.overview" ng-href="{{geekitemctrl.geekitem.data.item.href|to_trusted}}"> 					{{name.name}}<span ng-if="!$last">, </span> 				</a> 			</span> 			<a ui-sref="geekitem.credits({\'#\':\'alternatename\'})" ng-show="geekitemctrl.geekitem.data.item.alternatenamescount > geekitemctrl.geekitem.data.item.secondarynamescount">+ {{geekitemctrl.geekitem.data.item.alternatenamescount - geekitemctrl.geekitem.data.item.secondarynamescount}} more</a> 		</li> 		<li> 			<strong>Designer</strong> 			<popup-list items="geekitemctrl.geekitem.data.item.links.boardgamedesigner" 							numitems="geekitemctrl.geekitem.data.item.linkcounts.boardgamedesigner" 							sref="geekitem.credits({\'#\':boardgamedesigner})" 							itemsinline="true" 							loaded="geekitemctrl.geekitem.loaded" 							action="geekitemctrl.showFullCredits" 							showcount=4></popup-list> 		</li> 		<li> 			<strong>Artist</strong> 			<popup-list items="geekitemctrl.geekitem.data.item.links.boardgameartist" 							numitems="geekitemctrl.geekitem.data.item.linkcounts.boardgameartist" 							sref="geekitem.credits({\'#\':boardgameartist})" 							itemsinline="true" 							loaded="geekitemctrl.geekitem.loaded" 							action="geekitemctrl.showFullCredits" 							showcount=4></popup-list> 		</li> 		<li> 			<strong>Publisher</strong> 			<popup-list items="geekitemctrl.geekitem.data.item.links.boardgamepublisher" 							numitems="geekitemctrl.geekitem.data.item.linkcounts.boardgamepublisher" 							sref="geekitem.credits({\'#\':boardgamepublisher})" 							itemsinline="true" 							loaded="geekitemctrl.geekitem.loaded" 							action="geekitemctrl.showFullCredits" 							showcount=4></popup-list> 		</li> 	</ul> 	<div class=\'credits-cta\' ng-if="geekitemctrl.geekitem.loaded"> 		<a ui-sref="geekitem.credits"> 			See Full Credits 		</a> 	</div> </div>  ' );
t.put( 'geekitem_module_description.tpl', ' <div class="panel panel-top panel-condensed"> 	<div class=\'panel-header panel-header-lg\'> 		<h3 class=\'panel-title\'> 			Description 		</h3> 		<div class=\'panel-header-actions\'> 			<a href="/wiki/edit/{{geekitemctrl.geekitemParams.objecttype}}:{{geekitemctrl.geekitemParams.objectid}}" class="btn btn-xs btn-subtle"> 				<i class="fi-pencil"></i> Edit 			</a> 		</div> 	</div> 	<div class=\'panel-body\'> 		<div class=\'game-description-with-ad\'> 			<div class=\'game-description-classification well\' ng-if="geekitemctrl.showclassifications"> 				<classifications-module geekitem="geekitemctrl.geekitem"></classifications-module> 			</div>  			<div ng-if="geekitemctrl.showads" 			     class="game-description-ad" 				  hide-ad-block="blockrectangle" 				  ng-class="{ \'game-description-ad-wide\': geekitemctrl.geekitem.data.item.versioninfo.kickstarter_widget_url && geekitemctrl.geekitem.data.item.versioninfo.premiumkickstarter}">  				<kickstarter-module geekitem="geekitemctrl.geekitem"></kickstarter-module> 				<shopify-module geekitem="geekitemctrl.geekitem"></shopify-module>  				<div class=\'hidden-xs advertisement-amazon-banner\' 					  ng-if="!geekitemctrl.geekitem.data.item.versioninfo.kickstarter_widget_url && !geekitemctrl.geekitem.data.item.versioninfo.premiumkickstarter"> 					<amazonad objecttype="geekitemctrl.geekitemParams.objecttype" 								 objectid="geekitemctrl.geekitemParams.objectid"> 					</amazonad> 					<div class=\'advertisement-text-footer\'> 						Advertisement 					</div> 				</div> 			</div>  			<div class=\'game-description\'> 				<div ng-if="geekitemctrl.expandabledescription" 				     class=\'panel panel-condensed panel-expandable\' 				     gk-expandable-geekitem="description" 				     expandable-height="{{ geekitemctrl.linkshowcount == 0 ? \'350px\' : \'300px\' }}"> 					<article class=\'game-description-body\'> 						<div ng-bind-html="geekitemctrl.wikitext|to_trusted"></div> 					</article> 				</div>  				<div ng-if="!geekitemctrl.expandabledescription"> 					<article class=\'game-description-body\'> 						<div ng-bind-html="geekitemctrl.wikitext|to_trusted"></div> 					</article> 				</div>  				<awards-module ng-if="geekitemctrl.showawards" 				               linkshowcount="{{geekitemctrl.linkshowcount}}"></awards-module>  				<official-links-module ng-if="geekitemctrl.showofficiallinks" 				                       geekitem="geekitemctrl.geekitem"></official-links-module>  				<div class=\'row col-xl-middle-border fs-responsive-sm\' ng-if="geekitemctrl.showsuggestions"> 					<div class=\'col-sm-6 col-xl-5\'>  						<div class=\'panel panel-condensed\'> 						  <div class="panel-header panel-header-sm panel-header-condensed"> 							 <h3 class="panel-title">Additional Suggestions</h3> 						  </div> 						  <ul class=\'features\'> 							 <li class=\'feature\'> 								<div class=\'feature-title\'> 								  Language Dependence 								  <a class=\'btn btn-empty\' href="wiki/page/language-independent" 									 uib-tooltip="How language-dependent components (aside from the rules) are for those who do not speak the game published language." 									 tooltip-append-to-body="true" 									 tooltip-class="tooltip-lg"><span class=\'glyphicon glyphicon-question-sign\'></span> 									 <span class="sr-only">Learn more about language dependence</span> 								  </a> 								</div> 								<div class=\'feature-description\'> 										<span item-poll-button="languagedependence" poll-view="results"> 										  <span ng-bind-html="geekitemctrl.geekitem.data.item.polls.languagedependence|to_trusted"></span> 										  <button type=\'button\' class=\'btn btn-xs btn-empty feature-action-icon\' uib-tooltip="View poll and results" tooltip-popup-delay=\'500\' tooltip-append-to-body> 											 <span class=\'glyphicon glyphicon-stats\'></span> 											 <span class="sr-only text-muted">View poll and results</span> 										  </button> 										</span> 								</div> 							 </li> 						  </ul> 						</div>  					</div> 					<div class=\'col-sm-6 col-xl-7\'> 						<stats-module geekitem="geekitemctrl.geekitem"></stats-module> 						<div class=\'game-itemid\'> 							BGG Item ID: {{geekitemctrl.geekitemParams.objectid}} 						</div> 					</div> 				</div>  			</div> 		</div> 	</div> </div>  ' );
t.put( 'geekitem_module_ebay_full.tpl', ' 	<div class=\'panel panel-bottom\'> 		<div class=\'panel-header panel-header-lg\'> 			<h3 class=\'panel-title\'> 				<img src=\'//cf.geekdo-static.com/images/ebaylogo50x23.png\' alt=\'eBay\'> 			</h3> 			<div class=\'panel-header-actions\'> 				<item-sort-dropdown 					sortdata="ebayctrl.config.sortdata" 					sort="ebayctrl.params.sort" 					set-param="ebayctrl.setParam"> 				</item-sort-dropdown>  				<a class=\'btn btn-primary btn-sm\' 					ng-href=\'/geekbay/searchitem/{{ebayctrl.geekitemParams.objecttype}}/{{ebayctrl.geekitemParams.objectid}}\'> 					<i class=\'fi-plus\'></i> Add 				</a> 			</div> 		</div> 		<div class=\'panel-body\'> 			<div class=\'panel-body-toolbar\'> 			  <div class=\'panel-body-toolbar-actions\'> 				  <div uib-pagination 					  template-url="geekitem_pagination_mini.tpl" 					  total-items="ebayctrl.data.config.numitems" 					  ng-model="ebayctrl.params.pageid" 					  ng-change="ebayctrl.pageChanged()" 					  items-per-page="ebayctrl.params.showcount"> 				  </div> 			  </div> 			  <span class=\'panel-body-toolbar-count\'> 				  <showing-range showcount="ebayctrl.params.showcount" 									  pageid="ebayctrl.params.pageid" 									  firstload="ebayctrl.firstload" 									  numitems="ebayctrl.data.config.numitems"></showing-range> 			  </span> 		  	</div> 			<div class=\'text-muted\' ng-if="ebayctrl.data.config.numitems == 0"> 				No listings found. 			</div> 			<div class=\'tab-pane active\' id=\'game-ebay-time\'> 				<ul class=\'summary summary-condensed summary-callout summary-callout-lg summary-border summary-ebay\'> 					<li class=\'summary-item summary-ebay-item fs-sm\' ng-repeat="item in ebayctrl.data.items"> 						<div class=\'summary-item-callout\'> 							<a ng-href="/geekbay/link/{{::item.itemid}}/{{::item.auctionid}}" 								ng-class="::{\'c-red-300\':isLastDay(item.endtime)}" 								uib-tooltip="Ending soon" 								tooltip-append-to-body="true" 								tooltip-enable="isLastDay(item.endtime)" 								target=\'_blank\'> 								<strong>{{::item.currencysymbol}}{{::item.currentprice|number:0}}</strong> 							</a> 						</div> 						<div class=\'summary-item-title\'> 							<a ng-href="/geekbay/link/{{::item.itemid}}/{{::item.auctionid}}" title="Time left: {{::item.timeleft}}" target=\'_blank\'> 								{{::item.title | characters: 65}} 							</a> 							<span class="pull-right text-normal fs-xs">{{::item.timeleft}}</span> 						</div> 					</li> 				</ul> 			</div> 			<div class="panel-cta" ng-if="ebayctrl.data.items.length > 0"> 				<div uib-pagination 					template-url="geekitem_pagination.tpl" 					total-items="ebayctrl.data.config.numitems" 					ng-model="ebayctrl.params.pageid" 					ng-change="ebayctrl.pageChanged()" 					items-per-page="ebayctrl.params.showcount" 					max-size="5" 					boundary-links="true"> 				</div> 			</div> 		</div> 	</div>  ' );
t.put( 'geekitem_module_ebay_overview.tpl', ' 	<div class=\'panel panel-bottom\'> 		<div class=\'panel-header panel-header-sm panel-header-condensed\'> 			<h3 class=\'panel-title\'> 				<img src=\'//cf.geekdo-static.com/images/ebaylogo50x23.png\' style=\'height: 19px;\' alt=\'eBay\' title="eBay Buy It Now"> 				- Buy It Now 			</h3> 		</div> 		<div class=\'panel-body\'> 			<div class=\'text-muted\' ng-if="ebayctrl.data.config.numitems == 0"> 				No listings found. 			</div> 			<div id=\'game-ebay-time\'> 				<ul class=\'summary summary-condensed summary-border summary-sale\'> 					<li class=\'summary-item summary-sale-item\' ng-repeat="item in ebayctrl.data.items"> 						<a ng-href="/geekbay/link/{{::item.itemid}}/{{::item.auctionid}}" title="{{ ::item.title }} | Time left: {{::item.timeleft}}" target=\'_blank\'> 							<div class=\'summary-sale-item-price\'> 								<strong>{{::item.currencysymbol}}{{::item.currentprice|number:0}}</strong> 							</div> 							<div class=\'summary-item-title bottom\'> 								{{::item.title | characters: 35}} 							</div> 						</a> 					</li> 				</ul> 			</div> 		</div>  		<div class=\'panel-inline-links\'> 			<a class=\'btn btn-xs btn-default\' ui-sref="geekitem.marketplace.ebay" ng-if="ebayctrl.loaded && ebayctrl.data.config.numitems > 0"> 				See All ({{ebayctrl.data.config.numitems | number}}) 			</a> 		</div> 	</div>  ' );
t.put( 'geekitem_module_expansions.tpl', ' 	<div class=\'panel\' ng-class="{ \'is-loading\': !linkeditemctrl.loaded }"> 		<div class=\'panel-header panel-header-lg\'> 			<h2 class=\'panel-title\'>{{linkeditemctrl.moduletitle}}</h2> 			<div class=\'panel-header-actions\'> 				<item-sort-dropdown sortdata="linkeditemctrl.data.config.sortdata" sort="linkeditemctrl.params.sort" set-param="linkeditemctrl.setParam"></item-sort-dropdown> 				<a class=\'btn btn-primary btn-sm\' 					ng-href=\'/item/create/boardgameexpansion?src_objecttype={{linkeditemctrl.geekitemParams.objecttype}}&src_objectid={{linkeditemctrl.geekitemParams.objectid}}\'> 					<i class=\'fi-plus\'></i><span class=\'hidden-xs\'> Add</span> 				</a> 			</div> 		</div> 		<div class=\'panel-body\'> 			<div class="panel-body-toolbar"> 				<div class=\'panel-body-toolbar-actions\'> 					<div uib-pagination 						template-url="geekitem_pagination_mini.tpl" 						total-items="linkeditemctrl.data.config.numitems" 						ng-model="linkeditemctrl.params.pageid" 						ng-change="linkeditemctrl.pageChanged()" 						items-per-page="linkeditemctrl.params.showcount"> 					</div> 				</div>  				<div class=\'panel-body-toolbar-count\'> 					<showing-range showcount="linkeditemctrl.params.showcount" 										pageid="linkeditemctrl.params.pageid" 										firstload="linkeditemctrl.firstload" 										numitems="linkeditemctrl.data.config.numitems"></showing-range> 				</div> 			</div> 			<div class=\'text-muted\' ng-if="linkeditemctrl.data.items.length == 0"> 				No items found. 			</div>  			<ul class=\'summary summary-border\'> 				<linked-items-module-row item="item" ng-repeat="item in linkeditemctrl.data.items"></linked-items-module-row> 			</ul>  			<div class="panel-cta" ng-if="linkeditemctrl.firstload"> 				<div uib-pagination 					template-url="geekitem_pagination.tpl" 					total-items="linkeditemctrl.data.config.numitems" 					ng-model="linkeditemctrl.params.pageid" 					ng-change="linkeditemctrl.pageChanged()" 					items-per-page="linkeditemctrl.showcount" 					max-size="5" 					boundary-links="true"> 				</div> 				<div class=\'panel-cta-secondary\'> 					<span class=\'panel-cta-secondary-action\'> 						<showcount-selector  							showcount=\'linkeditemctrl.params.showcount\'  							options=\'linkeditemctrl.showcountOptions\'  							setter=\'linkeditemctrl.setParam\'> 						</showcount-selector> 					</span> 				</div> 			</div> 		</div> 	</div>  ' );
t.put( 'geekitem_module_files.tpl', ' <a name="files"></a> <div class=\'panel\'> 	<div class=\'panel-header panel-header-lg\'> 		<h3 class=\'panel-title\'> 			<a ui-sref="geekitem.files">Files</a> 		</h3> 		<div class=\'panel-header-actions\'>  			<sort-options sort="filectrl.setParam(\'sort\', sortvalue)" params="filectrl.params"></sort-options>  			<persistent-selector callback="filectrl.setParam" key="languageid" value="filectrl.params.languageid" template-url="languageSelector.html" options="filectrl.data.config.languages" default="0"></persistent-selector>  			<a class=\'btn btn-sm btn-primary\' 				ng-href=\'/file/new/{{::filectrl.geekitemParams.objecttype}}/{{::filectrl.geekitemParams.objectid}}\'> 				<i class=\'fi-plus\'></i><span class=\'hidden-xs\'> Upload</span> 			</a> 		</div> 	</div> 	<div class=\'panel-body\' 		  cg-busy="{ promise:filectrl.loader, 						 templateUrl:\'geekitem_loadinginline.tpl\', 						 backdrop:false }">  		<div class=\'panel-body-toolbar\' ng-if="filectrl.data.config.numitems > 0"> 			<div class=\'panel-body-toolbar-actions\'> 				<persistent-selector 					default="comfortable" 					template-url="densitySelectorButtonGroup.html" 					key="{{filectrl.densitykey}}" 					value="filectrl.density"> 				</persistent-selector> 				<span ng-if=\'filectrl.data.config.numitems > filectrl.params.showcount\'> 					<span class=\'separator\'>|</span>  					<div uib-pagination 						template-url="geekitem_pagination_mini.tpl" 						total-items="filectrl.data.config.numitems" 						ng-model="filectrl.params.pageid" 						ng-change="filectrl.pageChanged()" 						items-per-page="filectrl.params.showcount"> 					</div> 				</span> 			</div> 			<div class=\'panel-body-toolbar-count\'> 				<showing-range showcount="filectrl.params.showcount" 									pageid="filectrl.params.pageid" 									firstload="filectrl.firstload" 									numitems="filectrl.data.config.numitems"></showing-range> 			</div> 		</div>  		<div class=\'text-muted\' ng-if="filectrl.data.config.numitems == 0"> 			No files found. 		</div>  		<div ng-switch on="filectrl.density"> 			<div ng-switch-when="compact"> 				<files-list 					files="filectrl.data.files" 					layout="compact" 					condensed-summary="false"> 				</files-list> 			</div> 			<div ng-switch-default> 				<files-list 					files="filectrl.data.files" 					layout="comfortable" 					condensed-summary="false"> 				</files-list> 			</div> 		</div>  		<div class="panel-cta" ng-if="filectrl.firstload"> 			<div uib-pagination 				template-url="geekitem_pagination.tpl" 				total-items="filectrl.data.config.numitems" 				ng-model="filectrl.params.pageid" 				ng-change="filectrl.pageChanged()" 				items-per-page="filectrl.params.showcount" 				max-size="5" 				boundary-links="true"> 			</div> 			<div class=\'panel-cta-secondary\'> 				<span class=\'panel-cta-secondary-action\'> 					<showcount-selector  						showcount=\'filectrl.params.showcount\'  						options=\'filectrl.showcountOptions\'  						setter=\'filectrl.setParam\'> 					</showcount-selector> 				</span> 			</div> 			<div class=\'panel-inline-links\' ng-if="filectrl.data.config.numitems && filectrl.nopager && filectrl.data.config.numitems > 0"> 				<a class=\'btn btn-sm btn-default\' ui-sref="geekitem.files"> 					See All ({{filectrl.data.config.numitems}}) 				</a> 			</div> 		</div> 	</div> </div>  ' );
t.put( 'geekitem_module_files_comfortable.tpl', ' <ul class=\'summary summary-file summary-callout summary-callout-lg summary-callout-responsive summary-border\' ng-class="{\'summary-condensed\': condensedSummary }"> 	<li ng-repeat="file in files" class=\'summary-item\'> 		<div class=\'summary-item-callout\'> 			<a class=\'summary-item-counts summary-item-counts-fixed-width\' ng-href=\'{{::file.href}}\' 				title="{{::file.numpositive}} thumbs & {{::file.numcomments}} comments"> 				<span class="summary-item-counts-item"> 					<i class=\'fi-like\'></i> 					{{::file.numpositive || 0 | humanize}} 				</span> 				<span class="summary-item-counts-item"> 					<span class=\'glyphicon glyphicon-comment\'></span> 					{{::file.numcomments | humanize}} 				</span> 			</a> 		</div> 		<div class=\'summary-item-title\'> 			<span class=\'summary-file-type\'> 				<a ng-href=\'{{::file.href}}\'>{{::file.filename|filetypeFromFilename}}</a> 			</span> 			<a ng-href=\'{{::file.href}}\'>{{::file.title | characters: 75}}</a> 		</div> 		<div class=\'summary-item-description\'> 			<span ng-if="condensedSummary" ng-bind-html="::file.description.rendered|stripBreaks|stripImages|words: 15|to_trusted"></span> 			<span ng-if="!condensedSummary" ng-bind-html="::file.description.rendered|words: 30|to_trusted"></span> 		</div> 		<div class=\'summary-item-meta\'> 			<a ng-href="/user/{{::file.user.username}}">{{::file.user.username}}</a> 			&middot; 			<a ng-href=\'{{::file.href}}\' 				title="{{::file.postdate|geekdatetime:\'calendar\'}}"> 				{{file.postdate|geekdatetime}} 			<span ng-if=\'::file.language\'> 				&middot; 				{{::file.language}} 			</span> 			</a> 		</div> 	</li> </ul>  ' );
t.put( 'geekitem_module_files_compact.tpl', ' <ul class=\'summary summary-file summary-border summary-compact summary-callout summary-callout-lg summary-callout-responsive\'> 	<li ng-repeat="file in files" class=\'summary-item summary-item-inline\'> 		<div class=\'summary-item-callout\'> 			<a class=\'summary-item-counts\' 				ng-href=\'{{::file.href}}\' 				title="{{::file.numpositive}} thumbs & {{::file.numcomments}} comments"> 				<span class="summary-item-counts-item"> 					<i class=\'fi-like\'></i> 					{{::file.numpositive | humanize}} 				</span> 				<span class="summary-item-counts-item"> 					<span class=\'glyphicon glyphicon-comment\'></span> 					{{::file.numcomments | humanize}} 				</span> 			</a> 		</div> 		<div class=\'summary-item-title\'> 			<span class=\'summary-file-type\'> 				<a ng-href=\'{{::file.href}}\'>{{::file.filename|filetypeFromFilename}}</a> 			</span> 			<a ng-href=\'{{::file.href}}\'>{{::file.title | characters: 75}}</a> 		</div> 		<div class=\'summary-item-meta\'> 			<a ng-href="/user/{{::file.user.username}}">{{::file.user.username}}</a> 			&middot; 			<a ng-href=\'{{::file.href}}\' 				title="{{::file.postdate|geekdatetime:\'calendar\'}}"> 				{{file.postdate|geekdatetime}} 			</a> 			<span ng-if=\'::file.language\'> 				&middot; 				{{::file.language}} 			</span> 		</div> 	</li> </ul>  ' );
t.put( 'geekitem_module_files_overview.tpl', ' <a name="files"></a> <div class=\'panel\'> 	<div class=\'panel-header panel-header-lg\'> 		<h3 class=\'panel-title\'> 			<a ui-sref="geekitem.files">Files</a> 		</h3> 		<div class=\'panel-header-actions\'> 			<a class=\'btn btn-xs btn-subtle\' 				ng-href=\'/file/new/{{::filectrl.geekitemParams.objecttype}}/{{::filectrl.geekitemParams.objectid}}\'> 				<i class=\'fi-plus\'></i> Upload 			</a> 		</div> 	</div> 	<div class=\'panel-body\' 		  cg-busy="{ promise:filectrl.loader, 						 templateUrl:\'geekitem_loadinginline.tpl\', 						 backdrop:false }">  		<div ng-if="!filectrl.geekitemSettings.overview_nohot" class=\'panel\'> 			<div class=\'panel-header panel-header-sm\'> 				<h4 class=\'panel-title\'> 					Top Files 				</h4> 			</div> 			<div class=\'panel-body\'> 				<files-list 					layout=\'comfortable\' 					files=\'filectrl.data.files.hot\' 					condensed-summary=\'true\'> 				</files-list>  				<div class=\'text-muted\' ng-if="filectrl.data.files.hot.length == 0"> 					No files found. 				</div> 			</div> 		</div>  		<div class=\'panel\'> 			<div class=\'panel-header panel-header-sm\'> 				<h4 class=\'panel-title\'> 					Recent Files 				</h4> 			</div> 			<div class=\'panel-body\'> 				<files-list 					layout=\'comfortable\' 					files=\'filectrl.data.files.recent\' 					condensed-summary=\'true\'> 				</files-list>  				<div class=\'text-muted\' ng-if="filectrl.data.files.recent.length == 0"> 					No files found. 				</div> 			</div> 		</div>  		<div class="panel-cta" ng-if="filectrl.data.config.numitems && filectrl.data.config.numitems > 0"> 			<div class=\'panel-inline-links\'> 				<a class=\'btn btn-sm btn-default\' ui-sref="geekitem.files"> 					See All ({{filectrl.data.config.numitems}}) 				</a> 			</div> 		</div> 	</div> </div>  ' );
t.put( 'geekitem_module_forums.tpl', ' <div class=\'panel\' ng-class="{ \'is-loading\': !forumctrl.loaded }"> 	<div class=\'panel-header panel-header-lg\'> 		<h3 class=\'panel-title\'> 			<a ui-sref="geekitem.forums">Forums</a> 			<span class=\'hidden-xs\' ng-if="forumctrl.data.config.forumtitle"> 				<span class="text-muted text-normal">/</span> 				{{forumctrl.data.config.forumtitle}} 			</span> 		</h3>  		<div class=\'panel-header-actions\'> 			<span ng-repeat="sort in ::forumctrl.data.config.sorttypes"> 				<a ng-click="forumctrl.setParam( \'sort\', sort.type );" 					ng-class="{ \'is-active\': sort.type==forumctrl.params.sort }"> 					{{::sort.name}} 				</a> 			</span>  			<button type="button" class=\'btn btn-sm btn-subtle\' ng-click=\'forumctrl.forumsearch=!forumctrl.forumsearch\' ng-class="{\'active\': forumctrl.forumsearch}"> 				<span class=\'glyphicon glyphicon-search\' aria-hidden="true"></span> 				<span class="sr-only">Search Forums</span> 			</button>  			<a class=\'btn btn-sm btn-primary\' 				ng-href=\'/article/create/{{forumctrl.geekitemParams.objecttype}}/{{forumctrl.geekitemParams.objectid}}?forumid={{forumctrl.data.config.forumid}}\' aria-label="New Post"> 				<i class=\'fi-plus\'></i><span class=\'hidden-xs\'> New Post</span> 			</a> 		</div> 	</div> 	<div class=\'panel-body\' cg-busy="{ promise:forumctrl.loader, 				  templateUrl:\'geekitem_loadinginline.tpl\', 				  backdrop:false }"> 		<forum-search-panel></forum-search-panel> 		<div class=\'panel-body-toolbar\'> 			<tabs data="forumctrl.linkedForumTabData" ng-if="forumctrl.linkedForumTabData.length > 1" type="tabs" template-url="geekitem_tabs_mobile_dropdown.tpl"></tabs> 			<tabs data="forumctrl.tabData" type="tabs" template-url="geekitem_tabs_mobile_dropdown.tpl"></tabs>  			<div class=\'panel-body-toolbar-actions\'> 				<persistent-selector 					default="comfortable" 					template-url="densitySelectorButtonGroup.html" 					key="{{forumctrl.densitykey}}" 					value="forumctrl.density"> 				</persistent-selector>  				<span ng-if=\'forumctrl.data.config.numitems > forumctrl.params.showcount\'> 					<span class=\'separator\'>|</span>  					<div uib-pagination 						template-url="geekitem_pagination_mini.tpl" 						total-items="forumctrl.data.config.numitems" 						ng-model="forumctrl.params.pageid" 						ng-change="forumctrl.pageChanged()" 						items-per-page="forumctrl.params.showcount"> 					</div> 				</span> 			</div>  			<div class=\'panel-body-toolbar-count\'> 				<showing-range showcount="forumctrl.params.showcount" 									pageid="forumctrl.params.pageid" 									firstload="forumctrl.firstload" 									numitems="forumctrl.data.config.numitems"></showing-range> 			</div>  		</div> 		<div class=\'text-muted\' ng-if="forumctrl.data.threads.length == 0"> 			No discussions found. 		</div>  		<div ng-switch on="forumctrl.density"> 			<div ng-switch-when="compact"> 				<forum-threads 					layout="compact" 					threads="forumctrl.data.threads" 					article-showcount="forumctrl.data.config.article_showcount" 					sort="forumctrl.params.sort" 					show-item="forumctrl.params.linkedforum_index" 					show-forum="forumctrl.forumid == 0" 					forumid="forumctrl.forumid" 					linkedforum-index="forumctrl.params.linkedforum_index"> 				</forum-threads> 				<!--<ng-include src="\'geekitem_module_forums_compact.tpl\'"></ng-include>--> 			</div> 			<div ng-switch-default> 				<forum-threads 					layout="comfortable" 					threads="forumctrl.data.threads" 					article-showcount="forumctrl.data.config.article_showcount" 					sort="forumctrl.params.sort" 					show-item="forumctrl.params.linkedforum_index" 				   show-forum="forumctrl.forumid == 0"> 				</forum-threads> 			</div> 		</div>  		<div class=\'panel-cta\'> 			<div ng-if="forumctrl.firstload"> 				<div uib-pagination 					template-url="geekitem_pagination.tpl" 					total-items="forumctrl.data.config.numitems" 					ng-model="forumctrl.params.pageid" 					ng-change="forumctrl.pageChanged()" 					items-per-page="forumctrl.params.showcount" 					boundary-links="true" 					max-size="5"> 				</div>  				<unbounded-pagination ng-if="forumctrl.data.config.numitems === null" 					ng-model="forumctrl.params.pageid" 					ng-change="forumctrl.pageChanged()" 					items-per-page="forumctrl.params.showcount" 					items-on-page="forumctrl.data.threads.length"> 				</unbounded-pagination>  				<div class=\'panel-cta-secondary\'> 					<span class=\'panel-cta-secondary-action\'> 						<showcount-selector 							showcount=\'forumctrl.params.showcount\' 							options=\'forumctrl.showcountOptions\' 							setter=\'forumctrl.setParam\'> 						</showcount-selector> 					</span>  					<span ng-if="forumctrl.rssFeed" class=\'panel-cta-secondary-action\'> 						<a class=\'btn btn-xs btn-subtle\' ng-href="{{forumctrl.rssFeed}}"> 							<i class=\'fi-rss\'></i> RSS 						</a> 					</span>  					<span class=\'panel-cta-secondary-action\' ng-if="forumctrl.forumuid"> 						<subscription 							btn-size=\'xs\' 							btn-style=\'subtle\' 							item="{objecttype: \'uforum\', objectid: forumctrl.forumuid}"> 						</subscription> 					</span> 				</div> 			</div>  			<div class=\'panel-inline-links\' ng-if="::forumctrl.showfooter"> 				<a class=\'btn btn-sm btn-default\' href="#" ui-sref="geekitem.forums"> 					See All ({{forumctrl.data.config.numitems | number}}) 				</a> 				<span class="hidden-xs" uib-dropdown> 					<a ng-href="" uib-dropdown-toggle> 						Go to Forum <span class="caret"></span> 					</a> 					<ul uib-dropdown-menu> 						<li ng-repeat="forum in forumctrl.data.forums"> 							<a ui-sref="geekitem.forums({forumid:forum.forumid})">{{::forum.title}}</a> 						</li> 					</ul> 				</span> 			</div> 		</div> 	</div> </div>  ' );
t.put( 'geekitem_module_forums_searchpanel.tpl', ' <div class=\'panel-body-toolbar\' ng-show="forumctrl.forumsearch"> 	<form ng-show="forumctrl.forumsearch" class=\'search-simple\' method=\'get\' action=\'/spsearch.php\'> 		<div class=\'form-group\'> 			<input type=\'hidden\' name=\'objectid\' value=\'{{forumctrl.geekitemParams.objectid}}\'> 			<input type=\'hidden\' name=\'objecttype\' value=\'{{forumctrl.geekitemParams.objecttype}}\'> 			<input type=\'hidden\' name=\'searchfield\' value=\'all\'> 			<input type=\'hidden\' name=\'forumids[]\' ng-disabled="!forumctrl.data.config.forumid || forumctrl.data.config.forumid === \'0\'" value="{{forumctrl.data.config.forumid}}"> 			<input type=\'hidden\' name=\'displayresults\' value=\'excerpt\'> 			<label for="panel-forum-search" class="sr-only">Search Forums</label> 			<input id="panel-forum-search" name=\'q\' ng-show="forumctrl.forumsearch" select-on-show type=\'text\' class=\'form-control col-xs-2 input-sm\' placeholder="{{ forumctrl.data.config.forumtitle ? \'Search in \' + forumctrl.data.config.forumtitle : \'Search Forums\' }}"> 			<button type=\'submit\' class=\'btn btn-empty\'> 				<i class=\'fi-magnifying-glass\' aria-hidden="true"></i> 				<span class="sr-only">Search</span> 			</button> 		</div> 	</form> </div>  ' );
t.put( 'geekitem_module_forums_compact.tpl', ' <ul class=\'summary summary-callout summary-callout-lg summary-callout-responsive summary-discussion summary-border summary-compact\'> 	<li class=\'summary-item\' ng-repeat="thread in threads"> 		<div class=\'summary-item-callout\'> 			<a ng-href="/thread/{{::thread.threadid}}/{{::thread.linkname}}" 				title="{{::thread.numrecommend}} thumbs & {{::thread.numposts - 1}} replies" 				class="summary-item-counts summary-item-counts-fixed-width"> 				<span class="summary-item-counts-item"> 					<i class=\'fi-like\'></i> 					{{::thread.numrecommend | humanize}} 				</span> 				<span class="summary-item-counts-item"> 					<span class=\'glyphicon glyphicon-comment\'></span> 					{{::thread.numposts - 1 | humanize}} 				</span> 			</a> 		</div> 		<div class=\'summary-item-body\'> 			<div ng-show="!linkedforumIndex && forumid == \'0\'" 					class=\'visible-lg-inline summary-item-tag\'> 				<a title="{{::thread.forumtitle}}" ui-sref="geekitem.forums({forumid:thread.forumid})"> 					{{::thread.forumtitle  | characters: 10}} 				</a> 			</div>  			<div class=\'summary-item-title\'> 				<div class=\'summary-item-tag summary-discussion-object\' ng-show="linkedforumIndex"> 					<a ng-href=\'{{::thread.objecthref}}\' title="{{::thread.objectname}}">{{::thread.objectname}}</a> 				</div> 				<span ng-show="linkedforumIndex" 						class=\'summary-item-tag\'> 					<a ui-sref="geekitem.forums({forumid:thread.forumid})">{{::thread.forumtitle}}</a> 				</span> 				<a title="{{::thread.subject}}" ng-href="{{thread.href}}"> 					{{::thread.subject | characters: 100}} 				</a> 				<geek-href-pagination href="::thread.href" showcount=\'::articleShowcount\' itemcount=\'::thread.numposts\'></geek-href-pagination> 			</div>  			<div class=\'summary-item-meta summary-item-meta-user\'> 				<div ng-show="!linkedforumIndex && forumid == \'0\'" 						class=\'hidden-lg summary-item-tag\'> 					<a title="{{::thread.forumtitle}}" ui-sref="geekitem.forums({forumid:thread.forumid})"> 						{{::thread.forumtitle  | characters: 10}} 					</a> 				</div>  				<a ng-href="/user/{{::thread.user.username}}">{{::thread.user.username}}</a>  				<span class=\'hidden-lg\'> 					&middot; 				</span> 			</div>  			<div class=\'summary-item-meta summary-item-meta-date\' ng-class="{\'summary-item-meta-date-long\': sort==\'active\'}"> 				<span ng-if="sort==\'active\'">Last: </span> 				<a ng-href="/thread/{{::thread.threadid}}/{{::thread.linkname}}" 					title="{{::thread.postdate | geekdatetime:\'calendar\'}}" 					ng-if="::thread.numposts <= 1"> 					{{thread.postdate|geekdatetime:\'compactrelative\'}} 				</a> 				<a ng-href="/thread/{{::thread.threadid}}/{{::thread.linkname}}" 					ng-if="sort != \'active\' && thread.numposts > 1" 					title="reply by {{::thread.lastpostusername}} at {{::thread.lastpostdate | geekdatetime:\'calendar\'}}"> 					{{thread.postdate|geekdatetime:\'compactrelative\'}} 				</a> 				<a	title="reply by {{::thread.lastpostusername}} at {{::thread.lastpostdate | geekdatetime:\'calendar\'}}" 					ng-href="/thread/{{::thread.threadid}}/article/{{::thread.lastpostarticleid}}#{{::thread.lastpostarticleid}}" 					ng-if="thread.numposts > 1 && sort == \'active\'"> 					{{thread.lastpostdate|geekdatetime:\'compactrelative\'}} 				</a> 			</div> 		</div> 	</li> </ul>  ' );
t.put( 'geekitem_module_forums_comfortable.tpl', ' <ul class=\'summary summary-callout summary-callout-lg summary-callout-responsive summary-discussion summary-border summary-condensed\'> 	<li class=\'summary-item\' ng-repeat="thread in threads"> 		<div class=\'summary-item-callout\'> 			<a ng-href="/thread/{{::thread.threadid}}/{{::thread.linkname}}" 				title="{{::thread.numrecommend}} thumbs & {{::thread.numposts - 1}} replies" 				class="summary-item-counts summary-item-counts-fixed-width"> 				<span class="summary-item-counts-item"> 					<i class=\'fi-like\'></i> 					{{::thread.numrecommend | humanize}} 				</span> 				<span class="summary-item-counts-item"> 					<span class=\'glyphicon glyphicon-comment\'></span> 					{{::thread.numposts - 1 | humanize}} 				</span> 			</a> 		</div>  		<div class=\'summary-item-title\'> 			<div class=\'summary-discussion-object summary-item-tag\' ng-show="showItem"> 				<a ng-href=\'{{::thread.objecthref}}\' title="{{::thread.objectname}}">{{::thread.objectname}}</a> 			</div> 			<a ng-href="{{thread.href}}"> 				{{::thread.subject}} 			</a> 			<geek-href-pagination href="::thread.href" showcount=\'::articleShowcount\' itemcount=\'::thread.numposts\'></geek-href-pagination> 		</div>  		<div class=\'summary-item-meta\'> 			<span class=\'summary-item-tag\' 					ng-show="showForum"> 				<a ui-sref="geekitem.forums({forumid:thread.forumid})">{{::thread.forumtitle | characters: 75}}</a> 			</span> 			<span ng-if="::thread.user.username"> 				<a ng-href="/user/{{::thread.user.username}}">{{::thread.user.username}}</a> 			</span> 			&middot; 			<span ng-if="sort == \'active\'"> 				Last active: 			</span> 			<a ng-href="/thread/{{::thread.threadid}}/{{::thread.linkname}}" 				title="{{::thread.postdate | geekdatetime:\'calendar\'}}" 				ng-if="::thread.numposts <= 1"> 				{{thread.postdate|geekdatetime}} 			</a>  			<a ng-href="/thread/{{::thread.threadid}}/{{::thread.linkname}}" 				ng-show="sort != \'active\' && thread.numposts > 1" 				title="reply by {{::thread.lastpostusername}} at {{::thread.lastpostdate | geekdatetime:\'calendar\'}}"> 				{{thread.postdate|geekdatetime}} 			</a>  				<a	title="reply by {{::thread.lastpostusername}} at {{::thread.lastpostdate | geekdatetime:\'calendar\'}}" 					ng-if="thread.numposts > 1 && sort == \'active\'" 					ng-href="/thread/{{::thread.threadid}}/article/{{::thread.lastpostarticleid}}#{{::thread.lastpostarticleid}}"> 					{{thread.lastpostdate|geekdatetime}} 				</a> 			</span> 		</div> 	</li> </ul>  ' );
t.put( 'geekitem_module_forums_overview.tpl', ' <div class=\'panel\'> 	<div class=\'panel-header panel-header-lg\'> 		<h3 class=\'panel-title\'> 			<a ui-sref="geekitem.forums">Forums</a> 		</h3>  		<div class=\'panel-header-actions\'> 			<span uib-dropdown> 				<button class=\'btn btn-xs btn-subtle\' uib-dropdown-toggle> 					Go to Forum <span class="caret"></span> 				</button> 				<ul uib-dropdown-menu> 					<li ng-repeat="forum in forumctrl.data.forums"> 						<a ui-sref="geekitem.forums({forumid:forum.forumid})">{{::forum.title}} <span ng-if="forum.forumid != 0">({{::forum.numthreads}})</span></a> 					</li> 				</ul> 			</span>  			<button type="button" class=\'btn btn-xs btn-subtle\' ng-click=\'forumctrl.forumsearch=!forumctrl.forumsearch\' ng-class="{\'active\': forumctrl.forumsearch}"> 				<span class=\'glyphicon glyphicon-search\' aria-hidden="true"></span> 				<span class="sr-only">Search Forums</span> 			</button>  			<a class=\'btn btn-xs btn-subtle\' 				ng-href=\'/article/create/{{forumctrl.geekitemParams.objecttype}}/{{forumctrl.geekitemParams.objectid}}?forumid={{forumctrl.data.config.forumid}}\' aria-label="New Post"> 				<i class=\'fi-plus\'></i><span class=\'hidden-xs\'> New Post</span> 			</a> 		</div> 	</div> 	<div class=\'panel-body\'> 		<forum-search-panel></forum-search-panel>  		<div class=\'panel\' ng-repeat="sort in forumctrl.sorts|nohot"> 			<div ng-if="!(sort.sort == \'hot\' && forumctrl.geekitemSettings.overview_nohot)"> 				<div class=\'panel-header panel-header-sm\'> 					<h4 class=\'panel-title\'> 						{{forumctrl.data.config.sorttypes|fieldFromArrayById:\'type\':sort.sort:\'name\'}} Threads 					</h4> 				</div> 				<div class=\'panel-body\'> 					<forum-threads 						layout="comfortable" 						threads="forumctrl.data[sort.sort].threads" 						article-showcount="forumctrl.data.config.article_showcount" 						sort="sort.sort" 						show-forum="true"> 					</forum-threads>  					<div class=\'text-muted\' ng-if="!forumctrl.data[sort.sort].threads.length"> 						No discussions found. 					</div> 				</div> 			</div> 		</div>  		<div class=\'panel-cta\' ng-if="forumctrl.data.config.numitems"> 			<div class=\'panel-inline-links\'> 				<a class=\'btn btn-sm btn-default\' href="#" ui-sref="geekitem.forums"> 					See All ({{forumctrl.data.config.numitems | number}}) 				</a> 			</div> 		</div> 	</div> </div>  ' );
t.put( 'geekitem_module_fullcredits.tpl', ' 	<ul class=\'outline outline-col-xs-block outline-border\'> 		<li class=\'outline-item\' 			 ng-class="{\'is-highlighted\': info.keyname==creditsctrl.hash}" 			 ng-repeat="info in creditsctrl.geekitem.data.item.itemdata 					|filter:{ \'fullcredits\': \'true\' }"> 			<div class=\'outline-item-title outline-item-title-lg\'> 				<a name="{{info.keyname}}"></a> 				<span ng-attr-id="{{\'fullcredits-\' + info.keyname}}">{{(info.datatype == \'geekitem_linkdata\' && creditsctrl.geekitem.data.item.links[info.keyname].length > 1 && info.titlepl ) || info.title}}</span> 			</div> 			<div class="outline-item-description"> 				<div ng-if="info.datatype == \'geekitem_linkdata\'"> 					<div ng-if="!creditsctrl.geekitem.data.item.links[info.keyname].length">N/A</div> 					<div ng-repeat="link in creditsctrl.geekitem.data.item.links[info.keyname]"> 						<a ng-href="{{link.href}}">{{link.name}}</a> 					</div> 				</div> 				<div ng-if="info.datatype == \'geekitem_fielddata\'"> 					<div ng-switch="info.keyname"> 						<div ng-switch-when="alternatename" ng-repeat="name in creditsctrl.geekitem.data.item.alternatenames" 							  ng-bind-html="name.name|to_trusted"></div> 						<div ng-switch-default> 								<span ng-switch="info.fieldtype"> 									<range ng-switch-when="range" 											 min="item[info.minfield]" 											 max="item[info.maxfield]"></range> 									<span ng-switch-default ng-bind-html="creditsctrl.geekitem.data.item[info.keyname]|to_trusted"></span> 									<span>{{info.posttext}}</span> 								</span> 						</div> 					</div> 				</div> 			</div> 		</li> 	</ul>  ' );
t.put( 'geekitem_module_gamebox.tpl', ' <div ng-controller="GeekItem_HeaderCtrl as headerctrl"> 	<a no-animate ng-show="geekitemctrl.geekitem.data.item.imagepagehref" 	   ng-href=\'{{geekitemctrl.geekitem.data.item.imagepagehref}}\'> 		<img no-animate class="img-responsive" data-no-retina="true" 		     ng-src="{{::geekitemctrl.geekitem.data.item.imageurl}}" 		     alt="{{::geekitemctrl.geekitem.data.item.name}} Cover Artwork"> 	</a>  	<a no-animate ng-show="!geekitemctrl.geekitem.data.item.imagepagehref" ui-sref=\'geekitem.overview\'> 		<img no-animate class="img-responsive" data-no-retina="true" 		     ng-src="{{::geekitemctrl.geekitem.data.item.imageurl}}" 		     alt="{{::geekitemctrl.geekitem.data.item.name}} Cover Artwork"> 	</a> </div>  ' );
t.put( 'geekitem_module_gameplay.tpl', ' <div class=\'panel panel-bottom\' ng-if="geekitemctrl.geekitem.loaded"> 	<div class=\'panel-body\'> 		<h2 class=\'sr-only\'> 			Gameplay 		</h2> 		<ul class=\'gameplay\'> 			<li class=\'gameplay-item\'> 				<div class=\'gameplay-item-primary\'> 					<range ng-if="::geekitemctrl.geekitem.data.item.minplayers > 0 || geekitemctrl.geekitem.data.item.maxplayers > 0" 						 min="::geekitemctrl.geekitem.data.item.minplayers" max="::geekitemctrl.geekitem.data.item.maxplayers"></range> 					Players 				</div> 				<div class=\'gameplay-item-secondary\'> 					<span item-poll-button="numplayers" poll-view="results"> 						<button type=\'button\' class=\'btn btn-link btn-xs\' uib-tooltip="View poll and results" tooltip-popup-delay=\'500\' tooltip-append-to-body=\'true\'> 							Community: 							<span ng-show="::geekitemctrl.geekitem.data.item.polls.userplayers.totalvotes == 0"> 								(no votes) 							</span> 							<span ng-show="::geekitemctrl.geekitem.data.item.polls.userplayers.totalvotes > 0"> 								{{::geekitemctrl.geekitem.data.item.polls.userplayers.recommended|toRange}} 							</span> 							<span ng-show="::geekitemctrl.geekitem.data.item.polls.userplayers.totalvotes > 0"> 								&mdash; 								Best: {{::geekitemctrl.geekitem.data.item.polls.userplayers.best|toRange}} 							</span> 						</button> 					</span> 				</div> 			</li> 			<li class=\'gameplay-item\'> 				<div class=\'gameplay-item-primary\'> 					<span ng-if="::!geekitemctrl.geekitem.data.item.minplaytime || geekitemctrl.geekitem.data.item.minplaytime <= 0 && geekitemctrl.geekitem.data.item.maxplaytime <= 0"> 						Time: &ndash;&ndash; 					</span> 					<span ng-if="::geekitemctrl.geekitem.data.item.minplaytime > 0 || geekitemctrl.geekitem.data.item.maxplaytime > 0"> 						<range min="::geekitemctrl.geekitem.data.item.minplaytime" max="::geekitemctrl.geekitem.data.item.maxplaytime"></range> Min 					</span> 				</div> 				<div class=\'gameplay-item-secondary\'> 					<div ng-if="::geekitemctrl.geekitem.data.item.minplaytime > 0 || geekitemctrl.geekitem.data.item.maxplaytime > 0"> 						Playing Time 					</div> 					<div class=\'text-muted\' ng-cloak ng-if="::!geekitemctrl.geekitem.data.item.minplaytime || geekitemctrl.geekitem.data.item.minplaytime <= 0 && geekitemctrl.geekitem.data.item.maxplaytime <= 0"> 						(Not provided by publisher) 					</div> 				</div> 			</li> 			<li class=\'gameplay-item\'> 				<div class=\'gameplay-item-primary\'> 					Age: 					<span ng-if="::geekitemctrl.geekitem.data.item.minage == 0"> 						&ndash;&ndash; 					</span> 					<span ng-if="::geekitemctrl.geekitem.data.item.minage > 0"> 						{{::geekitemctrl.geekitem.data.item.minage}}&plus; 					</span> 				</div> 				<div class=\'gameplay-item-secondary\'> 					<div class=\'text-muted\' ng-cloak ng-if="::geekitemctrl.geekitem.data.item.minage == 0"> 						(Not provided by publisher) 					</div> 					<span item-poll-button="playerage" poll-view="results"> 						<button class=\'btn btn-link btn-xs\' uib-tooltip="View poll and results" tooltip-popup-delay=\'500\' tooltip-append-to-body=\'true\'> 							Community: <span ng-bind-html="geekitemctrl.geekitem.data.item.polls.playerage|to_trusted"></span> 						</button> 					</span> 				</div> 			</li> 			<li class=\'gameplay-item\'> 				<div class=\'gameplay-item-primary\'> 					Weight: 					<span ng-show="geekitemctrl.geekitem.data.item.polls.boardgameweight.votes == 0"> 						&ndash;&ndash; 					</span> 					<span ng-show="geekitemctrl.geekitem.data.item.polls.boardgameweight.votes > 0" item-poll-button="boardgameweight" poll-view="results"> 						<span ng-class="{\'gameplay-weight-light\': geekitemctrl.geekitem.data.item.polls.boardgameweight.averageweight <= 3, \'gameplay-weight-medium\': geekitemctrl.geekitem.data.item.polls.boardgameweight.averageweight > 3,\'gameplay-weight-heavy\': geekitemctrl.geekitem.data.item.polls.boardgameweight.averageweight > 4 }"> 							{{::geekitemctrl.geekitem.data.item.polls.boardgameweight.averageweight|number:2}} 						</span> 						/ 5 <span class="sr-only">Complexity Rating</span> 					</span>  				</div> 				<div class=\'gameplay-item-secondary\'> 					<span item-poll-button="boardgameweight" poll-view="results"> 						<button type=\'button\' class=\'btn btn-xs btn-link\' 								  uib-tooltip="View results" 								  tooltip-popup-delay=\'500\' 								  tooltip-append-to-body=\'true\'> 							\'Complexity\' Rating <span class="sr-only">Results</span> 						</button> 					</span>  					<a class=\'btn btn-empty\' href="/wiki/page/Weight" 						 uib-tooltip="Community rating for how difficult a game is to understand. Lower rating (lighter weight) means easier." 						 tooltip-append-to-body="true" 						 tooltip-placement=\'bottom-right\' 						 tooltip-class="tooltip-lg"><span class=\'glyphicon glyphicon-question-sign fs-xs\'></span> 						 <span class="sr-only">Learn more about complexity ratings</span> 					</a> 				</div> 			</li> 		</ul> 	</div> </div>  ' );
t.put( 'geekitem_module_geeklists.tpl', ' 	<div class=\'panel\' ng-class="{ \'is-loading\': !geeklistctrl.loaded }"> 		<div class=\'panel-header panel-header-lg\'> 			<h3 class=\'panel-title\'> 				GeekLists 			</h3> 			<div class=\'panel-header-actions\'> 				<sort-options 					ng-if="geeklistctrl.data.config.numitems > 0" 					sort="geeklistctrl.setParam(\'sort\', sortvalue)" 					params="geeklistctrl.params"> 				</sort-options>  				<span uib-dropdown dropdown-append-to-body> 					<button class=\'btn btn-sm btn-subtle\' uib-dropdown-toggle> 						{{geeklistctrl.data.config.categoryfilters|fieldFromArrayById : \'value\' : geeklistctrl.params.category : \'title\': \'Filter\'}} <span class="caret"></span> 					</button>  					<ul class=\'dropdown-menu\' uib-dropdown-menu> 						<li class=\'dropdown-option\' ng-repeat=\'filter in geeklistctrl.data.config.categoryfilters\' ng-class=\'{active: filter.value==geeklistctrl.params.category}\'> 							<button type=\'button\' ng-click="geeklistctrl.setParam( \'category\', filter.value)" class=\'btn btn-empty\'> 								{{::filter.title}} 							</button> 						</li> 					</ul> 				</span>  				<a class=\'btn btn-primary btn-sm\' href=\'/geeklist/new\'> 					<i class=\'fi-plus\'></i><span class=\'hidden-xs\'> Add</span> 				</a> 			</div> 		</div> 		<div class=\'panel-body\' 			  cg-busy="{ promise:geeklistctrl.loader, 							 templateUrl:\'geekitem_loadinginline.tpl\', 							 backdrop:false }"> 			<div class="panel-body-toolbar"> 				<div class=\'panel-body-toolbar-actions\'> 					<div uib-pagination 						template-url="geekitem_pagination_mini.tpl" 						total-items="geeklistctrl.data.config.numitems" 						ng-model="geeklistctrl.params.pageid" 						ng-change="geeklistctrl.pageChanged()" 						items-per-page="geeklistctrl.params.showcount"> 					</div> 				</div>  				<div class=\'panel-body-toolbar-count\'> 					<showing-range showcount="geeklistctrl.params.showcount" 										pageid="geeklistctrl.params.pageid" 										firstload="geeklistctrl.firstload" 										numitems="geeklistctrl.data.config.numitems"></showing-range> 				</div> 			</div> 			<div class=\'text-muted\' ng-if="geeklistctrl.data.lists.length == 0"> 				No GeekLists found. 			</div> 			<ul class=\'summary summary-border summary-callout summary-callout-lg summary-condensed\'> 				<li class=\'summary-item\' ng-repeat="list in geeklistctrl.data.lists"> 					<div class=\'summary-item-callout\'> 						<a ng-href="{{list.href}}" class="summary-item-counts summary-item-counts-fixed-width"> 							<span class="summary-item-counts-item"> 								<i class=\'fi-like\'></i> 								{{::list.numrecommend | humanize}} 							</span> 							<span class="summary-item-counts-item"> 								<span class=\'glyphicon glyphicon-comment\'></span> 								{{::list.numitems | humanize}} 							</span> 						</a> 					</div> 					<div class=\'summary-item-title\'> 						<a ng-href="{{list.href}}">{{list.title}}</a> 					</div> 					<div class=\'summary-item-meta\'> 						<a ng-href="/user/{{list.username}}">{{list.username}}</a> 						&middot; 						<a ng-href=\'{{list.href}}\' 							class=\'link-empty\' 							title="{{list.postdate|geekdatetime:\'calendar\'}}"> 							{{list.postdate|geekdatetime}} 						</a> 					</div> 				</li> 			</ul> 			<div class="panel-cta" ng-if="geeklistctrl.firstload"> 				<div uib-pagination 					ng-if="!geeklistctrl.nopager" 					template-url="geekitem_pagination.tpl" 					total-items="geeklistctrl.data.config.numitems" 					ng-model="geeklistctrl.params.pageid" 					ng-change="geeklistctrl.pageChanged()" 					items-per-page="geeklistctrl.showcount" 					max-size="5" 					boundary-links="true"> 				</div>  				<div class=\'panel-cta-secondary\'> 					<span class=\'panel-cta-secondary-action\'> 						<showcount-selector 							showcount=\'geeklistctrl.params.showcount\' 							options=\'geeklistctrl.showcountOptions\' 							setter=\'geeklistctrl.setParam\'> 						</showcount-selector> 					</span> 					<a href="/geeklist/summary/{{geeklistctrl.geekitemParams.objecttype}}/{{geeklistctrl.geekitemParams.objectid}}">Go to Classic GeekList Summary</a> 				</div> 			</div> 		</div> 	</div>  ' );
t.put( 'geekitem_module_geeklists_overview.tpl', ' <div class=\'panel\'> 	<div class=\'panel-header panel-header-lg\'> 		<h4 class=\'panel-title\'>GeekLists with This Game</h4> 	</div> 	<div class=\'panel-body\'> 		<div class=\'text-muted\' ng-if=\'geeklistctrl.loaded && !geeklistctrl.data.lists\'> 			No GeekLists found. 		</div> 		<div class=\'row col-sm-gutters-sm\'> 			<div ng-repeat="list in geeklistctrl.data.lists" 				  ng-class="{\'hidden-xs\': $index === 1, \'visible-lg\': $index === 2}" 				  class=\'col-xs-6 col-sm-4 col-lg-3\'> 				<a ng-href="{{::list.href}}" class=\'summary-item summary-item-geeklist\'> 					<div class=\'summary-item-geeklist-images\'> 						<img alt="{{::item.name}}" ng-repeat="item in list.items" lazy-img=\'{{::item.imageurl}}\'> 					</div> 					<div class=\'summary-item-title\'> 						{{::list.title|characters: 50}} 					</div> 					<div class=\'summary-item-meta\'> 						{{::list.username}} 						&middot; 						<span title="{{::list.postdate|geekdatetime:\'calendar\'}}"> 							{{list.postdate|geekdatetime}} 						</span> 					</div> 					<div class=\'summary-item-actions summary-item-actions-below\'> 						<span class="summary-item-counts-item"> 							<i class=\'fi-like\'></i> 							{{::list.numrecommend | humanize}} 						</span> 						<span class="summary-item-counts-item"> 							<span class=\'glyphicon glyphicon-comment\'></span> 							{{::list.numitems | humanize}} 						</span> 					</div> 				</a> 			</div> 		</div> 	</div> 	<div class="panel-cta"> 		<div class=\'panel-inline-links\'> 			<a class=\'btn btn-sm btn-default\' ui-sref="geekitem.geeklists" ng-if="geeklistctrl.loaded && geeklistctrl.data.config.numitems > 0"> 				See All ({{geeklistctrl.data.config.numitems|number}}) 			</a> 		</div> 	</div> </div>  ' );
t.put( 'geekitem_module_geekmarket_overview.tpl', ' 	<div class=\'panel panel-bottom\'> 		<div class=\'panel-header panel-header-sm\'> 			<h3 class=\'panel-title\'> 				GeekMarket - Recent 			</h3> 		</div> 		<div class=\'panel-body\'> 			<div class=\'text-muted\' ng-if="marketctrl.data.products.length == 0"> 				No listings found. 			</div> 			<ul class=\'summary summary-condensed summary-border summary-sale\'> 				<li class=\'summary-item summary-sale-item\' ng-repeat="product in marketctrl.data.products"> 					<a ng-href="/geekmarket/product/{{::product.productid}}"> 						<div class=\'summary-sale-item-price\'> 							<strong>{{::product.currencysymbol}}{{::product.price|number:0}}</strong> 						</div> 						<div class=\'summary-item-title bottom\'> 							<div class=\'condition\' ng-class="\'condition-\' + \'{{product.conditioncode}}\'" 								uib-tooltip="Condition: {{::product.prettycondition}}" tooltip-append-to-body="true" aria-label="Condition: {{::product.prettycondition}}"> 								{{::product.conditioncode}} 							</div>  							<img ng-src="{{::product.flagimgurl}}" uib-tooltip="{{::product.itemlocation}}" alt="{{::product.itemlocation}}" tooltip-append-to-body="true" width="16" height="16"> 							<span ng-hide="::product.version">{{::product.objectlink.name}}</span> 							<name-with-year ng-show="::product.version" name="::product.version.name" year="::product.version.yearpublished"></name-with-year> 						</div> 					</a> 				</li> 			</ul> 		</div>  		<div class=\'panel-inline-links\'> 			<a class=\'btn btn-xs btn-default\' ui-sref="geekitem.marketplace.geekmarket" ng-if="marketctrl.loaded && marketctrl.data.config.numitems > 0"> 				See All ({{marketctrl.data.config.numitems | number}}) 			</a> 			<a class=\'fs-xs\' 				ng-href=\'/geekmarket/sell?objecttype={{marketctrl.geekitemParams.objecttype}}&objectid={{marketctrl.geekitemParams.objectid}}\'> 				Sell a Copy 			</a> 			<a class=\'fs-xs\' href="/geekmarket/pricehistory/thing/{{marketctrl.geekitemParams.objectid}}"> 				Price History 			</a> 		</div>  	</div>  ' );
t.put( 'geekitem_module_geekmarket_full.tpl', ' 	<div class=\'panel\' ng-class="{ \'is-loading\': !marketctrl.loaded }"> 		<div class=\'panel-header panel-header-lg\'> 			<h3 class=\'panel-title\'> 				<a href=\'/geekmarket/browse?objecttype={{marketctrl.geekitemParams.objecttype}}&objectid={{marketctrl.geekitemParams.objectid}}\'> 					GeekMarket 				</a> 			</h3> 			<div class=\'panel-header-actions\'> 				<a class=\'btn btn-primary btn-sm\' 					ng-href=\'/geekmarket/sell?objecttype={{marketctrl.geekitemParams.objecttype}}&objectid={{marketctrl.geekitemParams.objectid}}\'> 					<i class=\'fi-plus\'></i><span class=\'hidden-xs\'> Sell</span> 				</a> 			</div> 		</div>  		<div class=\'panel-body\'> 			<div class=\'panel-body-toolbar\'> 			  <div class=\'panel-body-toolbar-actions\'> 				  <div uib-pagination 					  template-url="geekitem_pagination_mini.tpl" 					  total-items="marketctrl.data.config.numitems" 					  ng-model="marketctrl.params.pageid" 					  ng-change="marketctrl.pageChanged()" 					  items-per-page="marketctrl.params.showcount"> 				  </div> 			  </div> 			  <span class=\'panel-body-toolbar-count\'> 				  <showing-range showcount="marketctrl.params.showcount" 									  pageid="marketctrl.params.pageid" 									  firstload="marketctrl.firstload" 									  numitems="marketctrl.data.config.numitems"></showing-range> 			  </span> 		  </div> 			<div class=\'text-muted\' ng-if="marketctrl.data.products.length == 0"> 				No listings found. 			</div> 			<ul class=\'summary summary-condensed summary-border summary-callout summary-callout-lg\'> 				<li class=\'summary-item summary-item-inline summary-sale-item\' ng-repeat="product in marketctrl.data.products"> 					<div class=\'summary-item-callout\'> 						<strong>{{::product.currencysymbol}}{{::product.price|number:0}}</strong> 					</div> 					<a ng-href="/geekmarket/product/{{::product.productid}}"> 						<div class=\'summary-item-title\'> 							<div class=\'condition\' ng-class="\'condition-\' + \'{{product.conditioncode}}\'" 								uib-tooltip="Condition: {{::product.prettycondition}}" tooltip-append-to-body="true" aria-label="Condition: {{::product.prettycondition}}"> 								{{::product.conditioncode}} 							</div>  							<img ng-src="{{::product.flagimgurl}}" uib-tooltip="{{::product.itemlocation}}" alt="{{::product.itemlocation}}" tooltip-append-to-body="true"> 							<span ng-hide="::product.version">{{::product.objectlink.name}}</span> 							<name-with-year ng-show="::product.version" name="::product.version.name" year="::product.version.yearpublished"></name-with-year> 						</div> 						<div class=\'summary-item-meta\'> 							{{product.listdate|geekdatetime}} 						</div> 					</a> 				</li> 			</ul> 			<div class="panel-cta"> 				<div uib-pagination 					template-url="geekitem_pagination.tpl" 					total-items="marketctrl.data.config.numitems" 					ng-if="marketctrl.data.products.length > 0" 					ng-model="marketctrl.params.pageid" 					ng-change="marketctrl.pageChanged()" 					items-per-page="marketctrl.params.showcount" 					max-size="5" 					boundary-links="true"> 				</div> 				<div class=\'panel-cta-secondary\'> 					<span class=\'panel-cta-secondary-action\'> 						<showcount-selector  							showcount=\'marketctrl.params.showcount\'  							options=\'marketctrl.showcountOptions\'  							setter=\'marketctrl.setParam\'> 						</showcount-selector> 					</span> 					<a href="/geekmarket/pricehistory/thing/{{marketctrl.geekitemParams.objectid}}"> 						Price History 					</a> 					&middot; 					<a href="/geekmarket/browse?objecttype=thing&objectid={{marketctrl.geekitemParams.objectid}}"> 						View in GeekMarket 					</a> 				</div> 			</div> 		</div> 	</div>  ' );
t.put( 'geekitem_module_geekup_ad.tpl', ' <div class="geekup" ng-if="geekupctrl.geekitem.data.item.promoted_ad" 	  ng-click="geekupctrl.sendGA(             {                 hitType: \'event\',                 eventCategory: \'VideoRow\',                 eventAction: \'click:Ad\',                 eventLabel: geekupctrl.geekitem.data.item.name             } )" 	> 	<div class="geekup_img-wrap"> 		<div class="geekup_img-bg"> 			<img class="geekup_img" src="{{geekupctrl.geekitem.data.item.promoted_ad.image}}" role="presentation"> 		</div> 	</div> 	<div class="geekup__body"> 		 <h2 class="geekup__title">{{ geekupctrl.geekitem.data.item.promoted_ad.title }}</h2>  		<a class="geekup__link" 			ng-href="{{geekupctrl.geekitem.data.item.promoted_ad.href}}?utm_source=bgg&utm_medium=banner&utm_campaign=bggstore-{{geekupctrl.geekitem.data.item.name}}&utm_content={{geekupctrl.geekitem.data.item.bggstore_product}}" > 			<span ng-if="geekupctrl.geekitem.data.item.promoted_ad.from_lowest">from</span> 			{{ geekupctrl.geekitem.data.item.promoted_ad.price }} via Geek Store 		</a> 	</div> </div>  ' );
t.put( 'geekitem_module_header.tpl', ' <div class=\'game-primary\' 	  ng-controller="GeekItem_HeaderCtrl as headerctrl"> 	<div class="game-primary-background-image" ng-style="{ \'background-image\': \'url(\\\'\' +  ( geekitemctrl.geekitem.data.item.topimageurl || \'//cf.geekdo-static.com/images/bg/background-hex.jpg\' ) + \'\\\')\'}"></div> 	<ng-include src="\'geekitem_module_header_admin.tpl\'"></ng-include> 	<div class=\'game-header\' 		  ng-class="{ \'game-header-collapsed\': geekitemctrl.state.current.name != \'geekitem.overview\' }"> 		<div class=\'game-header-image\'> 			<ng-include src="\'geekitem_module_gamebox.tpl\'"></ng-include> 		</div> 		<div class=\'game-header-body\'> 			<div class="game-header-title-container"> 				<flags-module geekitem="geekitemctrl.geekitem"></flags-module>  				<div class="game-header-title"> 					<div class=\'game-header-title-rating\'> 						<overall-rating item="geekitemctrl.geekitem.data.item"></overall-rating> 					</div> 					<div class=\'game-header-title-info\'> 						<h1> 							<a ui-sref="geekitem.overview" ng-href="{{geekitemctrl.geekitem.data.item.href|to_trusted}}"> 								{{::geekitemctrl.geekitem.data.item.name}} 							</a> 							<span ng-if=\'geekitemctrl.geekitem.data.item.yearpublished && geekitemctrl.geekitem.data.item.yearpublished !=="0"\' class=\'game-year\'> 								({{::geekitemctrl.geekitem.data.item.yearpublished}}) 							</span> 						</h1>  						<p ng-if="::geekitemctrl.geekitem.data.item.short_description">{{::geekitemctrl.geekitem.data.item.short_description}} 							<button login-required geekitem-edit-short-description-button class=\'short-description-edit-btn btn btn-link\' aria-label="Edit Description" title="Edit Description"> 								<i class=\'fi-pencil\'></i> 							</button> 						</p>  						<p ng-if="!geekitemctrl.geekitem.data.item.short_description"> 							<button login-required geekitem-edit-short-description-button class=\'short-description-edit-btn dotted-underline btn btn-link\'> 								<i class=\'fi-pencil\'></i> Add a Brief Description 							</button> 						</p>  						<ul class=\'game-header-title-summary\' ng-show="geekitemctrl.geekitem.loaded"> 							<li> 								<a ui-sref="geekitem.ratings({rated:1,comment:\'\',status:\'\'})"> 									{{::geekitemctrl.geekitem.data.item.stats.usersrated|humanize}} 									Rating<span ng-hide="geekitemctrl.geekitem.data.item.stats.usersrated == 1">s</span> 								</a> 									&amp; 								<a ui-sref="geekitem.ratings({comment:1,rated:\'\',status:\'\'})"> 									{{::geekitemctrl.geekitem.data.item.stats.numcomments|humanize}} 									Comment<span ng-hide="geekitemctrl.geekitem.data.item.stats.numcomments == 1">s</span> 								</a> 								&middot; 								<a ng-href="/geekbuddy/analyze/{{::geekitemctrl.geekitemParams.objecttype}}/{{::geekitemctrl.geekitemParams.objectid}}"> 									GeekBuddy Analysis 								</a> 							</li> 						</ul> 					</div> 				</div> 			</div>  			<div class="game-header-gameplay hidden-game-header-collapsed"> 				<gameplay-module geekitem="geekitemctrl.geekitem"></gameplay-module> 			</div>  			<div class="game-header-credits hidden-game-header-collapsed"> 				<ng-include src="\'geekitem_module_credits.tpl\'"></ng-include> 			</div>  			<div class=\'game-header-primary-actions hidden-game-header-collapsed\'> 				<span class=\'hidden-xs\'> 					<collection-rating item="{objecttype: geekitemctrl.geekitemParams.objecttype,   										      objectid: geekitemctrl.geekitemParams.objectid}" 									   layout="desktop"> 					</collection-rating> 				</span>  				<span class=\'visible-xs\'> 					<ng-include src="\'geekitem_toolbar_small.tpl\'"></ng-include> 				</span>  				<span class=\'hidden-xs\'> 					<ng-include src="\'geekitem_toolbar_large.tpl\'"></ng-include> 				</span> 			</div>  			<div class=\'game-header-secondary-actions hidden-game-header-collapsed\'> 				<button class=\'btn btn-xs btn-white\' edit-geek-item-settings login-required> 					<i class=\'fi-widget\'></i> Settings</span> 				</button>  				<button 					class=\'btn btn-xs btn-white\' 					ng-click=\'shareactive=!shareactive\' 					ng-class="{\'is-active\':shareactive}"> 					<i class=\'fi-share\'></i> Share <span class=\'caret\'></span> 				</button>  				<a class=\'btn btn-xs btn-white btn-no-text\' 					target=\'_blank\' 					href=\'/rss/{{geekitemctrl.geekitemParams.objecttype}}/{{geekitemctrl.geekitemParams.objectid}}\'> 					<i class=\'fi-rss\'></i> 					<span class="sr-only">RSS Feed</span> 				</a>  				<a href ng-href="/item/correction/boardgame/{{geekitemctrl.geekitemParams.objectid}}" class=\'btn btn-xs btn-white\'> 					Edit 				</a>  				<span class=\'game-header-admin\' show-access="itemmgr" foo="bar" access-objecttype="{{geekitemctrl.geekitemParams.objecttype}}" access-objectid="{{geekitemctrl.geekitemParams.objectid}}"> 					<a class=\'btn btn-xs btn-white\' 						ui-sref=\'geekitem.edit\'> 						Admin Edit 					</a> 				</span> 				<social-action-options 					share-name="geekitemctrl.geekitem.data.item.name" 					ng-if="shareactive" 					share-path="geekitemctrl.geekitem.data.item.href" 					image-url="geekitemctrl.geekitem.data.item.imageurl"></social-action-options> 			</div> 		</div> 	</div> </div>  ' );
t.put( 'geekitem_module_header_admin.tpl', ' 	<div class=\'game-header-admin-status\' 	     show-access="itemmgr" 	     ng-if="geekitemctrl.geekitem.data.item.itemstate !== \'approved\'" 	     ng-class="{ 	         \'is-declined\': geekitemctrl.geekitem.data.item.itemstate === \'declined\',             \'is-pending\': geekitemctrl.geekitem.data.item.itemstate === \'pending\',             \'is-revise\': geekitemctrl.geekitem.data.item.itemstate === \'revise\'}"> 		<span class=\'glyphicon glyphicon-flag\'></span> 		<span class=\'text-capitalize\'>{{geekitemctrl.geekitem.data.item.itemstate}}</span> 	</div> ' );
t.put( 'geekitem_module_header_generic.tpl', ' 	<div class=\'game-primary\' 	     ng-style="{ \'background-image\': \'url(https://cf.geekdo-static.com/images/bg/background-hex.jpg)\' }"> 		<ng-include src="\'geekitem_module_header_admin.tpl\'"></ng-include> 		<div class=\'game-header\' 		     ng-class="{ \'game-header-collapsed\': geekitemctrl.state.current.name != \'geekitem.overview\' }"> 			<div class=\'game-header-image\'> 				<ng-include src="\'geekitem_module_gamebox.tpl\'"></ng-include> 			</div> 			<div class=\'game-header-body\'> 				<div class="game-header-title-container"> 					<div class="game-header-title"> 						<div class=\'game-header-title-info\'> 							<h1> 								<a ui-sref="geekitem.overview" ng-href="{{geekitemctrl.geekitem.data.item.href|to_trusted}}"> 									{{::geekitemctrl.geekitem.data.item.name}} 								</a> 							</h1> 						</div> 					</div> 				</div>  				<div class="game-header-credits hidden-game-header-collapsed" style="margin-bottom: 20px;"> 					<div class="credits"> 						<ul> 							<li ng-if="geekitemctrl.geekitem.data.item.alternatenames.length"> 								<strong>Alternate Names</strong> 								<span ng-repeat="name in geekitemctrl.geekitem.data.item.alternatenames |limitTo:5"> 								<a ui-sref="geekitem.overview" ng-href="{{geekitemctrl.geekitem.data.item.href|to_trusted}}"> 									{{name.name}}<span ng-if="!$last">, </span> 								</a> 							</span> 							</li> 							<li ng-if="geekitemctrl.geekitem.data.item.special_user"> 								<strong>BGG User</strong> 								<a ng-href="/user/{{geekitemctrl.geekitem.data.item.special_user.username}}"> 									{{geekitemctrl.geekitem.data.item.special_user.username}} 								</a> 							</li> 						</ul> 					</div> 				</div>  				<div class=\'game-header-primary-actions hidden-game-header-collapsed\'> 					<span class=\'visible-xs\'> 						<ng-include src="\'geekitem_toolbar_generic_small.tpl\'"></ng-include> 					</span>  					<span class=\'hidden-xs\'> 						<ng-include src="\'geekitem_toolbar_generic_large.tpl\'"></ng-include> 					</span> 				</div>  				<div class=\'game-header-secondary-actions hidden-game-header-collapsed\'> 					<button 							  class=\'btn btn-xs btn-white\' 							  ng-click=\'shareactive=!shareactive\' 							  ng-class="{\'is-active\':shareactive}"> 						<i class=\'fi-share\'></i> Share <span class=\'caret\'></span> 					</button>  					<a class=\'btn btn-xs btn-white btn-no-text\' 					   target=\'_blank\' 					   href=\'/rss/{{geekitemctrl.geekitemParams.objecttype}}/{{geekitemctrl.geekitemParams.objectid}}\'> 						<i class=\'fi-rss\'></i> 						<span class="sr-only">RSS Feed</span> 					</a>  					<a href 					   ng-href="/item/correction/{{geekitemctrl.geekitemParams.subtype}}/{{geekitemctrl.geekitemParams.objectid}}" 					   class=\'btn btn-xs btn-white\'> 						Edit 					</a>  					<span class=\'game-header-admin\' show-access="itemmgr" foo="bar" 					      access-objecttype="{{geekitemctrl.geekitemParams.objecttype}}" 					      access-objectid="{{geekitemctrl.geekitemParams.objectid}}"> 						<a class=\'btn btn-xs btn-white\' 						   ui-sref=\'geekitem.edit\'> 							Admin Edit 						</a> 					</span>  					<social-action-options 							  share-name="geekitemctrl.geekitem.data.item.name" 							  ng-if="shareactive" 							  share-path="geekitemctrl.geekitem.data.item.href" 							  image-url="geekitemctrl.geekitem.data.item.imageurl"></social-action-options> 				</div> 			</div> 		</div> 	</div> ' );
t.put( 'geekitem_module_images.tpl', ' 	<div class=\'panel\' ng-class="{ \'is-loading\': !imagectrl.loaded }"> 		<div class=\'panel-header panel-header-lg\'> 			<h3 class=\'panel-title\'> 				Images 			</h3> 			<div class=\'panel-header-actions\'> 				<span ng-show="imagectrl.params.sort==\'hot\'" no-animate uib-dropdown> 					<a ng-href="#" uib-dropdown-toggle ng-class="{\'is-active\':imagectrl.params.sort == \'hot\'}"> 						Hot <span class=\'caret\'></span> 					</a> 					<ul class=\'dropdown-menu-right\' uib-dropdown-menu> 						<li class=\'dropdown-option\' ng-repeat=\'filter in imagectrl.data.config.datefilters\' ng-class=\'{active: filter.value==imagectrl.params.date}\'> 							<button type=\'button\' ng-click="imagectrl.setParam( \'date\', filter.value)" class=\'btn btn-empty\'>{{::filter.name}}</button> 						</li> 					</ul> 				</span>  				<a ng-class="{\'is-active\':imagectrl.params.sort == \'hot\'}" no-animate ng-hide="imagectrl.params.sort == \'hot\'" ng-href=\'\' ng-click="imagectrl.setParam(\'sort\', \'hot\' );">Hot</a> 				<a ng-class="{\'is-active\':imagectrl.params.sort == \'recent\'}" ng-href=\'\' ng-click="imagectrl.clearParam(\'date\'); imagectrl.setParam(\'sort\', \'recent\' );">Recent</a>  				<span class=\'hidden-xs\' ng-repeat="filter in imagectrl.data.config.filters | orderBy:\'$index\':true" no-animate uib-dropdown> 					<button  class="btn btn-sm btn-subtle" uib-dropdown-toggle> 						{{imagectrl.getFilterHeader(imagectrl.data.config[filter.listname], imagectrl.params[filter.type], filter.name)}} <span class=\'caret\'></span> 					</button> 					<ul uib-dropdown-menu ng-class="{\'dropdown-menu-lg\': filter.name == \'Licenses\'}"> 						<li ng-repeat=\'filteroption in imagectrl.data.config[filter.listname]\' class=\'dropdown-option\' ng-class="{active:filteroption.type == imagectrl.params[filter.type] || (!imagectrl.params[filter.type] && ( filteroption.type== \'\' || filteroption.type==\'all\'))}"> 							<button ng-click="imagectrl.setParam(filter.type, filteroption.type)" type=\'button\' class=\'btn btn-empty\'>{{::filteroption.name}}</button> 						</li> 					</ul> 				</span>  				<a uploadimage 					class="btn btn-sm btn-primary" 					ng-href="" 					ng-click="uploadimagectrl.popupImageUploader( imagectrl.geekitemParams.objecttype, imagectrl.geekitemParams.objectid )"> 					<i class=\'fi-plus\'></i><span class=\'hidden-xs\'> Upload</span> 				</a> 			</div> 		</div>  		<div class=\'panel-body\' 			  cg-busy="{ promise:imagectrl.loader, 					 templateUrl:\'geekitem_loadinginline.tpl\', 					 backdrop:false }">  			<div class=\'panel-body-toolbar\'> 				<div uib-dropdown class="visible-xs" auto-close=\'outsideClick\'> 					<a ng-href="#" class="btn btn-sm btn-block btn-subtle" uib-dropdown-toggle> 						<span ng-class="{\'active-filter-indicator\':imagectrl.anyFiltersFromArrayAreSet(imagectrl.data.config.filters)}"></span> 						Filters <span class=\'caret\'></span> 					</a>  					<ul uib-dropdown-menu class="dropdown-menu-right dropdown-menu-block"> 						<li> 							<ul ng-repeat="filter in imagectrl.data.config.filters | orderBy:\'$index\':true" class=\'list-unstyled\'> 								<li class="dropdown-header">{{filter.name}}</li> 								<li ng-repeat=\'filteroption in imagectrl.data.config[filter.listname]\' class=\'dropdown-option\' ng-class="{active:filteroption.type == imagectrl.params[filter.type] || (!imagectrl.params[filter.type] && ( filteroption.type== \'\' || filteroption.type==\'all\'))}"> 									<button ng-click="imagectrl.setParam(filter.type, filteroption.type)" type=\'button\' class=\'btn btn-empty\'>{{filteroption.name}}</button> 								</li> 							</ul> 						</li> 					</ul> 				</div> 				<div class=\'panel-body-toolbar-actions\' 					 uib-pagination 					 template-url="geekitem_pagination_mini.tpl" 					 total-items="imagectrl.data.config.numitems" 					 ng-model="imagectrl.params.pageid" 					 ng-change="imagectrl.pageChanged()" 					 items-per-page="imagectrl.params.showcount"> 				</div> 				<div class=\'panel-body-toolbar-count\'> 					<showing-range showcount="imagectrl.params.showcount" 										pageid="imagectrl.params.pageid" 										firstload="imagectrl.firstload" 										numitems="imagectrl.data.config.numitems"></showing-range> 					<span class=\'text-muted\' ng-if="imagectrl.data.config.numitems == 0"> 						No images found. 					</span> 					<span ng-show="imagectrl.anyFiltersAreSet()"> 						&middot; 						<button type=\'button\' class=\'btn btn-link btn-sm\' ng-click="imagectrl.clearFilters()"> 							Clear filters 						</button> 					</span> 				</div>   			</div>  			<div class=\'summary row\'> 				<div ng-repeat="image in imagectrl.data.images"> 					<div class="clearfix hidden-xs" ng-if="$index % 4 == 0"></div> 					<div class="clearfix visible-xs" ng-if="$index % 2 == 0"></div> 					<div class="summary-image-item col-xs-6 col-sm-3"> 						<a ng-href="{{::image.href}}" class=\'summary-image-thumbnail\'> 							<img alt="{{::image.caption | characters: 50}}" class="img-responsive center-block" ng-src="{{::image.imageurl}}"> 						</a>  						<div class=\'summary-item-title\'> 							<a ng-href="{{::image.href}}"> 								{{::image.caption | characters: 50}} 							</a> 						</div>  						<div class=\'summary-item-actions summary-item-actions-below\'> 							<a class=\'summary-item-counts\' ng-href="{{::image.href}}"> 								<span class="summary-item-counts-item"> 									<i class=\'fi-like\'></i> 									{{::image.numrecommend || 0 | humanize}} 								</span> 								<span class="summary-item-counts-item"> 									<span class=\'glyphicon glyphicon-comment\'></span> 									{{::image.numcomments | humanize}} 								</span> 							</a> 							&nbsp; 							<span uib-dropdown dropdown-append-to-body> 								<button type=\'button\' uib-tooltip=\'More options\' tooltip-popup-delay=\'500\' tooltip-append-to-body=\'true\' uib-dropdown-toggle class=\'btn btn-xs btn-empty text-muted\'> 									<span class=\'glyphicon glyphicon-option-vertical\'><span class="sr-only">More options</span></span> 								</button> 								<ul class=\'dropdown-menu-right\' uib-dropdown-menu> 									<li> 										<a geekmod-propose 											 ng-href="" 											 fieldname="rep_imageid" 											 ng-click="geekmodctrl.proposeRep( {\'objecttype\': \'image\', \'objectid\': image.imageid} )"> 											Propose Representative 										</a> 									</li> 									<li show-access="itemmgr|imagemgr"> 										<a geekitemedit 										   skipupdate="true" 											ng-href="" 											ng-click="geekitemeditctrl.saveField( \'rep_imageid\', image.imageid )"> 											Set Representative Image 										</a> 									</li> 								</ul> 							</span> 						</div> 					</div> 				</div> 			</div> 		</div> 		<div class="panel-cta" ng-if="imagectrl.firstload"> 			<div uib-pagination 				template-url="geekitem_pagination.tpl" 				total-items="imagectrl.data.config.numitems" 				ng-model="imagectrl.params.pageid" 				ng-change="imagectrl.pageChanged()" 				items-per-page="imagectrl.params.showcount" 				boundary-links="true" 				max-size="5"> 			</div> 			<div class=\'panel-cta-secondary\'> 				<span class=\'panel-cta-secondary-action\'> 					<showcount-selector 						showcount=\'imagectrl.params.showcount\' 						options=\'imagectrl.showcountOptions\' 						setter=\'imagectrl.setParam\'> 					</showcount-selector> 				</span> 			</div> 		</div> 	</div>  ' );
t.put( 'geekitem_module_kickstarter.tpl', ' 	<div class="advertisement advertisement-top advertisement-bottom" 		  ng-if="geekitemctrl.geekitem.data.item.versioninfo.kickstarter_widget_url && geekitemctrl.geekitem.data.item.versioninfo.premiumkickstarter"> 		<kickstarter-widget url="geekitemctrl.geekitem.data.item.versioninfo.kickstarter_widget_url"></kickstarter-widget> 		<div class=\'advertisement-text-footer\'> 			Advertisement 		</div> 	</div>  ' );
t.put( 'geekitem_module_linkeditems.tpl', ' 	<div class=\'panel\' ng-class="{ \'is-loading\': !linkeditemctrl.loaded }"> 		<div class=\'panel-header panel-header-lg\'> 			<h3 class=\'panel-title\'> 				<span class=\'hidden-xs\'> 					Linked Items 					<span class=\'text-muted fs-sm glyphicon glyphicon-chevron-right\'></span> 				</span> 				{{linkeditemctrl.moduletitle}} 			</h3> 			<div class=\'panel-header-actions\'> 				<item-sort-dropdown sortdata="linkeditemctrl.data.config.sortdata" sort="linkeditemctrl.params.sort" set-param="linkeditemctrl.setParam"></item-sort-dropdown> 				<item-filter-dropdown ng-repeat="filter in linkeditemctrl.data.config.filters" filter=\'filter\' value="linkeditemctrl.params[filter.key]" set-param="linkeditemctrl.setParam" clear-param="linkeditemctrl.clearParam"></item-filter-dropdown> 				<add-linked-item-link  class=\'btn btn-primary btn-sm\' base-item-params="linkeditemctrl.geekitemParams" link-index="linkeditemctrl.params.linkdata_index"> 					<i class=\'fi-plus\'></i><span class=\'hidden-xs\'> Add</span> 				</add-linked-item-link> 			</div> 		</div> 		<div class=\'panel-body\'> 			<div class="panel-body-toolbar"> 				<div class=\'panel-body-toolbar-actions\'> 					<div uib-pagination 						template-url="geekitem_pagination_mini.tpl" 						total-items="linkeditemctrl.data.config.numitems" 						ng-model="linkeditemctrl.params.pageid" 						ng-change="linkeditemctrl.pageChanged()" 						items-per-page="linkeditemctrl.params.showcount"> 					</div> 				</div>  				<div class=\'panel-body-toolbar-count\'> 					<showing-range showcount="linkeditemctrl.params.showcount" 										pageid="linkeditemctrl.params.pageid" 										firstload="linkeditemctrl.firstload" 										numitems="linkeditemctrl.data.config.numitems"></showing-range> 				</div> 			</div> 			<div class=\'text-muted\' ng-if="linkeditemctrl.data.items.length == 0"> 				No items found. 			</div>  			<ul class=\'summary summary-border\'> 				<linked-items-module-row item="item" ng-repeat="item in linkeditemctrl.data.items"></linked-items-module-row> 			</ul>  			<div class="panel-cta" ng-if="linkeditemctrl.data.items.length"> 				<div uib-pagination 					template-url="geekitem_pagination.tpl" 					total-items="linkeditemctrl.data.config.numitems" 					ng-model="linkeditemctrl.params.pageid" 					ng-change="linkeditemctrl.pageChanged()" 					items-per-page="linkeditemctrl.showcount" 					max-size="5" 					boundary-links="true"> 				</div> 				<div class=\'panel-cta-secondary\'> 					<span class=\'panel-cta-secondary-action\'> 						<showcount-selector  							showcount=\'linkeditemctrl.params.showcount\'  							options=\'linkeditemctrl.showcountOptions\'  							setter=\'linkeditemctrl.setParam\'> 						</showcount-selector> 					</span> 				</div> 			</div> 		</div> 	</div>  ' );
t.put( 'geekitem_module_marketplace.tpl', ' <div class=\'panel\' hide-ad-block="blockbuyacopy"> 	<a name="buyacopy"></a>  	<geek-up-ad-module geekitem="geekitemctrl.geekitem"></geek-up-ad-module>  	<div class=\'panel-header panel-header-lg\'> 		<h3 class=\'panel-title\'> 			<a ui-sref="geekitem.marketplace">Buy a Copy</a> 		</h3> 	</div> 	<div class=\'panel-body\'> 		<div class=\'game-marketplace-container\'>  			<div class=\'game-marketplace\'> 				<div class=\'row\'> 					<div class=\'col-xl-6\'> 						<div class=\'panel panel-condensed\'> 							<div ng-if="geekitemctrl.geekitem.data.item.commercelinks && geekitemctrl.hasCrowdOx()"> 								<div class=\'panel-header panel-header-sm\'> 									<div class=\'panel-title\'> 										Direct 									</div> 								</div> 								<div class=\'panel-body\' style="margin-bottom:10px;"> 									<ul class=\'summary summary-condensed summary-border summary-sale\'> 										<li ng-repeat="commercelink in geekitemctrl.geekitem.data.item.commercelinks" class="summary-item summary-sale-item"> 											<a ng-if="commercelink.ordertype !== \'geekgameshop\'" ng-href="{{commercelink.commerceurl}}"> 												<div class=\'summary-sale-item-price\'> 													<strong>Shop Now</strong> 												</div> 												<div class="summary-item-title"> 													<div class=\'summary-sale-item-store\'> 														<span class=\'glyphicon glyphicon-shopping-cart text-success\'></span> 													</div> 													<span ng-if="commercelink.ordertype !== \'crowdox_preorder\'">Buy</span><span ng-if="commercelink.ordertype === \'crowdox_preorder\'">Preorder</span> from {{commercelink.seller_name || "the Publisher"}} 												</div> 											</a> 										</li> 									</ul> 								</div> 							</div> 							<div class=\'panel-header panel-header-sm\'> 								<div class=\'panel-title\'> 									Stores 								</div> 							</div> 							<div class=\'panel-body\'> 								<ul class=\'summary summary-condensed summary-border summary-sale\'> 									<amazon-text-ad 										objecttype="geekitemctrl.geekitemParams.objecttype" 										objectid="geekitemctrl.geekitemParams.objectid" 										type="listprice"> 									</amazon-text-ad>  									<li class=\'summary-item summary-sale-item\'> 										<amazon-text-ad 											objecttype="geekitemctrl.geekitemParams.objecttype" 											objectid="geekitemctrl.geekitemParams.objectid"> 										</amazon-text-ad> 									</li> <!-- 									<li class=\'summary-item summary-sale-item\' ng-if="geekitemctrl.geekitem.data.item.targetco_url"> 										<targetco-text-ad url="geekitemctrl.geekitem.data.item.targetco_url"></targetco-text-ad> 									</li> -->  									<li class=\'summary-item summary-sale-item\' 										 ng-if="geekitemctrl.geekitem.data.item.walmart_id && geekitemctrl.geekitem.data.item.walmart_price"> 										<walmart-text-ad 											walmartid="geekitemctrl.geekitem.data.item.walmart_id" 											walmartprice="geekitemctrl.geekitem.data.item.walmart_price" 										></walmart-text-ad> 									</li>  									<li class=\'summary-item summary-sale-item\'> 										<ebay-summary 											objecttype="geekitemctrl.geekitemParams.objecttype" 											objectid="geekitemctrl.geekitemParams.objectid"> 										</ebay-summary> 									</li> 								</ul> 							</div> 						</div> 					</div> 					<div class=\'col-xl-6\'> 						<geekmarket-overview-module showcount="3"></geekmarket-overview-module> 					</div> 				</div>  			</div>  			<div  hide-ad-block="blockrectangle" class=\'game-marketplace-ad advertisement advertisement-top advertisement-bottom advertisement-medrect\'> 				<div ng-if="!geekitemctrl.geekitem.overrideRectAd" class="center-block" ng-dfp-ad="dfp-medrect"></div> 				<div ng-if="geekitemctrl.geekitem.overrideRectAd" hide-ad-block="blockrectangle"> 					<a ng-href="{{geekitemctrl.geekitem.overrideRectAd.commerceurl}}"> 						<img alt="order ad" style="max-width: 300px;" ng-src="{{geekitemctrl.geekitem.overrideRectAd.rect_ad_url}}" /> 					</a> 				</div> 				<div class=\'advertisement-text-footer\'> 					Advertisement 				</div> 			</div> 		</div> 	</div> </div>  ' );
t.put( 'geekitem_module_media.tpl', '<div ng-controller=\'GeekItem_MediaCtrl as mediactrl\' class=\'relative\'> 	<div class=\'summary-media-grid summary-media-grid-large\' ng-if=\'mediactrl.data.images.length > 1\'> 		<div class=\'summary-media-grid-row\'> 			<div class=\'summary-media-grid-item\' ng-repeat=\'image in mediactrl.data.images\'> 				 				<a class=\'game-media\' ng-href=\'{{::image.href}}\'> 					<img alt="{{::image.caption || \'game image\'}}" ng-src=\'{{::image.imageurl}}\'> 				</a> 				 			</div> 		</div> 	</div> 	<div class=\'summary-media-grid-large-counts\' ng-if=\'mediactrl.data.images.length > 1\'> 		<media-grid-info mediatype="image"></media-grid-info> 	</div> </div> ' );
t.put( 'geekitem_module_moregame.tpl', ' <div class=\'row\'> 	<div class=\'col-sm-6\'> 		<div class="panel top"> 			<div class="panel-header panel-header-lg"> 				<h3 class="panel-title">More of This Game</h3> 			</div> 			<div class="panel-body">  				<ul class=\'game-more list-block-border\'> 					<li> 						<a ui-sref="geekitem.expansions"> 							<span class=\'text-muted pull-right\'> 								{{::geekitemctrl.geekitem.data.item.linkcounts.boardgameexpansion}} 							</span> 							Expansions 						</a> 					</li> 					<li> 						<a ui-sref="geekitem.versions"> 							<span class=\'text-muted pull-right\'> 								{{::geekitemctrl.geekitem.data.item.linkcounts.boardgameversion}} 							</span> 							Versions 						</a> 					</li> 					<li ng-repeat="keyname in geekitemctrl.geekitem.data.item.relatedlinktypes"> 						<a ui-sref="geekitem.linkeditems.{{keyname}}"> 							<span class=\'text-muted pull-right\'> 								{{::geekitemctrl.geekitem.data.item.linkcounts[keyname]}} 							</span> 							{{::(geekitemctrl.geekitem.data.item.itemdata|fieldFromArrayById: \'keyname\' : keyname : \'titlepl\') || 							(geekitemctrl.geekitem.data.item.itemdata|fieldFromArrayById: \'keyname\' : keyname : \'title\')}} 						</a> 					</li> 					<li class=\'visible-xs\'> 						<a ui-sref="geekitem.geeklists"> 							GeekLists 						</a> 					</li> 					<li> 						<a ui-sref="geekitem.mygames.tags"> 							Community Tags 						</a> 					</li> 				</ul> 			</div> 		</div> 	</div> 	<div class=\'col-sm-6\'> 		<div class="panel"> 			<div class="panel-header panel-header-lg"> 				<h3 class="panel-title">News &amp; Links</h3> 			</div> 			<div class="panel-body"> 				<ul class=\'game-more list-block-border\'> 					<li> 						<a ui-sref="geekitem.mentions.links"> 							<span class=\'text-muted pull-right\'> 								{{geekitemctrl.geekitem.data.item.relatedcounts.weblink}} 							</span> 							Web Links 						</a> 					</li> 					<li> 						<a ui-sref="geekitem.mentions.news"> 							<span class=\'text-muted pull-right\'> 								{{::geekitemctrl.geekitem.data.item.relatedcounts.news}} 							</span> 							BGG News 						</a> 					</li> 					<li> 						<a ui-sref="geekitem.mentions.blogs"> 							<span class=\'text-muted pull-right\'> 								{{::geekitemctrl.geekitem.data.item.relatedcounts.blogs}} 							</span> 							BGG Blog Posts 						</a> 					</li> 					<li> 						<a ui-sref="geekitem.mentions.podcasts"> 							<span class=\'text-muted pull-right\'> 								{{::geekitemctrl.geekitem.data.item.relatedcounts.podcast}} 							</span> 							Podcasts 						</a> 					</li> 				</ul> 			</div> 		</div> 	</div> </div>  ' );
t.put( 'geekitem_module_myplays.tpl', ' <div> 	<div class=\'panel panel-collapsible\' ng-class="{\'is-collapsed\': hideMyPlays}"> 		<div class=\'panel-header panel-header-lg\'> 			<h3 class=\'panel-title\'> 				My Plays 			</h3> 			<div class=\'panel-header-actions\'> 				<button class=\'btn btn-sm btn-primary\' 						  ng-disabled="!geekitemctrl.geekitem.loaded" 						  play-recorder-button 						  login-required 						  item="::{objecttype: geekitemctrl.geekitemParams.objecttype, objectid: geekitemctrl.geekitemParams.objectid}">  					<i class=\'fi-plus\'></i> 					Log Play 				</button> 			</div> 		</div>  		<div class=\'panel-body\' ng-if="playctrl.playstats.plays.length == 0"> 			<div class=\'text-muted\'> 				You haven\'t logged any plays for this game yet. 			</div> 		</div>  		<div class=\'panel-body logged-plays\' ng-if="playctrl.playstats.plays.length > 0"> 			<div class=\'logged-play\' ng-hide="play.deleted" ng-repeat="play in playctrl.playstats.plays"> 				<div class=\'logged-play-actions\'> 					<a play-delete-button play=\'play\' class=\'btn btn-xs btn-empty text-muted\'> 						Delete 					</a> 					&nbsp; 					<a ng-href="/play/edit/{{play.playid}}" class=\'btn btn-xs btn-subtle\'> 						<i class=\'fi-pencil\'></i> Edit 					</a> 				</div> 				<div class=\'row\'> 					<div class=\'logged-play-date col-sm-2\'> 						<span title="{{play.playdate|geekdate:\'calendar\'}}"> 							<a href="/play/details/{{play.playid}}"> 								{{play.playdate|geekdate:\'briefdate\'}} 							</a> 						</span> 						<span class=\'badge\' ng-if="play.quantity > 1"> 							{{play.quantity}}x 						</span> 					</div> 					<div class=\'logged-play-description col-sm-10\'> 						<div class=\'logged-play-description-header\'> 							<span ng-if="play.location">{{play.location}}</span> 							<span class=\'text-muted text-normal\' ng-if="!play.location">No location set</span>  							<span class="separator" ng-show="play.length != 0">&dash;</span> 							<span>{{play.length|playDuration}}</span>  							<span class=\'logged-play-incomplete\' ng-if="play.incomplete == 1">Incomplete</span> 						</div>  						<!-- <div class=\'logged-play-meta\'> 							<span ng-if="play.players.length > 0"> 								With 							</span>  							<span ng-repeat="player in play.players"> 								<a ng-if="player.username" ng-href="/user/{{player.username}}"> 									{{player.name||player.username}}</a> 								<span ng-if="!player.username">{{player.name}}</span> 								<span ng-if="$index <= play.players.length - 3">,</span> 								<span ng-if="$index == play.players.length - 2"> and </span> 							</span> 						</div> -->  						<div class=\'logged-play-comment\' ng-if="play.comments.rendered != \'\'" ng-bind-html="::play.comments.rendered|to_trusted"></div>  						<div class=\'logged-play-game-details\' ng-if=\'play.players.length > 0\'> 							<div class=\'panel\'> 								<div class=\'panel-body\'> 									<table class="table table-condensed table-striped table-head-xs"> 										<thead> 											<tr> 												<th>Player</th> 												<th width=\'60\'>Team</th> 												<th width=\'30\'>Pos.</th> 												<th width=\'40\'>Score</th> 												<th width=\'45\'>Rating</th> 											</tr> 										</thead> 										<tbody> 											<tr ng-repeat="player in play.players"> 												<td class=\'logged-play-player\'> 													<div class=\'media\'> 														<div class="hidden-xs logged-play-player-avatar media-left"> 															<a ng-href="/users/{{player.username}}"> 																<img ng-if="player.avatar && player.avatarfile" ng-src="//cf.geekdo-static.com/avatars/{{player.avatarfile}}" class="avatar avatar-sm media-object"> 															</a> 															<div ng-if="!player.avatar || !player.avatarfile" class="avatar avatar-sm avatar-default media-object"> 																<i class="fi-torso"></i> 															</div> 														</div> 														<div class=\'media-body\'> 															<div class=\'logged-play-player-name\'> 																<strong ng-show="player.username"> 																	<a ng-href="/user/{{player.username}}"> 																		{{player.username}} 																	</a> 																</strong> 																<span class=\'text-muted\'>{{player.name}}</span> 																<span ng-show="player.userid==playstats.userid">(me)</span> 																<span class=\'logged-play-player-notes\'> 																	<span ng-if=\'player.new != 0\' uib-tooltip="First time playing"> 																		<i class=\'fi-burst-new c-yellow-500\'></i> 																	</span> 																	<span ng-if=\'player.win != 0\' uib-tooltip="Won"> 																		<i class=\'fi-trophy c-green-300\'></i> 																	</span> 																</span> 															</div> 														</div> 													</div> 												</td> 												<td>{{player.color}}</td> 												<td>{{player.position}}</td> 												<td>{{player.score}}</td> 												<td> 													<span ng-show=\'player.rating > 0\'> 														{{player.rating}} 													</span> 												</td> 											</tr> 										</tbody> 									</table> 								</div> 							</div> 						</div> 					</div> 				</div> 			</div> 		</div> 		<div uib-pagination 			template-url="geekitem_pagination.tpl" 			total-items="playctrl.playstats.eventcount" 			ng-model="playctrl.params.pageid" 			ng-change="playctrl.loadPage()" 			items-per-page="playctrl.params.showcount" 			boundary-links="true" 			max-size="5"> 		</div> 	</div> </div>  ' );
t.put( 'geekitem_module_official_links.tpl', ' <div class=\'panel panel-condensed\' ng-if="geekitemctrl.geekitem.loaded"> 	<div class="panel-header panel-header-condensed panel-header-sm"> 		<h3 class="panel-title">Official Links</h3> 	</div> 	<div class=\'panel-body\'> 		<ul class=\'features\'> 			<li class=\'feature feature-callout\'> 				<div class=\'feature-icon\'> 					<i class=\'fi-link\'></i> 				</div> 				<div class=\'feature-description\'> 					<span ng-hide="::geekitemctrl.geekitem.data.item.website.url"> 						<a href ng-href="/browse/weblink/{{::geekitemctrl.geekitemParams.objecttype}}/{{::geekitemctrl.geekitemParams.objectid}}"> 							Propose Official Link 						</a> 					</span> 					<span ng-if="::geekitemctrl.geekitem.data.item.website.url"> 						<a ng-href="{{::geekitemctrl.geekitem.data.item.website.url}}" target="_blank"> 							{{::geekitemctrl.geekitem.data.item.website.title}} 						</a> 						<br> 						<a class=\'text-domain\' target="_blank" href="{{::geekitemctrl.geekitem.data.item.website.url}}" ng-attr-title="{{::geekitemctrl.geekitem.data.item.website.url}}" target="_blank"> 							({{::geekitemctrl.geekitem.data.item.website.url | domainFromUrl}}) 						</a> 						&nbsp; 						<a class=\'c-icon btn btn-empty btn-xs\' href ng-href="/browse/weblink/{{::geekitemctrl.geekitemParams.objecttype}}/{{::geekitemctrl.geekitemParams.objectid}}" uib-tooltip="Propose a different link" tooltip-popup-delay=\'500\' tooltip-append-to-body=\'true\'> 							<i class=\'fi-pencil\'></i><span class="sr-only text-muted">Propose a different link</span> 						</a> 					</span> 				</div> 			</li> 			<li class=\'feature feature-callout\' ng-if="::geekitemctrl.geekitem.data.item.versioninfo.orderurl"> 				<div class=\'feature-icon\'> 					<i class=\'fi-link\'></i> 				</div> 				<div class=\'feature-description\'> 					<a ng-href="{{::geekitemctrl.geekitem.data.item.versioninfo.gamepageorderurl}}">Pre-order: {{::geekitemctrl.geekitem.data.item.name}}</a> 					<br> 					<a ng-href="{{::geekitemctrl.geekitem.data.item.versioninfo.gamepageorderurl}}" class=\'text-domain\' title="{{::geekitemctrl.geekitem.data.item.versioninfo.orderurl}}" target="_blank">({{::geekitemctrl.geekitem.data.item.versioninfo.orderurl | domainFromUrl}})</a> 				</div> 			</li> 		</ul> 	</div> </div>  ' );
t.put( 'geekitem_module_podcasts.tpl', ' 	<div class=\'panel\'> 		<div class=\'panel-header panel-header-lg\'> 			<h3 class=\'panel-title\'> 				Podcasts 			</h3> 		</div> 		<div class=\'panel-body\' 			  cg-busy="{ promise:linkeditemctrl.loader, 						    templateUrl:\'geekitem_loadinginline.tpl\', 						    backdrop:false }"> 			<div class=\'text-muted\' ng-if="linkeditemctrl.data.items.length == 0"> 				No podcasts found. 			</div> 			<div class=\'panel-body-toolbar\'> 				<div class=\'panel-body-toolbar-actions\' uib-pagination 					template-url="geekitem_pagination_mini.tpl" 					total-items="linkeditemctrl.data.config.numitems" 					ng-model="linkeditemctrl.params.pageid" 					ng-change="linkeditemctrl.pageChanged()" 					items-per-page="linkeditemctrl.params.showcount"> 				</div> 				<span class=\'panel-body-toolbar-count\'> 				  <showing-range showcount="linkeditemctrl.params.showcount" 									  pageid="linkeditemctrl.params.pageid" 									  firstload="linkeditemctrl.firstload" 									  numitems="linkeditemctrl.data.config.numitems"></showing-range> 				</span> 			</div> 			<ul class=\'summary summary-condensed summary-border\'> 				<li class=\'summary-item\' ng-repeat="item in linkeditemctrl.data.items"> 					<div class=\'row col-sm-gutters-sm\'> 						<div class=\'col-sm-9\'> 							<div class=\'summary-item-title\'> 								<a ng-href="{{podcast.href}}" ng-repeat="podcast in item.links.podcast|limitTo: 1">{{podcast.name}}</a> 							</div> 							<div class=\'summary-item-description\'> 								<a ng-href="{{item.href}}">Episode: {{item.name}}</a> 							</div> 							<div class=\'summary-item-meta\'> 								<a ng-href="{{item.href}}" title="{{::item.postdate | geekdatetime:\'calendar\'}}"> 									{{item.postdate|geekdatetime}} 								</a> &middot; 								<button class=\'btn btn-sm btn-empty\' ng-click=\'episodementions=!episodementions\'>Games mentioned <span class="caret"></span></button> 							</div> 							<div ng-show=\'episodementions\'> 								<ul class=\'summary-item-section list-normal\'> 									<li ng-repeat="link in item.links.boardgame"> 										<a ng-href="{{link.href}}">{{link.name}}</a> 									</li> 								</ul> 							</div> 						</div> 						<div class=\'col-sm-3\'> 							<div class=\'summary-item-actions\'> 								<a class=\'btn btn-xs btn-subtle\' ng-href="{{item.enclosure_link}}"> 									<span class=\'glyphicon glyphicon-play\'></span> Play <span class=\'hidden-xs\'>Audio</span> 								</a> 							</div> 						</div> 					</div> 				</li> 			</ul>  			<div class="panel-cta" ng-if="linkeditemctrl.data.items.length > 0"> 				<div uib-pagination 					template-url="geekitem_pagination.tpl" 					total-items="linkeditemctrl.data.config.numitems" 					ng-model="linkeditemctrl.params.pageid" 					ng-change="linkeditemctrl.pageChanged()" 					items-per-page="linkeditemctrl.params.showcount" 					max-size="5" 					boundary-links="true"> 				</div> 				<div class=\'panel-cta-secondary\'> 					<span class=\'panel-cta-secondary-action\'> 						<showcount-selector  							showcount=\'linkeditemctrl.params.showcount\'  							options=\'linkeditemctrl.showcountOptions\'  							setter=\'linkeditemctrl.setParam\'> 						</showcount-selector> 					</span> 				</div> 			</div> 		</div> 	</div>  ' );
t.put( 'geekitem_module_promotedvideos.tpl', '     <div class="promoted-row">         <a class="promoted-item video bgg"            ng-href="/video/{{::promotedvideosctrl.geekitem.data.item.focus_videoid}}"            ng-click="promotedvideosctrl.sendGA(             {                 hitType: \'event\',                 eventCategory: \'VideoRow\',                 eventAction: \'click:InFocus\',                 eventLabel: promotedvideosctrl.geekitem.data.item.name             } )"            ng-if="promotedvideosctrl.geekitem.data.item.focus_videoid">              <img class="promoted-logo" src="https://cf.geekdo-static.com/images/videorow/in-focus-logo.svg" alt="In Focus">             <span class="promoted-help-text">Overview Video - Sponsored</span>         </a>  		 <a class="promoted-item video how-to-play" 			 ng-href="/video/{{::promotedvideosctrl.geekitem.data.item.howtoplay_videoid}}" 			 ng-click="promotedvideosctrl.sendGA(             {                 hitType: \'event\',                 eventCategory: \'VideoRow\',                 eventAction: \'click:HowToPlay\',                 eventLabel: promotedvideosctrl.geekitem.data.item.name             } )" 			 ng-if="promotedvideosctrl.geekitem.data.item.howtoplay_videoid">              <img class="promoted-logo" src="https://cf.geekdo-static.com/images/how-to-play-logo.svg" alt="BGG How To Play"> 			 <span class="promoted-help-text">Instructional Video</span> 		 </a>  		 <a class="promoted-item video wip" 			 ng-href="/video/{{::promotedvideosctrl.geekitem.data.item.instructional_videoid}}"            ng-click="promotedvideosctrl.sendGA(             {                 hitType: \'event\',                 eventCategory: \'VideoRow\',                 eventAction: \'click:Instructional\',                 eventLabel: promotedvideosctrl.geekitem.data.item.name             } )"            ng-if="promotedvideosctrl.geekitem.data.item.instructional_videoid && !promotedvideosctrl.geekitem.data.item.howtoplay_videoid">             <img class="promoted-logo" src="https://cf.geekdo-static.com/images/videorow/wip-logo.svg" alt="Watch it Played">             <span class="promoted-help-text">Instructional Video</span>         </a>          <a class="promoted-item video gamenight"            ng-href="/video/{{::promotedvideosctrl.geekitem.data.item.playthrough_videoid}}"            ng-click="promotedvideosctrl.sendGA(             {                 hitType: \'event\',                 eventCategory: \'VideoRow\',                 eventAction: \'click:Playthrough\',                 eventLabel: promotedvideosctrl.geekitem.data.item.name             } )"            ng-if="promotedvideosctrl.geekitem.data.item.playthrough_videoid">             <img class="promoted-logo" src="https://cf.geekdo-static.com/images/videorow/gamenight-logo.svg" alt="Game Night">             <span class="promoted-help-text">Playthrough Video</span>         </a>          <a class="promoted-item video bgg"            ng-href="/video/{{::promotedvideosctrl.geekitem.data.item.summary_videoid}}"            ng-if="promotedvideosctrl.geekitem.data.item.summary_videoid && !promotedvideosctrl.geekitem.data.item.focus_videoid"            ng-click="promotedvideosctrl.sendGA(             {                 hitType: \'event\',                 eventCategory: \'VideoRow\',                 eventAction: \'click:Summary\',                 eventLabel: promotedvideosctrl.geekitem.data.item.name             } )">             <img class="promoted-logo"                  src="https://cf.geekdo-static.com/images/geek-tv-logo.svg" alt="Geek TV">             <span class="promoted-help-text">Overview Video</span>         </a>     </div>  ' );
t.put( 'geekitem_module_ratings.tpl', ' <div class=\'panel\' ng-class="{ \'is-loading\': !ratingsctrl.loaded }"> 	<div class=\'panel-header panel-header-lg\'> 		<h3 class=\'panel-title\'> 			Ratings & Comments 		</h3>  		<div class=\'panel-header-actions\'> 			<span ng-repeat="sort in ::ratingsctrl.config.sorttypes"> 				<a ng-click="ratingsctrl.setParam( \'sort\', sort.type );" 					ng-class="{ \'is-active\': sort.type==ratingsctrl.params.sort }"> 					{{::sort.name}} 				</a> 			</span>  			<span uib-dropdown> 				<button class="btn btn-sm btn-subtle" uib-dropdown-toggle> 					{{ratingsctrl.params.rating || (ratingsctrl.params.rated && "Rated" ) || \'Rating\'}} <span class=\'caret\'></span> 				</button> 				<ul uib-dropdown-menu> 					<li class="dropdown-option" ng-class="{active: !ratingsctrl.params.rated && !ratingsctrl.params.rating}"> 						<button type=\'button\' class=\'btn btn-empty\' ng-click="ratingsctrl.clearParam( \'rated\' ); ratingsctrl.clearParam( \'rating\' );"> 							Any 						</button> 					</li> 					<li class="dropdown-option" ng-class="{active: ratingsctrl.params.rated == \'1\' && !ratingsctrl.params.rating}"> 						<button type=\'button\' class=\'btn btn-empty\' ng-click="ratingsctrl.clearParam( \'rating\' );ratingsctrl.setParam( \'rated\', 1 );"> 							Rated 						</button> 					</li> 					<li class="dropdown-option" ng-class="{active: ratingsctrl.params.rating == rating}" ng-repeat="rating in ratingsctrl.ratings" ng-click="ratingsctrl.setParam( \'rating\', rating );"> 						<button type=\'button\' class=\'btn btn-empty\'> 							{{rating}} 						</button> 					</li> 				</ul> 			</span>  			<span uib-dropdown> 				<button class="btn btn-sm btn-subtle" uib-dropdown-toggle> 					<span ng-show="ratingsctrl.params[\'comment\'] > 0">Has</span> Comments <span class=\'caret\'></span> 				</button> 				<ul uib-dropdown-menu> 					<li class="dropdown-option" ng-class="{active: ratingsctrl.params.comment == \'1\'}"> 						<button class=\'btn btn-empty\' type=\'button\' ng-click="ratingsctrl.setParam( \'comment\', 1 );"> 							Has Comments 						</button> 					</li> 					<li class="dropdown-option" ng-class="{active: !ratingsctrl.params.comment}"> 						<button class=\'btn btn-empty\' type=\'button\' ng-click="ratingsctrl.clearParam( \'comment\' );"> 							Any 						</button> 					</li> 				</ul> 			</span>  			<span ng-repeat="filter in ratingsctrl.config.filters" uib-dropdown> 				<button class="btn btn-sm btn-subtle" uib-dropdown-toggle> 					{{ratingsctrl.config[filter.listname]| fieldFromArrayById: \'type\': ratingsctrl.params[filter.type]: \'name\': filter.name}} <span class=\'caret\'></span> 				</button> 				<ul uib-dropdown-menu> 					<li class=\'dropdown-option\' ng-class="{active: !ratingsctrl.params[filter.type] || filteroption.type== \'\' || filteroption.type==\'all\'}"> 						<button ng-click="ratingsctrl.clearParam(filter.type)" type=\'button\' class=\'btn btn-empty\'> 							Any 						</button> 					</li>  					<li class=\'dropdown-option\' 						 ng-repeat=\'filteroption in ratingsctrl.config[filter.listname]\' 						 ng-class="{active:filteroption.type == ratingsctrl.params[filter.type] || (!ratingsctrl.params[filter.type] && ( filteroption.type== \'\' || filteroption.type==\'all\'))}"> 						<button ng-click="ratingsctrl.setParam(filter.type, filteroption.type)" type=\'button\' class=\'btn btn-empty\'> 							{{filteroption.name}} 						</button> 					</li> 				</ul> 			</span>  			<button class=\'btn btn-sm btn-primary\' 					  uib-popover-template="\'addcomment_popover.tpl\'" 					  popover-trigger="outsideClick" 					  popover-is-open="showaddpopover" 					  popover-placement="left"> 				<i class=\'fi-plus\'></i> Add <span class=\'caret\'></span> 			</button> 		</div> 	</div>  	<div class=\'panel-body\' 		  cg-busy="{ promise:ratingsctrl.loader, 					 templateUrl:\'geekitem_loadinginline.tpl\', 					 backdrop:false }">  		<div class=\'row\'> 			<div class=\'col-sm-3 col-sm-push-9\'> 				<div class=\'panel well\' ng-if="ratingsctrl.params.status == \'fortrade\' || ratingsctrl.params.status == \'want\'"> 					<div class=\'empty-state\'> 						<div class=\'empty-state-icon\'> 							<span class=\'glyphicon glyphicon-transfer\'></span> 						</div> 						<div class=\'empty-state-description\'> 							Looking to trade this game or parts of this game with others? </a> 						</div> 						<div class=\'empty-state-cta\'> 							<a class=\'btn btn-xs btn-primary btn-block\' ui-sref=\'geekitem.trading({"status":"fortrade"})\'> 								Go to GeekTrade 							</a> 						</div> 					</div> 				</div>  				<div class=\'panel panel-bottom\'> 					<div class=\'panel-header panel-header-sm\'> 						<h3 class=\'panel-title\'> 							Ratings Breakdown 						</h3> 					</div> 					<div class=\'stats-graph\'> 						<ratings-stats-graph objecttype="{{ratingsctrl.geekitemParams.objecttype}}" 													objectid="{{ratingsctrl.geekitemParams.objectid}}" 													width="350" 													height="250" 													type="BarChart"> 						</ratings-stats-graph> 					</div> 					<div class=\'panel panel-compact visible-xs\'> 						<a class="toggler-caret btn btn-sm btn-default" ng-click="ratingsctrl.showStats = !ratingsctrl.showStats" ng-class="{ \'is-active\': ratingsctrl.showStats }"> 							<span class="glyphicon glyphicon-menu-right"></span> 							<strong>Show Collection Stats</strong> 						</a> 					</div> 				</div>  				<div ng-class="{\'hidden-xs\': !ratingsctrl.showStats}"> 					<div class=\'panel\'> 						<div class=\'panel-header panel-header-sm\'> 							<h3 class=\'panel-title\'> 								Ratings Detail 							</h3> 						</div> 						<div class=\'panel-body\'> 							<ul class=\'outline outline-condensed fs-responsive-sm outline-border-col-xs\'> 								<li class=\'outline-item\'> 									<div class=\'outline-item-title\'> 										Avg. Rating 									</div> 									<div class=\'outline-item-description\'> 										{{ratingsctrl.geekitem.data.item.stats.average|number:3}} 									</div> 								</li> 								<li class=\'outline-item\'> 									<div class=\'outline-item-title\'> 										No. of Ratings 									</div> 									<div class=\'outline-item-description\'> 										<a ui-sref="geekitem.ratings({rated:1})">{{ratingsctrl.geekitem.data.item.stats.usersrated|number}}</a> 									</div> 								</li> 								<li class=\'outline-item\'> 									<div class=\'outline-item-title\'> 										Std. Deviation 									</div> 									<div class=\'outline-item-description\'> 										{{ratingsctrl.geekitem.data.item.stats.stddev|number:2}} 									</div> 								</li> 							</ul> 						</div> 						<div class=\'panel-cta panel-cta-condensed\'> 							<ul class=\'panel-cta-list-links fs-xs\'> 								<li> 									<a href="/collection/similar/thing/{{ratingsctrl.geekitemParams.objectid}}"> 										View Similarly Rated Games 									</a> 								</li> 								<li> 									<a ui-sref="geekitem.stats"> 										View More Stats 									</a> 								</li> 							</ul> 						</div> 					</div>  					<div class=\'panel well\'> 						<div class=\'empty-state\'> 							<div class=\'empty-state-icon\'> 								<i class=\'fi-torsos-female-male\'></i> 							</div> 							<div class=\'empty-state-description\'> 								See what your GeekBuddies have to say about this game. 							</div> 							<div class=\'empty-state-cta\'> 								<a class=\'btn btn-xs btn-primary btn-block\' ng-href="/geekbuddy/analyze/{{::ratingsctrl.geekitemParams.objecttype}}/{{::ratingsctrl.geekitemParams.objectid}}"> 									GeekBuddy Analysis 								</a> 							</div> 						</div> 					</div> 				</div> 			</div> 			<div class=\'col-sm-9 col-sm-pull-3\'> 				<div class=\'panel-body-toolbar\'> 					<div class=\'panel-body-toolbar-actions\'> 						<div uib-pagination 							template-url="geekitem_pagination_mini.tpl" 							total-items="ratingsctrl.data.config.numitems" 							ng-model="ratingsctrl.params.pageid" 							ng-change="ratingsctrl.pageChanged()" 							items-per-page="ratingsctrl.params.showcount"> 						</div> 					</div> 					<span class=\'panel-body-toolbar-count\'> 						<showing-range showcount="ratingsctrl.params.showcount" 											pageid="ratingsctrl.params.pageid" 											firstload="ratingsctrl.firstload" 											numitems="ratingsctrl.data.config.numitems"></showing-range> 						<span class=\'text-muted\' ng-if="ratingsctrl.data.config.numitems == 0"> 							No items found. 						</span> 						<span ng-hide="ratingsctrl.filtersAreReset()"> 							&middot; 							<button type=\'button\' class=\'btn btn-link btn-sm\' ng-click="ratingsctrl.resetFilters()"> 								Reset filters 							</button> 						</span> 					</span> 				</div> 				<ul class=\'summary summary-callout summary-callout-lg summary-rating summary-relaxed\'> 					<li class="summary-item summary-rating-item" ng-repeat="item in ratingsctrl.data.items"> 						<div class=\'summary-item-callout\'> 							<div class="rating-angular rating-xl has-rating-{{::item.rating | ratingColor}}"> 								{{::item.rating || \'--\' | userRatingNumber }} 							</div> 						</div>  						<div class=\'comment-header\'> 							<div class=\'comment-header-avatar\'> 								<avatar-md user="::item.user"></avatar-md> 							</div> 							<div class=\'comment-header-info\'> 								<div class=\'comment-header-title\'> 									<a ng-href="/user/{{::item.user.username}}" class=\'comment-header-user\'>{{::item.user.username}}</a>  									<span class=\'comment-header-user-microbadges\'> 										<microbadge ng-repeat="microbadge in item.user.microbadges" badge=\'microbadge\'></microbadge> 									</span> 									<span class=\'comment-header-timestamp\'> 										<span title="Last updated: {{::item.review_tstamp | geekdatetime:\'calendar\'}}"> 											{{ ::item.review_tstamp | geekdatetime: \'monthyear\' }} 										</span> 									</span> 								</div> 								<div class=\'comment-header-subtitle\'> 									<div class=\'comment-header-location\'> 										<span class=\'comment-header-location-flag\' ng-if="::item.user.country != \'\'"> 											<img ng-src="{{::item.user.flagimgurl}}" alt="{{::item.user.country}} Flag" 										</span> 										<span class=\'comment-header-location-name\'> 											<span ng-if="::item.user.city != \'\' && item.user.state != \'\'"> 												{{::item.user.city}}, {{::item.user.state}} 											</span> 											<span ng-if="item.user.city == \'\' || item.user.state == \'\'"> 												{{::item.user.city}} 												{{::item.user.state}} 											</span> 											<span ng-if="::item.user.country != \'\'"> 												<span ng-if="::item.user.city != \'\' || item.user.state != \'\'"> 													&middot; 												</span> 												{{::item.user.country}} 											</span> 										</span> 									</div> 								</div> 							</div>  							<div show-access="forummgr"> 								<button remove-collection-item item="item" btn btn-xs btn-danger">Mod</button> 							</div> 							<!-- <div class=\'comment-header-menu\'> 								<button class=\'btn btn-sm btn-empty\'> 									<span class=\'glyphicon glyphicon-option-vertical\'></span> 								</button> 							</div> --> 						</div>  						<div class=\'comment-body summary-item-body\'> 							<div class=\'panel-expandable\' gk-expandable expandable-height="250px"> 								<span ng-bind-html="::item.textfield.comment.rendered|to_trusted"></span> 							</div> 						</div>  						<div class=\'summary-item-meta\'> 							<span ng-if="::item.status"> 								Collections: 								<span ng-repeat-start="status in ::ratingsctrl.config.allstatuses" ng-if-start="::item.status[status.key]">{{::status.name}}</span><span ng-if-end class="separator" ng-repeat-end>, </span> 							</span> 						</div> 					</li> 				</ul> 			</div> 		</div> 	</div> 	<div class="panel-cta" ng-if="ratingsctrl.firstload"> 		<div uib-pagination 			template-url="geekitem_pagination.tpl" 			total-items="ratingsctrl.data.config.numitems" 			ng-model="ratingsctrl.params.pageid" 			ng-change="ratingsctrl.pageChanged()" 			items-per-page="ratingsctrl.params.showcount" 			boundary-links="true" 			max-size="5"> 		</div> 		<div class=\'panel-cta-secondary\'> 			<span class=\'panel-cta-secondary-action\'> 				<showcount-selector 					showcount=\'ratingsctrl.params.showcount\' 					options=\'ratingsctrl.showcountOptions\' 					setter=\'ratingsctrl.setParam\'> 				</showcount-selector> 			</span> 		</div> 	</div> </div>  ' );
t.put( 'geekitem_module_rating_overall.tpl', ' 	<div class=\'rating-overall\'> 		<div class=\'rating-overall-callout-container\'> 			<a class=\'rating-angular rating-xl rating-overall-callout\' 				ng-class="::ratingClass" 				uib-tooltip="Average Rating - Click for Breakdown" 				tooltip-append-to-body="true" 				ui-sref="geekitem.ratings({rated:1,comment:1,status:\'\',rating:\'\'})">  				<span ng-show="showRating"> 					{{::item.stats.average | ratingNumber}} 				</span> 				<span ng-show="!showRating"> 					-- 				</span> 			</a> 		</div> 	</div>  ' );
t.put( 'geekitem_module_shopify.tpl', ' 	<shopify-widget 		showthumbnail=false 		shopifyitem="geekitemctrl.geekitem.data.item.versioninfo.shopifyitem" 		ng-if="geekitemctrl.geekitem.data.item.versioninfo.shopifyitem"> 	</shopify-widget>  ' );
t.put( 'geekitem_module_trading.tpl', ' 	<div class=\'panel\' ng-class="{ \'is-loading\': !ratingsctrl.loaded }"> 		<div class=\'panel-header panel-header-lg\'> 			<h3 class=\'panel-title\'> 				GeekTrade 			</h3> 			<div class=\'panel-header-actions\' click-out="showaddpopover=false"> 				<button class=\'btn btn-sm btn-primary\' 						  uib-popover-template="\'addtrading_popover.tpl\'" 						  popover-trigger="click" 						  popover-is-open="showaddpopover" 						  popover-placement="left"> 					<i class=\'fi-plus\'></i> Add <span class=\'caret\'></span> 				</button> 			</div>  		</div>  		<div class=\'panel-body\' 			  cg-busy="{ promise:ratingsctrl.loader, 					 templateUrl:\'geekitem_loadinginline.tpl\', 					 backdrop:false }"> 			<div class=\'panel-body-toolbar\'> 				<div class=\'panel-body-toolbar-actions\'> 					<div uib-pagination 						template-url="geekitem_pagination_mini.tpl" 						total-items="ratingsctrl.data.config.numitems" 						ng-model="ratingsctrl.params.pageid" 						ng-change="ratingsctrl.pageChanged()" 						items-per-page="ratingsctrl.params.showcount"> 					</div> 				</div> 				<span class=\'panel-body-toolbar-count\'> 					<showing-range showcount="ratingsctrl.params.showcount" 										pageid="ratingsctrl.params.pageid" 										firstload="ratingsctrl.firstload" 										numitems="ratingsctrl.data.config.numitems"></showing-range> 				</span> 			</div> 			<ul class=\'summary summary-callout summary-border summary-rating\'> 				<li class="summary-item summary-rating-item" ng-repeat="item in ratingsctrl.data.items"> 					<div class=\'summary-item-callout\'> 						<avatar-md user="item.user"></avatar-md> 					</div> 					<div class=\'row\'> 						<div class=\'col-sm-9\'> 							<div class=\'summary-item-title\'> 								<a ng-href="/user/{{::item.user.username}}">{{::item.user.username}}</a> 							</div>  							<div class=\'summary-item-description\' ng-if="item.textfield.conditiontext.rendered"> 								<span ng-bind-html="::item.textfield.conditiontext.rendered|to_trusted"></span> 							</div>  							<div class=\'summary-item-meta\'> 								<span class=\'summary-item-location\'> 									<span ng-if="::item.user.country != \'\'"> 										<img ng-src="{{::item.user.flagimgurl}}" alt="{{::item.user.country}} Flag" 									</span> 									<span ng-if="::item.user.city != \'\' && item.user.state != \'\'"> 										{{::item.user.city}}, {{::item.user.state}} 									</span> 									<span ng-if="item.user.city == \'\' || item.user.state == \'\'"> 										{{::item.user.city}} 										{{::item.user.state}} 									</span> 									<span ng-if="::item.user.country != \'\'"> 										<span ng-if="::item.user.city != \'\' || item.user.state != \'\'"> 											&middot; 										</span> 										{{::item.user.country}} 									</span> 									&middot; 								</span>  								<span title="{{::item.tstamp|geekdatetime:\'calendar\'}}"> 									{{item.tstamp|geekdatetime}} 								</span>  								<div class=\'row\' ng-if="ratingsctrl.params.status == \'hasparts\' || ratingsctrl.params.status == \'wantparts\'"> 									<div class=\'col-sm-6\'> 										<div class=\'summary-rating-item-parts\'> 											<div class=\'summary-rating-item-parts-title\'>Has Parts</div> 											<span ng-bind-html="::item.textfield.haspartslist.rendered|to_trusted"></span> 											<span ng-if="item.textfield.haspartslist.rendered == \'\'"> 												None 											</span> 										</div> 									</div>  									<div class=\'col-sm-6\'> 										<div class=\'summary-rating-item-parts\'> 											<div class=\'summary-rating-item-parts-title\'>Want Parts</div> 											<span ng-bind-html="::item.textfield.wantpartslist.rendered|to_trusted"></span> 											<span ng-if="item.textfield.wantpartslist.rendered == \'\'"> 												None 											</span> 										</div> 									</div> 								</div> 							</div> 						</div> 						<div class=\'col-sm-3\'> 							<div class=\'summary-item-actions\'> 								<span ng-if="ratingsctrl.params.status == \'fortrade\' || ratingsctrl.params.status == \'want\'"> 									<a href="/geektrade.php?action=proposenew&touser={{::item.user.username}}" class=\'btn btn-xs btn-subtle\'> 										<span class=\'glyphicon glyphicon-transfer\'></span> Propose Trade 									</a> 								</span>  								<span ng-if="ratingsctrl.params.status == \'hasparts\' || ratingsctrl.params.status == \'wantparts\'"> 									<a href="/geekmail/compose?touser={{::item.user.username}}" class=\'btn btn-xs btn-subtle\'> 										<span class=\'glyphicon glyphicon-envelope\'></span> Send Message 									</a> 								</span> 							</div> 						</div> 					</div> 				</li> 			</ul> 		</div> 		<div class="panel-cta" ng-if="ratingsctrl.firstload"> 			<div uib-pagination 				template-url="geekitem_pagination.tpl" 				total-items="ratingsctrl.data.config.numitems" 				ng-model="ratingsctrl.params.pageid" 				ng-change="ratingsctrl.pageChanged()" 				items-per-page="ratingsctrl.params.showcount" 				boundary-links="true" 				max-size="5"> 			</div> 			<div class=\'panel-cta-secondary\'> 				<span class=\'panel-cta-secondary-action\'> 					<showcount-selector  						showcount=\'ratingsctrl.params.showcount\'  						options=\'ratingsctrl.showcountOptions\'  						setter=\'ratingsctrl.setParam\'> 					</showcount-selector> 				</span> 			</div> 		</div> 	</div>  ' );
t.put( 'geekitem_module_flags.tpl', ' <div class=\'game-header-flags\' 	  ng-if="geekitemctrl.showRanks || geekitemctrl.showClassifications"> 	<div class=\'game-header-classifications hidden-game-header-collapsed\' ng-if=\'geekitemctrl.showClassifications\'> 		<div ng-if="geekitemctrl.geekitem.data.item.linkcounts.reimplements" class="game-header-subtype"> 			<span class=\'glyphicon glyphicon-link c-orange-300\'></span> Reimplements: 			<span ng-repeat="reimplements in geekitemctrl.geekitem.data.item.links.reimplements"> 				<a ng-href="{{reimplements.href}}">{{reimplements.name}}</a><span ng-if="!$last">, </span> 			</span> 		</div> 		<div ng-if="geekitemctrl.geekitem.data.item.linkcounts.expandsboardgame" class="game-header-subtype"> 			<span class=\'glyphicon glyphicon-link c-orange-300\'></span> 			Expansion for: 			<popup-list items="::geekitemctrl.geekitem.data.item.links.expandsboardgame" 							numitems="::geekitemctrl.geekitem.data.item.linkcounts.expandsboardgame" 							sref="geekitem.overview({\'#\':\'classifications-expansion-for\'})" 							loaded="geekitemctrl.geekitem.loaded" 							action="::geekitemctrl.showFullCredits" 							itemsinline="true" 							showcount=1></popup-list> 		</div> 		<div ng-if="geekitemctrl.geekitem.data.item.linkcounts.reimplementation" class="game-header-subtype"> 			<span class=\'glyphicon glyphicon-link c-orange-300\'></span> 			Reimplemented by: 			<popup-list items="::geekitemctrl.geekitem.data.item.links.reimplementation" 							numitems="::geekitemctrl.geekitem.data.item.linkcounts.reimplementation" 							sref="geekitem.linkeditems.reimplementation" 							loaded="geekitemctrl.geekitem.loaded" 							action="::geekitemctrl.showFullCredits" 							itemsinline="true" 							characters=\'20\' 							showcount=1></popup-list> 		</div> 	</div> 	<div class=\'game-header-ranks hidden-game-header-collapsed\' ng-if="geekitemctrl.showRanks"> 		<div ng-if="geekitemctrl.showRanks"> 			<i class=\'fi-crown c-orange-400 fs-md\' aria-hidden="true"></i> 			Rank: 			<ul class="ranks" 				 ng-if="(rankinfo.rank > 0) || rankinfo.rankobjecttype ===\'subtype\'" 				 ng-repeat="rankinfo in ::geekitemctrl.geekitem.data.item.rankinfo" 				 title={{::rankinfo.prettyname}}> 				<li class=\'rank\'> 					<span class=\'rank-title\'> 						{{::rankinfo.veryshortprettyname}} 					</span> 					<span class=\'rank-number\'> 						<a ng-if="::rankinfo.rank > 0" 							ng-href="{{::rankinfo.subdomain}}/browse/boardgame?sort=rank&rankobjecttype={{::rankinfo.rankobjecttype}}&rankobjectid={{::rankinfo.rankobjectid}}&rank={{::rankinfo.rank}}#{{::rankinfo.rank}}" 							class="rank-value"> 							{{::rankinfo.rank | number}} 						</a> 						<span ng-if="rankinfo.rank == 0">&dash;&dash;</span> 					</span> 				</li> 			</ul> 		</div> 	</div> </div>  ' );
t.put( 'geekitem_module_recs.tpl', '     <div class=\'panel\' ng-class="{ \'is-loading\': !recsctrl.loaded }">         <div class=\'panel-header panel-header-lg\'>             <h3 class=\'panel-title\'>                 Fans Also Like             </h3>         </div>          <div class="panel-body">             <ul class="rec-grid-module">                 <li class=\'rec-grid-item\' ng-repeat="rec in recsctrl.data.recs">                     <a class="rec"                        ng-href="{{rec.item.href}}"                        analytics-on="click"                        analytics-event="event"                        analytics-category="Recommendations"                        analytics-action="click"                        analytics-label="{{rec.item.name}}">                         <img alt="" role="presentation" class="rec-img" ng-src="{{rec.image.src}}">                         <div class="rec-body">                             <h2 class="rec-title">{{rec.item.name}}</h2>                               <div class="rec-meta">                                 <span><i class="fi-crown" aria-hidden="true"></i><span class="sr-only">Rank: </span>{{rec.rank}}</span>                                 <span><i class="fi-heart" aria-hidden="true"></i><span class="sr-only">Fans: </span>{{rec.numfans}}</span>                               </div>                         </div>                     </a>                 </li>             </ul>         </div>     </div>  ' );
t.put( 'geekitem_module_recs_overview.tpl', '     <div class=\'panel\'>         <div class=\'panel-header panel-header-lg\'>             <h3 class=\'panel-title\'>{{recsctrl.title}}</h3>         </div>          <div class=\'panel-body\'>             <div class="rec-grid-module-container">                 <ul class="rec-grid-overview">                     <li class=\'rec-grid-item\' ng-repeat="rec in recsctrl.data.recs | limitTo:6">                         <a class="rec"                            ng-href="{{rec.item.href}}"                            analytics-on="click"                            analytics-event="event"                            analytics-category="Recommendations"                            analytics-action="click"                            analytics-label="{{rec.item.name}}">                             <img class="rec-img" ng-src="{{rec.image.src}}" alt="" role="presentation">                             <div class="rec-body">                                 <h2 class="rec-title">{{rec.item.name}}</h2>                                 <div class="rec-meta">                                     <span><i class="fi-crown" aria-hidden="true"></i><span class="sr-only">Rank: </span>{{rec.rank}}</span>                                     <span><i class="fi-heart" aria-hidden="true"></i><span class="sr-only">Fans: </span>{{rec.numfans}}</span>                                 </div>                             </div>                         </a>                     </li>                 </ul>             </div>              <div class=\'panel-cta\'>                 <div class=\'panel-cta-inline-links\'>                     <a class=\'btn btn-sm btn-default\' ui-sref="{{recsctrl.recslink}}" ng-if="recsctrl.loaded">                         See All ({{recsctrl.data.numrecs | number}})                     </a>                 </div>             </div>          </div>     </div>  ' );
t.put( 'geekitem_module_reviews.tpl', ' <a name="reviews"></a> <div class=\'panel\'> 	<div class=\'panel-header panel-header-lg\'> 		<h3 class=\'panel-title\'> 			In-Depth Reviews 		</h3> 		<div class=\'panel-header-actions\'> 			<span login-required uib-dropdown> 				<button class=\'btn btn-xs btn-subtle\' uib-dropdown-toggle> 					<i class=\'fi-plus\'></i> Add <span class=\'caret\'></span> 				</button> 				<ul uib-dropdown-menu> 					<li> 						<a  href=\'/article/create/{{::reviewctrl.geekitemParams.objecttype}}/{{::reviewctrl.geekitemParams.objectid}}/63\'> 							<i class=\'fi-plus\'></i> Text Review 						</a> 					</li> 					<li> 						<a  href=\'/video/new/{{::reviewctrl.geekitemParams.objecttype}}/{{::reviewctrl.geekitemParams.objectid}}\'> 							<i class=\'fi-plus\'></i> Video Review 						</a> 					</li> 				</ul> 			</span> 		</div> 	</div> 	<div class=\'panel-body\' 		  cg-busy="{ promise:reviewctrl.loader, 						 templateUrl:\'geekitem_loadinginline.tpl\', 						 backdrop:false }"> 		<div class=\'text-muted\' ng-if="reviewctrl.data.reviews[reviewctrl.params.sort].length == 0"> 			No reviews found. 		</div>  		<div ng-repeat="sorttype in reviewctrl.sorttypes|nohot" class=\'panel\'> 			<div class=\'panel-header panel-header-sm\'> 				<h4 class=\'panel-title\'> 					{{sorttype.name}} Reviews 				</h4> 			</div> 			<div class=\'panel-body\'> 				<reviews-submodule reviews="reviewctrl.data.reviews[sorttype.sort]"></reviews-submodule>  				<div class=\'text-muted\' ng-if="!reviewctrl.data.reviews[sorttype.sort].length"> 					No reviews found. 				</div> 			</div> 		</div>  		<div class="panel-cta" ng-if="reviewctrl.data.numitems.total"> 			<div class=\'panel-inline-links\'> 				<a class=\'btn btn-sm btn-default\' ui-sref="geekitem.forums({forumid:63})"> 					All Text Reviews ({{::reviewctrl.data.numitems.thread}}) 				</a> 				<a class=\'btn btn-sm btn-default\' ui-sref="geekitem.videos({gallery:\'review\'})"> 					All Video Reviews ({{::reviewctrl.data.numitems.video}}) 				</a> 			</div> 		</div> 	</div> </div>  ' );
t.put( 'geekitem_module_reviews_compact.tpl', ' <ul class=\'summary summary-review summary-border summary-callout summary-callout-lg summary-compact\'> 	<li class=\'summary-item summary-item-inline\' 		 ng-class="::{ \'summary-item-review-video\':review.videoid }" 		 ng-repeat="review in reviewctrl.data.reviews[reviewctrl.params.sort]">  		<div class="summary-item-callout"> 			<a ng-if="::review.threadid" 				ng-href=\'/thread/{{::review.threadid}}/{{::review.linkname}}\' 				class=\'summary-item-counts\' 				title="{{::review.numrecommend}} thumbs & {{::review.numposts - 1}} comments">  				<span class="summary-item-counts-item"> 					<i class=\'fi-like\'></i> 					{{::review.numrecommend | humanize}} 				</span> 				<span class="summary-item-counts-item"> 					<span class=\'glyphicon glyphicon-comment\'></span> 					{{::review.numposts - 1 | humanize}} 				</span> 			</a>  			<a ng-if="::review.videoid" ng-href=\'/video/{{::review.videoid}}/{{::review.linkname}}#comments\' class=\'summary-item-counts\'> 				<span class="summary-item-counts-item"> 					<i class=\'fi-like\'></i> 					{{::review.numrecommend | humanize}} 				</span> 				<span class="summary-item-counts-item"> 					<span class=\'glyphicon glyphicon-comment\'></span> 					{{::review.numposts | humanize}} 				</span> 			</a> 		</div>  		<div class=\'summary-item-title\'> 			<a ng-if="::review.threadid" ng-href=\'/thread/{{::review.threadid}}/{{::review.linkname}}\'> 				{{::review.subject | characters: 75}} 			</a> 			<a ng-if="::review.videoid" ng-href=\'/video/{{::review.videoid}}/{{::review.linkname}}\'> 				<span ng-show="::review.videoid"> 					<span class=\'glyphicon glyphicon-play-circle\'></span> 				</span> 				{{::review.title | characters: 75}} 			</a> 		</div> 		<div class=\'summary-item-meta\'> 			<a ng-href="/user/{{::review.user.username}}">{{::review.user.username}}</a> 			&middot; 			<a ng-if="::review.threadid" ng-href=\'/thread/{{::review.threadid}}/{{::review.linkname}}\' title="{{::review.postdate | geekdatetime:\'calendar\'}}"> 				{{review.postdate|geekdatetime}} 			</a> 			<a ng-if="::review.videoid" ng-href=\'/video/{{::review.videoid}}/{{::review.linkname}}\' title="{{::review.postdate | geekdatetime:\'calendar\'}}"> 				{{review.postdate|geekdatetime}} 			</a> 		</div> 	</li> </ul>  ' );
t.put( 'geekitem_module_reviews_comfortable.tpl', ' <ul class=\'summary summary-review summary-border summary-callout summary-callout-lg summary-callout-responsive summary-condensed\'> 	<li class=\'summary-item\' ng-repeat="review in reviews"> 		<div class=\'summary-item-callout\'> 			<a ng-if="::review.threadid" ng-href=\'/thread/{{::review.threadid}}/{{::review.linkname}}\' class=\'summary-item-counts summary-item-counts-fixed-width\'> 				<span class="summary-item-counts-item"> 					<i class=\'fi-like\'></i> 					{{::review.numrecommend || 0 | humanize}} 				</span> 				<span class="summary-item-counts-item"> 					<span class=\'glyphicon glyphicon-comment\'></span> 					{{::review.numposts - 1 | humanize}} 				</span> 			</a>  			<a ng-if="::review.videoid" ng-href=\'/video/{{::review.videoid}}/{{::review.linkname}}#comments\' class=\'summary-item-counts summary-item-counts-fixed-width\'> 				<span class="summary-item-counts-item"> 					<i class=\'fi-like\'></i> 					{{::review.numrecommend | humanize}} 				</span> 				<span class="summary-item-counts-item"> 					<span class=\'glyphicon glyphicon-comment\'></span> 					{{::review.numposts | humanize}} 				</span> 			</a> 		</div> 		<div class=\'summary-review-inner\'> 			<div class=\'summary-review-avatar\' aria-hidden="true"> 				<avatar-md user="::review.user"></avatar-md> 			</div>  			<div ng-if="::review.videoid"> 				<div class=\'summary-review-video-thumbnail hidden-xs\' aria-hidden="true"> 					<a ng-href=\'/video/{{::review.videoid}}/{{::review.linkname}}\'> 						<img alt="video: {{::review.title | characters: 30}}" aria-labelledby="item-review-title-{{$index}}" lazy-img=\'{{::review.imageurl}}\'> 					</a> 				</div> 			</div>  			<div class=\'summary-item-title\'> 				<a ng-if="::review.threadid" ng-href=\'/thread/{{::review.threadid}}/{{::review.linkname}}\'> 					{{::review.subject | characters: 75}} 				</a> 				<a id="item-review-title-{{$index}}" ng-if="::review.videoid" ng-href=\'/video/{{::review.videoid}}/{{::review.linkname}}\'> 					<i class=\'fi-video text-muted\'></i> 					{{::review.title | characters: 75}} 				</a> 			</div> 			<div class=\'summary-item-meta\'> 				<a ng-href="/user/{{::review.user.username}}">{{::review.user.username}}</a> 				({{::review.user.textreviewcount + review.user.videoreviewcount | number}} 					<ng-pluralize count="::review.user.textreviewcount + review.user.videoreviewcount" 						when="{ 							\'one\': \'review\', 							\'other\': \'reviews\'}"> 					</ng-pluralize>) 				&middot; 				<a ng-if="::review.threadid" ng-href=\'/thread/{{::review.threadid}}/{{::review.linkname}}\' title="{{::review.postdate | geekdatetime:\'calendar\'}}"> 					{{review.postdate|geekdatetime}} 				</a> 				<a ng-if="::review.videoid" ng-href=\'/video/{{::review.videoid}}/{{::review.linkname}}\' title="{{::review.postdate | geekdatetime:\'calendar\'}}"> 					{{review.postdate|geekdatetime}} 				</a> 				<span ng-if="::review.language"> 					&middot 					{{::review.language}} 				</span> 			</div> 		</div> 	</li> </ul>  ' );
t.put( 'geekitem_module_stats.tpl', ' <div class=\'panel panel-compact visible-xs\'> 	<a class="toggler-caret btn btn-sm btn-default" ng-click="geekitemctrl.showStats = !geekitemctrl.showStats" ng-class="{ \'is-active\': geekitemctrl.showStats }"> 		<span class="glyphicon glyphicon-menu-right"></span> 		<strong>Show Community Stats</strong> 	</a> </div>  <div class=\'game-stats panel panel-compact\' ng-if="geekitemctrl.geekitem.loaded"  ng-class="{\'hidden-xs\': !geekitemctrl.showStats}"> 	<div class=\'panel-body\'> 		<div class="panel-header panel-header-sm panel-header-condensed"> 			<h3 class="panel-title"> 				<a ui-sref="geekitem.ratings({comment:\'1\'})"> 					Community Stats 				</a> 			</h3> 		</div> 		<div class=\'row\'> 			<div class=\'col-xl-6\'> 				<ul class=\'outline outline-condensed outline-border-col-xs\'> 					<li class=\'outline-item\'> 						<div class=\'outline-item-title\'> 							Own: 						</div> 						<div class=\'outline-item-description\'> 							<a ui-sref="geekitem.ratings({status:\'own\'})"> 								{{::geekitemctrl.geekitem.data.item.stats.numowned|humanize}} 							</a> 						</div> 					</li> 					<li class=\'outline-item\'> 						<div class=\'outline-item-title\'> 							Wishlist: 						</div> 						<div class=\'outline-item-description\'> 							<a ui-sref="geekitem.ratings({status:\'wishlist\'})"> 								{{::geekitemctrl.geekitem.data.item.stats.numwish|humanize}} 							</a> 						</div> 					</li> 					<li class=\'outline-item\'> 						<div class=\'outline-item-title outline-item-title-nowrap\'> 							For Trade: 							<a class=\'btn btn-xs outline-item-icon\' uib-tooltip=\'Find Matches\' tooltip-append-to-body="true" href="/trade/custom?action=customsearch&wants[]={{::geekitemctrl.geekitemParams.objecttype}}:{{::geekitemctrl.geekitemParams.objectid}}&B1=Search"> 								<i class=\'fi-torsos-female-male\'></i> 								<span class="sr-only text-muted">Find For Trade Matches</span> 							</a> 						</div> 						<div class=\'outline-item-description\'> 							<a ui-sref="geekitem.trading({status:\'fortrade\'})"> 								{{::geekitemctrl.geekitem.data.item.stats.numtrading|humanize}} 							</a> 						</div> 					</li> 				</ul> 			</div>  			<div class=\'col-xl-6\'> 				<ul class=\'outline outline-condensed outline-border-col-xs\'> 					<li class=\'outline-item\'> 						<div class=\'outline-item-title outline-item-title-nowrap\'> 							Want In Trade: 							<a class=\'btn btn-xs outline-item-icon\' tooltip-append-to-body="true" uib-tooltip=\'Find Matches\' href="/trade/custom?action=customsearch&trades[]={{geekitemctrl.geekitemParams.objecttype}}:{{geekitemctrl.geekitemParams.objectid}}&B1=Search"> 								<i class=\'fi-torsos-female-male\'></i> 								<span class="sr-only text-muted">Find Want in Trade Matches</span> 							</a> 						</div> 						<div class=\'outline-item-description\'> 							<a ui-sref="geekitem.trading({status:\'want\'})"> 								{{::geekitemctrl.geekitem.data.item.stats.numwanting|number}} 							</a> 						</div> 					</li> 					<li class=\'outline-item\'> 						<div class=\'outline-item-title\'> 							Has Parts: 						</div> 						<div class=\'outline-item-description\'> 							<a ui-sref="geekitem.trading({status:\'hasparts\'})"> 								{{geekitemctrl.geekitem.data.item.stats.numhasparts|humanize}} 							</a> 						</div> 					</li> 					<li class=\'outline-item\'> 						<div class=\'outline-item-title\'> 							Wants Parts: 						</div> 						<div class=\'outline-item-description\'> 							<a ui-sref="geekitem.trading({status:\'wantparts\'})"> 								{{geekitemctrl.geekitem.data.item.stats.numwantparts|humanize}} 							</a> 						</div> 					</li> 				</ul> 			</div> 		</div> 	</div> 	<div class=\'panel-inline-links fs-xs\'> 		<a ui-sref="geekitem.stats"> 			See All Stats 		</a> 	</div> </div>  ' );
t.put( 'geekitem_module_tags.tpl', ' 	<div class=\'panel\'> 		<div class=\'panel-header panel-header-lg\'> 			<h3 class=\'panel-title\'> 				Tags 			</h3> 			<div class=\'panel-header-actions\'> 				<a add-tag 					login-required 					class="btn btn-sm btn-primary" 					ng-href="" 					ng-click="addtagctrl.popupAddTag( tagctrl.params.objecttype, tagctrl.params.objectid )"> 					<i class=\'fi-plus\'></i><span class=\'hidden-xs\'> Add</span> 				</a> 			</div> 		</div> 		<div class="panel-body"> 			<div class=\'panel\'> 				<div class=\'panel-header panel-header-sm\'> 					<h3 class=\'panel-title\'> 						My Tags 					</h3> 				</div> 				<div class=\'panel-body\'> 					<ul class="tags-inline"> 						<li class=\'tags-inline-tag\' ng-repeat="tag in tagctrl.tagData.data.mytags"> 							<a ng-href="{{tag.href}}">{{tag.rawtag}}</a> 							<a class="tags-inline-tag-action" ng-href="" ng-click="tagctrl.unpinTag(tag)"> 								<span class="glyphicon glyphicon-minus"></span> 							</a> 						</li> 					</ul> 				</div> 			</div>  			<div class=\'panel\'> 				<div class=\'panel-header panel-header-sm\'> 					<h3 class=\'panel-title\'> 						Top Community Tags 					</h3> 				</div> 				<div class=\'panel-body\'> 					<ul class="tags-inline"> 						<li class="tags-inline-tag" ng-repeat="tag in tagctrl.tagData.data.globaltags"> 							<a ng-href="/tag/{{tag.rawtag}}">{{tag.rawtag}}</a> 							<a class="tags-inline-tag-action" ng-href="" ng-click="tagctrl.saveTag(tag)"> 								<span class="glyphicon glyphicon-plus"></span> 							</a> 						</li> 					</ul> 				</div> 			</div> 		</div> 	</div>  ' );
t.put( 'geekitem_module_textad.tpl', '<div hide-ad-block="blocktextad"> 	<fetch-text-ad 		objecttype="geekitemctrl.geekitemParams.objecttype" 		objectid="geekitemctrl.geekitemParams.objectid"> 	</fetch-text-ad> </div>' );
t.put( 'geekitem_module_textads.tpl', ' 	<div> 		<h3>All Text Ads</h3> 		<text-ad ng-repeat="ad in textadsctrl.data.ads" ad-data="ad"></text-ad> 	</div> ' );
t.put( 'geekitem_module_versions.tpl', ' 	<div class=\'panel\' ng-class="{ \'is-loading\': !linkeditemctrl.loaded }"> 		<div class=\'panel-header panel-header-lg\'> 			<h3 class=\'panel-title\'> 				Versions 			</h3>  			<div class=\'panel-header-actions\'> 				<item-sort-dropdown sortdata="linkeditemctrl.data.config.sortdata" sort="linkeditemctrl.params.sort" set-param="linkeditemctrl.setParam"></item-sort-dropdown> 				<item-filter-dropdown ng-repeat="filter in linkeditemctrl.data.config.filters" filter=\'filter\' value="linkeditemctrl.params[filter.key]" set-param="linkeditemctrl.setParam" clear-param="linkeditemctrl.clearParam"></item-filter-dropdown> 				<a class=\'btn btn-primary btn-sm\' 					ng-href=\'/item/create/boardgameversion?src_objecttype={{linkeditemctrl.geekitemParams.objecttype}}&src_objectid={{linkeditemctrl.geekitemParams.objectid}}\'> 					<i class=\'fi-plus\'></i><span class=\'hidden-xs\'> Add</span> 				</a> 			</div> 		</div> 		<div class=\'panel-body\'> 			<div class="panel-body-toolbar"> 				<div class=\'panel-body-toolbar-actions\'> 					<div uib-pagination 						template-url="geekitem_pagination_mini.tpl" 						total-items="linkeditemctrl.data.config.numitems" 						ng-model="linkeditemctrl.params.pageid" 						ng-change="linkeditemctrl.pageChanged()" 						items-per-page="linkeditemctrl.params.showcount"> 					</div> 				</div>  				<div class=\'panel-body-toolbar-count\'> 					<showing-range showcount="linkeditemctrl.params.showcount" 										pageid="linkeditemctrl.params.pageid" 										firstload="linkeditemctrl.firstload" 										numitems="linkeditemctrl.data.config.numitems"></showing-range> 				</div> 			</div> 			<div class=\'text-muted\' ng-if="linkeditemctrl.data.items.length == 0"> 				No versions found. 			</div>  			<ul class=\'summary summary-border\'> 				<li class=\'summary-item media\' ng-repeat="item in linkeditemctrl.data.items"> 					<div class=\'media-left summary-item-thumbnail\'> 						<a ng-href="{{item.href}}"> 							<img class=\'media-object\' alt=\'{{item.yearpublished}} {{item.versionname}} box cover\' ng-src=\'{{item.images.thumb}}\' 								  ng-if=\'item.images.thumb\'>  							<div class="summary-item-thumbnail-placeholder" ng-if=\'!item.images.thumb\'> 								<i class="fi-photo"><span class="sr-only text-muted">Placeholder image</span></i> 							</div> 						</a> 					</div> 					<div class=\'media-body\'> 						<div class=\'row col-sm-gutters-sm\'> 							<div class=\'col-sm-9\'> 								<div class=\'summary-item-title\'> 									<a ng-href="{{item.href}}"> 										{{item.linkedname}} 										<span ng-hide="item.linkedname">{{item.newname}} <span class="label label-danger">Name Pending</span></span> 										&dash; 										<name-with-year name="item.versionname" year="item.yearpublished"></name-with-year> 										<span class="label label-danger" ng-if="item.itemstate == \'pending\'">Pending</span> 										<span class="label label-warning" ng-if="item.itemstate == \'revise\'">Revise</span> 									</a> 								</div> 								<div class=\'summary-item-meta summary-item-section fs-xs\'> 									<ul class=\'list-unstyled\'> 										<li ng-repeat="ldata in linkeditemctrl.data.linkdata"> 											{{ldata.shorttitle||ldata.title}}: 											<span 												ng-repeat="link in item.links[ldata.keyname]"> 												{{link.name}}{{$last ? \'\' : \', \'}} 											</span> 											<span ng-if="!item.links[ldata.keyname].length">N/A</span> 										</li> 										<li ng-if="item.releasestatus == \'released\' || item.releasestatus == \'unreleased\'"> 											Status: <span class=\'text-capitalize\'>{{item.releasestatus}}</span> 											<span ng-if="item.releasedate != \'0000-00-00\' && !item.overridedate" && 													item.releasestatus== \'unreleased\'> 											&middot 											Release Date: {{item.overridedate || (item.releasedate | partialDate)}} 											</span> 										</li> 										<li ng-if="item.productcode"> 											Product Code: {{item.productcode}} 										</li> 										<li ng-if="item.length > 0 && item.width > 0  && item.depth > 0"> 											Size: 											<geek-dimensions item="item" fieldname="dimensions" itemdata="linkeditemctrl.data.itemdata"></geek-dimensions> 										</li> 										<li ng-if="item.weight > 0"> 											Weight: {{item.weight | number:2}} lbs 											or 											{{item.weight/2.2 | number:1}} kg 										</li> 									</ul> 								</div> 							</div> 							<div class=\'col-sm-3\'> 								<div class=\'summary-item-actions\'> 									<span uib-dropdown dropdown-append-to-body> 										<button type=\'button\' uib-tooltip=\'More options\' tooltip-popup-delay=\'500\' tooltip-append-to-body=\'true\' uib-dropdown-toggle class=\'btn btn-xs btn-empty text-muted\'> 											<span class=\'glyphicon glyphicon-option-vertical\'><span class="sr-only">More options</span></span> 										</button>  										<ul uib-dropdown-menu class=\'dropdown-menu-right\'> 											<li> 												<a ng-href="/item/correction/{{item.objecttype}}/{{item.objectid}}">Corrections</a> 											</li> 											<li> 												<a ng-href="" 													linkimage 													login-required 													ng-click="linkimagectrl.popupLinkImage( linkeditemctrl.geekitemParams, item )">Link Image</a> 											</li> 											<li show-access="itemmgr|imagemgr" ng-if="item.images"> 												<a ng-href="" 													linkimage 													login-required 													ng-click="linkimagectrl.removeImageLink( item, item.rep_imageid )">Unlink Image</a> 											</li> 										</ul> 									</span> 									<mini-collection-toolbar useversions="true" 										item="{ objecttype: linkeditemctrl.geekitemParams.objecttype, 												  objectid: linkeditemctrl.geekitemParams.objectid, 												  versionid: item.objectid }"></mini-collection-toolbar> 								</div> 							</div> 						</div> 					</div> 				</li> 			</ul> 			<div class="panel-cta" ng-if="linkeditemctrl.data.items.length"> 				<div uib-pagination 					template-url="geekitem_pagination.tpl" 					total-items="linkeditemctrl.data.config.numitems" 					ng-model="linkeditemctrl.params.pageid" 					ng-change="linkeditemctrl.pageChanged()" 					items-per-page="linkeditemctrl.params.showcount" 					max-size="5" 					boundary-links="true"> 				</div> 				<div class=\'panel-cta-secondary\'> 					<span class=\'panel-cta-secondary-action\'> 						<showcount-selector  							showcount=\'linkeditemctrl.params.showcount\'  							options=\'linkeditemctrl.showcountOptions\'  							setter=\'linkeditemctrl.setParam\'> 						</showcount-selector> 					</span> 				</div> 			</div> 		</div> 	</div>  ' );
t.put( 'geekitem_module_videos.tpl', ' 	<div class=\'panel\' ng-class="{ \'is-loading\': !videoctrl.loaded }"> 		<div class=\'panel-header panel-header-lg\'> 			<h3 class=\'panel-title\'> 				Videos 			</h3> 			<div class=\'panel-header-actions\' ng-if="videoctrl.loaded"> 				<sort-options sort="videoctrl.setParam(\'sort\', sortvalue)" params="videoctrl.params"></sort-options>  				<span class=\'btn-spacer\'></span>  				<persistent-selector callback="videoctrl.setParam" key="languageid" value="videoctrl.params.languageid" template-url="languageSelector.html" options="videoctrl.data.config.languages" default="0"></persistent-selector>  				<a class=\'btn btn-primary btn-sm\' 					ng-href=\'/video/new/{{videoctrl.geekitemParams.objecttype}}/{{videoctrl.geekitemParams.objectid}}\'> 					<i class=\'fi-plus\'></i><span class=\'hidden-xs\'> Add</span> 				</a> 			</div> 		</div>  		<div class=\'panel-body\' 			  cg-busy="{ promise:videoctrl.loader, 							 templateUrl:\'geekitem_loadinginline.tpl\', 							 backdrop:false }">  			<div class=\'panel-body-toolbar\' ng-if="videoctrl.data.config.numitems > 0"> 				<div uib-dropdown class="visible-xs"> 					<a ng-href="#" class="btn btn-sm btn-subtle btn-block is-active" uib-dropdown-toggle> 						{{videoctrl.data.config.galleries | fieldFromArrayById : \'type\' : videoctrl.params.gallery : \'name\':\'All Categories\'}} 						<span class=\'caret\'></span> 					</a> 					<ul class=\'dropdown-menu-block\' uib-dropdown-menu> 						<li ng-repeat="gallery in videoctrl.data.config.galleries"> 							<a ng-href="" ng-click="videoctrl.setParam(\'gallery\', gallery.type)">{{gallery.name}}</a> 						</li> 					</ul> 				</div>  				<div class=\'panel-body-toolbar-actions\'> 					<persistent-selector 						default="comfortable" 						template-url="densitySelectorThumbnailButtonGroup.html" 						key="{{videoctrl.densitykey}}" 						value="videoctrl.density"> 					</persistent-selector>  					<span ng-if=\'videoctrl.data.config.numitems > videoctrl.params.showcount\'> 						<span class=\'separator\'>|</span>  						<div uib-pagination 							template-url="geekitem_pagination_mini.tpl" 							total-items="videoctrl.data.config.numitems" 							ng-model="videoctrl.params.pageid" 							ng-change="videoctrl.pageChanged()" 							items-per-page="videoctrl.params.showcount"> 						</div> 					</span> 				</div> 				<div class=\'panel-body-toolbar-count\'> 					<showing-range showcount="videoctrl.params.showcount" 										pageid="videoctrl.params.pageid" 										firstload="videoctrl.firstload" 										numitems="videoctrl.data.config.numitems"></showing-range> 				</div>  			</div>  			<div class=\'text-muted\' ng-if="videoctrl.data.config.numitems == 0"> 				No videos found. 			</div>  			<div ng-switch on="videoctrl.density"> 				<div ng-switch-when="compact"> 					<ng-include src="\'geekitem_module_videos_compact.tpl\'"></ng-include> 				</div> 				<div ng-switch-default> 					<ng-include  src="\'geekitem_module_videos_comfortable.tpl\'"></ng-include> 				</div> 			</div> 		</div>  		<div class="panel-cta" ng-if="videoctrl.firstload"> 			<div uib-pagination 				template-url="geekitem_pagination.tpl" 				total-items="videoctrl.data.config.numitems" 				ng-model="videoctrl.params.pageid" 				ng-change="videoctrl.pageChanged()" 				items-per-page="videoctrl.params.showcount" 				max-size="5" 				boundary-links="true"> 			</div> 			<div class=\'panel-cta-secondary\'> 				<span class=\'panel-cta-secondary-action\'> 					<showcount-selector  						showcount=\'videoctrl.params.showcount\'  						options=\'videoctrl.showcountOptions\'  						setter=\'videoctrl.setParam\'> 					</showcount-selector> 				</span> 			</div> 		</div> 	</div>  ' );
t.put( 'geekitem_module_videos_overview.tpl', ' <div class=\'panel game-overview-videos\'> 	<div class=\'panel-header panel-header-lg\'> 		<h3 class=\'panel-title\'> 			<a ui-sref="geekitem.videos">Videos</a> 		</h3> 		<div class=\'panel-header-actions\'> 			<a class=\'btn btn-subtle btn-xs\' 				ng-href=\'/video/new/{{videoctrl.geekitemParams.objecttype}}/{{videoctrl.geekitemParams.objectid}}\'> 				<i class=\'fi-plus\'></i> Add 			</a> 		</div> 	</div>  	<div class=\'panel-body\'> 		<div class=\'row\'> 			<div class=\'col-xs-6 col-sm-4\'> 				<div class=\'panel panel-bottom\'> 					<div class=\'panel-header panel-header-sm\'> 						<h3 class="panel-title"> 							Hot Review 						</h3> 					</div> 					<div class=\'panel-body\'> 						<geek-video 							video=\'videoctrl.data.videos.review\' 							languageid=\'0\'> 						</geek-video> 					</div> 				</div> 			</div> 			<div class=\'col-xs-6 col-sm-4\'> 				<div class=\'panel panel-bottom\'> 					<div class=\'panel-header panel-header-sm\'> 						<h3 class="panel-title"> 							Hot "How To Play" 						</h3> 					</div> 					<div class=\'panel-body\'> 						<geek-video 							video=\'videoctrl.data.videos.instructional\' 							languageid=\'0\'> 						</geek-video> 					</div> 				</div> 			</div> 			<div class=\'hidden-xs col-sm-4\'> 				<div class=\'panel panel-bottom\'> 					<div class=\'panel-header panel-header-sm\'> 						<h3 class="panel-title"> 							Latest Video 						</h3> 					</div> 					<div class=\'panel-body\'> 						<geek-video 							video=\'videoctrl.data.videos.recent\' 							languageid=\'0\'> 						</geek-video> 					</div> 				</div> 			</div> 		</div> 		<div class=\'panel-cta\'> 			<div class=\'panel-cta-inline-links\'> 				<a class=\'btn btn-sm btn-default\' ui-sref="geekitem.videos" ng-if="videoctrl.loaded && videoctrl.data.config.numitems > 0"> 					See All ({{::videoctrl.data.config.numitems}}) 				</a> 			</div> 		</div> 	</div> </div>  ' );
t.put( 'geekitem_module_videos_overview_recent.tpl', ' 	<div class=\'panel game-overview-videos\'> 		<div class=\'panel-header panel-header-lg\'> 			<h3 class=\'panel-title\'> 				Videos 			</h3> 			<div class=\'panel-header-actions\'> 				<a class=\'btn btn-subtle btn-xs\' 					ng-href=\'/video/new/{{videoctrl.geekitemParams.objecttype}}/{{videoctrl.geekitemParams.objectid}}\'> 					<i class=\'fi-plus\'></i> Add 				</a> 			</div> 		</div>  		<div class=\'panel-body\'> 			<div class=\'row\'> 				<div class=\'col-xs-6 col-sm-4\' ng-repeat="video in videoctrl.data.videos"> 					<div class=\'panel panel-condensed panel-bottom\'> 						<div class=\'panel-header panel-header-sm\'> 							<h3 class="panel-title"> 								Recent Video 							</h3> 						</div> 						<div class=\'panel-body\'> 							<geek-video 								video=\'video\' 								languageid=\'0\'> 							</geek-video> 						</div> 					</div> 				</div> 			</div> 		</div> 		<div class=\'panel-cta\'> 			<div class=\'panel-cta-inline-links\'> 				<a class=\'btn btn-sm btn-default\' ui-sref="geekitem.videos" ng-if="videoctrl.loaded && videoctrl.data.config.numitems > 0"> 					See All ({{::videoctrl.data.config.numitems}}) 				</a> 			</div> 		</div> 	</div>  ' );
t.put( 'geekitem_module_videos_compact.tpl', ' 	<ul class=\'summary summary-callout summary-callout-lg summary-callout-responsive summary-border summary-compact\'> 		<li class=\'summary-item\' ng-repeat="video in videoctrl.data.videos"> 			<div class=\'summary-item-callout\'> 				<a class=\'summary-item-counts summary-item-counts-fixed-width\' 					ng-href="{{::video.href}}" 					title="{{::video.numrecommend || 0}} thumbs & {{::video.numcomments}} comments"> 						<span class="summary-item-counts-item"> 							<i class=\'fi-like\'></i> 							{{::video.numrecommend | humanize}} 						</span> 						<span class="summary-item-counts-item"> 							<span class=\'glyphicon glyphicon-comment\'></span> 							{{::video.numcomments | humanize}} 						</span> 				</a> 			</div> 			<div class=\'summary-item-body\'> 				<div class="media"> 					<div class="media-left"> 						<div class=\'summary-item-media-thumbnail\'> 							<a class="embed-responsive-16by9" ng-href="{{::video.href}}"><img class="media-object embed-responsive-item" ng-src="{{::video.images.square}}"></a> 						</div> 					</div> 					<div class="media-body"> 						<div class=\'summary-item-title\'> 							<a ng-href="{{::video.href}}">{{::video.title | characters: 75}}</a> 						</div>  						<div class=\'summary-item-meta\'> 							<span class=\'summary-item-tag\'> 								<a ng-href="" ng-click="videoctrl.gotoState( $event, \'geekitem.videos\', { \'gallery\': video.gallery } )">{{::video.gallery}}</a> 							</span> 							<a ng-href="/user/{{video.user.username}}">{{::video.user.username}}</a>  							&middot;  							<span>{{video.postdate|geekdatetime}}</span>  							<span ng-hide="videoctrl.params.languageid != 0"> 								&middot; 								<span> 									<a ng-href="" ng-click="videoctrl.setParam(\'languageid\', video.languageid)">{{::video.language}}</a> 								</span> 							</span>  							<span ng-if="::video.duration"> 								&middot; 								{{::video.duration|PTduration}} 							</span> 						</div> 					</div> 				</div> 			</div> 		</li> 	</ul>  ' );
t.put( 'geekitem_module_videos_comfortable.tpl', ' <div class=\'summary summary-media row\'> 	<div ng-repeat="video in videoctrl.data.videos"> 		<div class="clearfix visible-xs visible-sm" ng-if="$index % 2 == 0"></div> 		<div class="clearfix visible-md visible-lg" ng-if="$index % 3 == 0"></div> 		<div class=\'col-xs-6 col-md-4\'> 			<geek-video 				video=\'video\' 				set-param="videoctrl.setParam" 				languageid=\'{{videoctrl.params.languageid}}\'> 			</geek-video> 		</div> 	</div> </div>  ' );
t.put( 'geekitem_module_weblinks.tpl', ' 	<div class=\'panel\' ng-class="{ \'is-loading\': !linkeditemctrl.loaded }"> 		<div class=\'panel-header panel-header-lg\'> 			<h3 class=\'panel-title\'> 				Web Links 			</h3>  			<div class=\'panel-header-actions\'> 				<item-filter-dropdown ng-repeat="filter in linkeditemctrl.data.config.filters" filter=\'filter\' value="linkeditemctrl.params[filter.key]" set-param="linkeditemctrl.setParam" clear-param="linkeditemctrl.clearParam"></item-filter-dropdown> 				<a class=\'btn btn-primary btn-sm\' 					ng-href=\'/item/create/weblink?src_objecttype={{linkeditemctrl.geekitemParams.objecttype}}&src_objectid={{linkeditemctrl.geekitemParams.objectid}}\'> 					<i class=\'fi-plus\'></i><span class=\'hidden-xs\'> Add</span> 				</a> 				<a show-access="admgr" class=\'btn btn-primary btn-sm\' 					ng-href=\'/item/create/commerceweblink?src_objecttype={{linkeditemctrl.geekitemParams.objecttype}}&src_objectid={{linkeditemctrl.geekitemParams.objectid}}\'> 					<i class=\'fi-plus\'></i><span class=\'hidden-xs\'> Add Commerce</span> 				</a>  			</div> 		</div> 		<div class=\'panel-body\' 			  cg-busy="{ promise:linkeditemctrl.loader, 						 	 templateUrl:\'geekitem_loadinginline.tpl\', 						 	 backdrop:false }"> 			<div class=\'panel-body-toolbar\'> 				<div class=\'panel-body-toolbar-actions\'> 					<div uib-pagination 						template-url="geekitem_pagination_mini.tpl" 						total-items="linkeditemctrl.data.config.numitems" 						ng-model="linkeditemctrl.params.pageid" 						ng-change="linkeditemctrl.pageChanged()" 						items-per-page="linkeditemctrl.params.showcount"> 					</div> 				</div> 				<span class=\'panel-body-toolbar-count\'> 					<showing-range showcount="linkeditemctrl.params.showcount" 										pageid="linkeditemctrl.params.pageid" 										firstload="linkeditemctrl.firstload" 										numitems="linkeditemctrl.data.config.numitems"></showing-range> 				</span> 			</div> 			<div class=\'text-muted\' ng-if="linkeditemctrl.data.items.length == 0"> 				No links found. 			</div> 			<ul class=\'summary summary-condensed summary-border\'> 				<li class=\'summary-item\' 					 ng-repeat="item in linkeditemctrl.data.items" 					 ng-mouseover="linkhover=true" 					 ng-mouseleave="linkhover=false">  					<div class=\'pull-right\' uib-dropdown dropdown-append-to-body> 						<button type=\'button\' uib-tooltip=\'More options\' tooltip-popup-delay=\'500\' tooltip-append-to-body=\'true\' uib-dropdown-toggle class=\'btn btn-xs btn-empty text-muted\'> 							<span class=\'glyphicon glyphicon-option-vertical\'><span class="sr-only">More options</span></span> 						</button> 						<ul uib-dropdown-menu class=\'dropdown-menu-right\'> 							<li> 								<a href="/weblink/{{item.objectid}}">View Item</a> 							</li> 							<li> 								<a href="/item/correction/weblink/{{item.objectid}}">Report</a> 							</li> 							<li> 								<a geekmod-propose 									ng-href="" 									fieldname="rep_weblinkid" 									ng-click="geekmodctrl.proposeRep( item )">Propose Representative</a> 							</li> 							<li show-access="itemmgr" access-objecttype="{{linkeditemctrl.geekitemParams.objecttype}}" access-objectid="{{linkeditemctrl.geekitemParams.objectid}}"> 								<a geekitemedit 								   skipupdate="true" 									ng-href="" 									ng-click="geekitemeditctrl.saveField( \'rep_weblinkid\', item.objectid )"> 									 Set Representative Website 								</a> 							</li> 						</ul> 					</div> 					<div class=\'summary-item-title\'> 						<a rel="nofollow noreferrer noopener" ng-href="{{item.url}}" target="_blank"> 							{{item.name}} 						</a> 						(<a rel="nofollow noreferrer noopener" ng-href="{{item.url}}" title="{{item.url}}" target="_blank" class=\'text-domain\'>{{item.url |domainFromUrl}}</a>) 					</div> 					<div class=\'summary-item-meta\'> 						{{item.postdate|geekdatetime}} 						<span	ng-repeat="category in item.links.category"> 							<a ng-href="" ng-click="linkeditemctrl.setParam(\'categoryfilter\', category.objectid)">{{category.name}}</a> 								<span ng-hide="$last">, </span> 						</span> 						<span ng-repeat="language in item.links.languages"> 							&middot;	<a ng-href="" ng-click="linkeditemctrl.setParam(\'languagefilter\', language.objectid)">{{language.name}}</a> 						</span> 					</div> 				</li> 			</ul> 		</div> 		<div class="panel-cta" ng-if="linkeditemctrl.data.items.length > 0"> 			<div uib-pagination 				template-url="geekitem_pagination.tpl" 				total-items="linkeditemctrl.data.config.numitems" 				ng-model="linkeditemctrl.params.pageid" 				ng-change="linkeditemctrl.pageChanged()" 				items-per-page="linkeditemctrl.params.showcount" 				max-size="5" 				boundary-links="true">             </div> 			<div class=\'panel-cta-secondary\'> 				<span class=\'panel-cta-secondary-action\'> 					<showcount-selector  						showcount=\'linkeditemctrl.params.showcount\'  						options=\'linkeditemctrl.showcountOptions\'  						setter=\'linkeditemctrl.setParam\'> 					</showcount-selector> 				</span> 			</div> 		</div> 	</div>  ' );
