t.put( 'star_guidelines.tpl', ' <span class=\'rating-stars-guideline\'> 	<span ng-if="overstar >= 1 && overstar < 2"> 		Awful - defies game description. 	</span> 	<span ng-if="overstar >= 2 && overstar < 3"> 		Very bad - won’t play ever again. 	</span> 	<span ng-if="overstar >= 3 && overstar < 4"> 		Bad - likely won’t play this again. 	</span> 	<span ng-if="overstar >= 4 && overstar < 5"> 		Not so good - but could play again. 	</span> 	<span ng-if="overstar >= 5 && overstar < 6"> 		Mediocre - take it or leave it. 	</span> 	<span ng-if="overstar >= 6 && overstar < 7"> 		Ok - will play if in the mood. 	</span> 	<span ng-if="overstar >= 7 && overstar < 8"> 		Good - usually willing to play. 	</span> 	<span ng-if="overstar >= 8 && overstar < 9"> 		Very good - enjoy playing and would suggest it. 	</span> 	<span ng-if="overstar >= 9 && overstar < 10"> 		Excellent - very much enjoy playing. 	</span> 	<span ng-if="overstar == 10 || (!overstar && ratingvalue == 10)"> 		Outstanding - will always enjoy playing. 	</span> </span>  ' );
