t.put( 'geekitem_poll.tpl', ' 	<div class=\'modal-header modal-header-table\'> 		<div class=\'modal-header-table-left\'> 			<button class=\'visible-xs-inline btn btn-indigo\' ng-click="$dismiss()" type=\'button\'> 				<span>Cancel</span> 			</button> 		</div> 		<div class=\'modal-header-table-center\'> 			<h3 class="modal-title"><span ng-if="results">Results</span><span ng-hide="results">Vote</span></h3> 		</div> 		<div class=\'modal-header-table-right\'> 			<button class=\'close hidden-xs\' ng-click="$close();" type=\'button\'> 				<span>&times;</span> 			</button> 			<button ng-show="!results" class=\'visible-xs-inline btn btn-primary\'  ng-click="submit()" type=\'button\'> 				<span>Submit</span> 			</button> 		</div> 	</div>  <div class="modal-body" ng-if="results"> 	<div class=\'poll-question\' ng-repeat="question in results.pollquestions"> 		<poll-question-results ng-if="question.questionformat == \'mcsa\'" question="question" ng-questionformat="mcsa"> </poll-question-results> 		<poll-question-results ng-if="question.questionformat == \'msa\'" question="question" ng-questionformat="msa"> </poll-question-results> 	</div> 	<button class="btn btn-primary btn-lg" ng-click="questions();">Go to Poll</button> 	<span class=\'btn-spacer\'></span> 	<button class="btn btn-link btn-sm" ng-click="$dismiss();">Close</button> </div>  <div class="modal-body" ng-hide="results"> 	<div class=\'poll-question\' ng-repeat="question in poll.pollquestions"> 		<poll-question ng-if="question.questionformat == \'mcsa\'" question="question" ng-questionformat="mcsa"> </poll-question> 		<poll-question ng-if="question.questionformat == \'msa\'" question="question" ng-questionformat="msa"> </poll-question> 	</div> 	<button class="btn btn-link btn-sm" ng-click="showResults();">See Results</button> </div>  <div class="modal-footer" ng-hide="results"> 	<button class="btn btn-primary btn-lg" ng-click="submit();" ng-show="!results">Vote</button> 	<button ng-show="answered()" class="btn btn-link btn-sm" ng-click="clear();">Clear</button> 	<button class="btn btn-link btn-sm" ng-click="$dismiss();">Cancel</button> </div>  ' );
t.put( 'pollquestion-msa.html', '     <div class=\'poll-question-title\' ng-bind="question.question.body"></div>     <table class="table table-striped">         <thead>         <tr>             <th></th>             <th ng-repeat="column in question.question.choicesc">                 {{column.body}}             </th>         </tr>         </thead>         <tbody>         <tr ng-repeat="row in question.question.choicesr">             <th>                 {{row.body}}             </th>             <td ng-repeat="column in question.question.choicesc">                 <input type="radio" ng-model="vote[\'q\' + question.questionid + \'r\' + row.choiceid]" ng-value="\'c\'+column.choiceid+\'r\'+row.choiceid">             </td>         </tr>         </tbody>     </table>  ' );
