t.put( 'pollquestion-results-msa.html', '     <div class=\'poll-question-title\' ng-bind="question.results.question.body"></div>     <table class="table table-condensed table-striped poll-results">         <thead>         <tr>             <th></th>             <th ng-repeat="column in question.results.question.choicesc">                 {{column.body}}             </th>             <th>Vote Count</th>         </tr>         </thead>         <tbody>         <tr ng-repeat="row in question.results.question.choicesr">             <th>                 {{row.body}}             </th>             <td ng-repeat="column in question.results.question.choicesc" ng-controller="PollResultElement">                 <span ng-class="{\'is-winner\':result.maxrows}">{{result.percent|number:1}}% ({{result.votes}})</span>             </td>             <td>                 {{question.results.rowvoters[row.choiceid]}}             </td>         </tr>         <tr>             <td ng-repeat="column in question.results.question.choicesc"></td>             <th>Total voters</th>             <td>{{question.results.voters}}</td>         </tr>         </tbody>     </table>  ' );
